INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('걸음마 놀이', '걸음마 보조기는 아기가 독립적으로 걷는 법을 배우는 데 도움이 되는 유용한 도구입니다. 하지만 안전하고 효과적으로 사용하기 위해서는 올바른 방법을 익히는 것이 중요합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 걸음마 보조기를 사용하여 안전한 공간에서 천천히 걷도록 합니다. 아이가 넘어지거나 다치지 않도록 주의 깊게 지켜봐야 합니다' || char(10) ||'2. 쿠션, 담요, 의자 등을 이용하여 간단한 장애물 코스를 만들고 아이가 걸음마 보조기를 사용하여 코스를 통과하도록 합니다' || char(10) ||'', '걸음마 보조기', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('아기 체육관 놀이', '아기 체육관을 통해서 다양한 신체활동을 통해서 대근육 발달시킬 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기가 위를 바라보게 누워서 소리나는 발받침으로 스스로 발을 굴리게 합니다' || char(10) ||'2. 누워서 모빌을 치거나 잡기가 어렵기 때문에 역류방지 쿠션을 이용해서 손으로 치거나 잡기 쉽게 해주어야 합니다' || char(10) ||'3. 터미타임시 눈 앞에 장난감으로 보여주거나 소리를 내줍니다' || char(10) ||'', '아기 체육관, 역류방지 쿠션', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('풍선치기 놀이', '매달린 풍선을 치게 함으로써 대근육발달 및 시각발달에 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이를 눕혀서 손이 닿을 거리에 풍선을 매달아서 치게 합니다' || char(10) ||'', '풍선', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('블록 길 따라 걷기', '블록 위에서 중심을 잡고 걸으면서 신체능력과 균형감각을 향상시킵니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 블록위로 아이가 걸을 수 있는 자그만한 길 만듭니다' || char(10) ||'2. 블록 위에서 중심을 잡으면서 걷게합니다. 아이가 넘어지지 않게 손을 잡아주면서 돌발 상황에 대비합니다' || char(10) ||'', '블록', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('무너뜨리기 놀이', '무너뜨리기 놀이를 하며 욕구를 충족시켜줄 수 있급니다. 던지지 못하게 하기보다는 욕구를 충족시켜주는 것이 더 중요합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 안전한 도구들을 쌓습니다' || char(10) ||'2. 아기가 무너뜨리게 하거나 유도합니다' || char(10) ||'', '쌓아서 무너뜨릴 수 있는 다양한 도구', '0~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('매트 놀이', '매트를 이용해서 다양한 신체능력을 향상시킬 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 매트계단을 만들어서 오르락내리락 점프하기' || char(10) ||'2. 매트계단 엉금엉금 기어가기' || char(10) ||'3. 매트로 벽을 만들어서 까꿍놀이(균형잡기)' || char(10) ||'', '매트', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('공놀이', '아기와 함께 하는 공놀이는 운동 능력, 시각 인지 능력, 손과 눈의 협응력, 사회성, 언어 능력 발달에 도움이 되는 재미있는 놀이입니다. 또한 아이가 자신감을 가지고 즐거움을 느낄 수 있는 좋은 기회를 제공합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 공을 앞으로 굴리도록 합니다. 아이가 공을 쉽게 굴릴 수 있도록 처음에는 가까운 거리에서 시작하고 점차 거리를 늘려 줍니다' || char(10) ||'2. 아이가 공을 던지고 잡도록 합니다. 아이가 공을 쉽게 던지고 잡을 수 있도록 처음에는 큰 공을 사용하고 점차 작은 공으로 바꿉니다' || char(10) ||'', '공', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('박스 활용 놀이', '박스를 활용해서 다양한 신체활동을 할 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 박스 안팎을 자유롭게 탐험하도록 합니다. 아이가 박스 안에 숨어보거나 박스를 이용하여 집이나 성을 만들 수 있도록 합니다' || char(10) ||'2. 여러 개의 박스를 이용하여 간단한 놀이집을 만들 수 있습니다. 아이가 박스를 쌓고 창문이나 문을 만들도록 격려합니다' || char(10) ||'3. 박스를 이용하여 간단한 장애물 코스를 만들 수 있습니다. 아이가 박스를 넘거나 기어 다니며 코스를 완주하도록 합니다' || char(10) ||'4. 아이가 박스에 색칠을 하도록 합니다. 이 놀이는 아이의 창의력과 상상력을 발휘하는 데 도움이 됩니다' || char(10) ||'', '박스', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('풍선 배드민턴', '집에서 할 수 있는 간단한 배드민턴놀이입니다. 배드민턴 놀이를 통해서 신체 능력을 향상시킬 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 사용하지 않는 얇은 옷걸이의 중간을 당겨줍니다' || char(10) ||'2. 스타킹으로 감싸서 채를 만들어 줍니다' || char(10) ||'3. 풍선을 셔틀콕으로 이용해서 아이와 함께 배드민턴 놀이를 즐깁니다' || char(10) ||'', '옷걸이, 스타킹, 풍선', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('끌기 놀이', '아기와 함께 하는 끌기 놀이는 운동 능력, 손과 눈의 협응력, 인지 능력 향상에 도움이 되는 놀이입니다 줄을 끌거나 당기는 놀이를 통해서 아이가 힘을 조절하는 방법을 키울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 장난감이나 물건을 끈을 이용하여 끌도록 합니다. 아이가 쉽게 끌 수 있도록 처음에는 가벼운 물건을 사용하고 점차 무거운 물건으로 바꿉니다' || char(10) ||'', '끌고 다닐 수 있는 장난감', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('밀기 놀이', '청소하는 모습에 관심이 많아 미는 장난감으로 청소하는 모습을 따라하면서 신체능력을 향상시킬 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 장난감을 스스로 밀고 다니기' || char(10) ||'', '밀고 다니는 장난감(수레형, 막대형)', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('폼롤러 신체 놀이', '폼롤러 사용해서 간단한 신체활동으로 자연스럽게 균형감각을 길러줄 수 있다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 폼롤러를 세로로 세워서 아이를 위해 앉힙니다' || char(10) ||'2. 무너질듯 무너지지 않게 잘 잡아주면서 균형감각을 기를 수 있습니다' || char(10) ||'', '폼롤러', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('아기 손놀이', '아기들이 여러 장난감 들을 손에 쥐어보면서 소근육이 발달하고 스스로 탐색할 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 주먹 쥔 손에 물건 쥐게 합니다' || char(10) ||'2. 손으로 탐색해보기 유도합니다' || char(10) ||'3. 팔목에 딸랑이를 걸어주어서 자기 팔과 손의 움직임에 관심 유도합니다' || char(10) ||'4.. 점차 손을 펼치기 시작하면 딸랑이, 가벼운 장난감 쥐어줍니다' || char(10) ||'', '손에 쥘 수 있는 가벼운 장난감, 딸랑이', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('과일따기 놀이', '집에 있는 분유통을 활용해서 장난감을 만들고 다양한 활동을 할 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 분유통에 펠트지 붙이고 보들이 붙이고 붙일 수 있는 과일 장난감을 붙이기' || char(10) ||'2. 통에 달린 열매를 열심히 따보기' || char(10) ||'3. 통을 두드려서 소리내어 보기도 하기' || char(10) ||'4. 과일을 담고 빼는 놀이도 반복하기' || char(10) ||'5. 뚜껑을 열었다 닫았다 반복하기' || char(10) ||'', '분유통, 펠트지, 보들이, 붙일 수 있는 과일 장난감', '1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('물고기 낚시 놀이', '물고기 장난감을 물 속에서 떠올리면서 놀수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 물고기 장난감들을 물을 담을 수 있는 곳에 풀어놓기' || char(10) ||'2. 장난감들을 물속에서 떠올리면서 놀기' || char(10) ||'', '물고기 장난감', '1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('솜공 집게 놀이', '손으로도 잡을 수 있고 집게를 활용해서 솜공을 잡고 넣었다 빼면서 놀 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 손으로 솜공을 넣었다 빼기' || char(10) ||'2. 집게를 활용해서 솜공을 넣었다 빼기' || char(10) ||'3. 젓가락도 사용할 수 있다' || char(10) ||'4. 식사 시간에 숟가락, 포크 사용 연습이나 강요는 식사 시간에 대한 부정적인 인식을 줄 수 있으니 연습은 놀이 시간을 활용하기', '집게, 젓가락, 솜공', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('딱 붙어라 놀이', '다양한 장남감들을 붙이고 떼면서 놀 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 테이프나 시트지를 활용해서 붙일 수 있는 공간 만듭니다' || char(10) ||'2. 다양한 장난감들을 붙이고 떼면서 다양한 활동을 합니다' || char(10) ||'', '시트지, 테이프, 붙일 수 있는 여러 장난감', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('자석 낚시 놀이', '자석 낚시 장난감으로 아이의 집중력과 인지 능력을 기를 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 낚싯대와 자석이 달린 낚싯줄을 이용하여 물고기 장난감을 낚도록 합니다. 아이가 쉽게 낚을 수 있도록 처음에는 물고기 장난감을 물 위에 띄워 놓고 점차 물 속에 잠기도록 합니다' || char(10) ||'2. 다양한 색깔의 물고기 장난감을 준비하고 아이가 색깔에 따라 물고기 장난감을 분류하도록 합니다. 이 놀이는 아이의 시각 인지 능력과 인지 능력을 향상시키는 데 도움이 됩니다' || char(10) ||'', '자석 낚시 장난감', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('끼적이기 놀이', '아이가 끄적이는 행위를 할 수 있는 다양한 환경을 조성하기' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 박스에 아이가 붓으로 물을 이용해서 칠하기' || char(10) ||'2. 자석보드는 이용해서 그리기' || char(10) ||'', '박스, 붓, 자석보드', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('끈 꿰기 놀이', '눈과 손을 협응하는 놀이이다. 특히 소근육 운동은 두뇌 발달을 돕고 자조 기술을 향상시키는 기초가 될 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 큰 구멍이 있는 종이나 천에 끈을 꿰도록 합니다. 아이가 쉽게 꿰릴 수 있도록 처음에는 두꺼운 끈과 큰 구멍을 사용하고, 점차 얇은 끈과 작은 구멍으로 바꿉니다' || char(10) ||'2. 꿰는 행위를 통해서 소근육 운동을 할 수 있습니다' || char(10) ||'', '끈, 안전한 바늘, 꿸 수 있는 장난감', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('모래놀이, 클레이', '모래놀이를 하면서 촉감 등 오감 자극도 줄 수 있지만 도구 사용으로 자연스럽게 소근육 발달도 도울 수 있다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 클레이 주물럭 거리기' || char(10) ||'2. 도구를 활용해 모래를 담거나 빼기' || char(10) ||'', '모래, 클레이', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('채반 꽂기 놀이', '작은 구멍에 물체를 꽂으면서 집중력을 향상시킬 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 채반 거꾸로 해서 젓가락 끼우는 놀이' || char(10) ||'2. 아이의 발달 수준에 따라 더 작은 면봉으로도 교체할 수 있습니다' || char(10) ||'', '채반, 젓가락, 면봉', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('볼트와 너트 놀이', '소근육을 사용해서 돌렸을 때 빠지고 끼워진다는 개념을 생성할 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 볼트와 너트 장난감으로 돌리면서 끼우고 빼기' || char(10) ||'2. 더 어려운 방법으로 색깔이나 크기별로 다르게 해서 난이도 조절해보기' || char(10) ||'', '볼트, 너트 장난감', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('페그보드 놀이', '구멍에 맞춰 끼워보며 소근육을 발달 시킬 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 구멍에 맞춰서 끼워보기' || char(10) ||'2. 연령이나 색 등에 관심이 많은 아이는 색깔 별로 같은 색끼리 모아서 분류해보는 것도 시도해보기' || char(10) ||'', '페그보드', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('가위질 놀이', '가위는 안전을 위해 아기들이 사용하는 칼날이 없는 안전 가위를 사용하고 아이가 보고 따라해볼 수 있도록 사용하는 모습을 보여주는 것도 좋은 놀이 촉진 방법입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 가위로 자를 수 있는 물건들을 잘라보기' || char(10) ||'2. 아이가 어려워 한다면 ''신문지 찢기''로도 소근육 발달 돕기가 가능' || char(10) ||'3. 가위로 자르면서 집중력 향상' || char(10) ||'', '안전 가위, 신문지', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('드릴 놀이', '나사를 조이고 풀어보면 신체활동을 할 수 있고 샛깔모양 판이 있어서 색, 모양에도 관심 가져보기가 가능합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 드릴 장난감으로 나사를 조이고 풀어보기' || char(10) ||'2. 작은 나사를 조이고 푸는 행위는 집중력 향상과 소근육 발달에도 도움이 된다' || char(10) ||'', '드릴 장난감, 나사', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('로션 놀이', '오감을 통해 사물을 탐색하고 의도적인 행동을 시도하는 나이이므로 오감을 길러주고 아기와의 애착형성을 위해 접촉을 촉진하는 놀이가 될 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기와 마주 앉아서 아기의 손에 로션을 따라 준다' || char(10) ||'2. 함께 손, 팔, 발 등에 로션으로 미끌미끌 놀이를 한다' || char(10) ||'3. 놀이 중 아기가 로션을 먹지 않도록 해야 한다' || char(10) ||'', '로션', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('스카프 날리기 놀이', '신체 이동 능력이 증가하고 낯은 가리고 격리불안을 느끼기 시작하는 나이 이므로 이러한 놀이를 통해 눈에 안보여도 보호자가 곁에 있음을 인지시켜주는 것이 좋습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 스카프를 흔들며 바람을 만들기' || char(10) ||'2. 스카프를 아기의 머리에 씌어 주고 까꿍 놀이' || char(10) ||'3. 엄마를 스카프로 가리고 엄마 찾기 놀이' || char(10) ||'', '스카프', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('팔 터널 통과하기', '혼자 스스로 무언가를 하려는 성향이 강하기 때문에 놀이시 아이의 독립성을 격려하면서도 안전하게 보호하도록 해야 합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 무릎과 손바닥을 바닥에 대고 배를 들어 터널처럼 동그랗게 만들기' || char(10) ||'2. 아이가 그곳을 기어서 통과하게 하는 놀이' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('뒤뚱뒤뚱 걸어요', '이시기의 아이는 자신의 물건을 남과 나눠쓰기 싫어하고 자기 위주의 성향이 강하므로 이러한 놀이를 통해 협동력을 키우는 것이 좋습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 발 위에 아기의 발을 얹어 놓기' || char(10) ||'2. 서로 손을 잡고 발을 움직여 앞뒤로 걸어다니기' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('티슈펀치', '이 시기의 아이는 일상생활에서 성인에게 의존하던 것들을 스스로 하고 싶어하므로 이러한 놀이는 이시기 아이의 성취감을 높여주는 데에 좋습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 티슈 한 장을 뽑아서 가슴 정도에서 양손으로 잡아서 아이가 주먹으로 티슈를 칠 수 있도록 꼭 잡아주기' || char(10) ||'2. 아이의 도전을 통해 성취감을 올려주기 위한 활동으로 아이가 주먹으로 치면 휴지를 잡아당겨 꼭 성공할 수 있도록 해주기' || char(10) ||'', '티슈펀치', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('신문치 축구 놀이', '이 시기의 아이는 기본적인 운동 기능이 확립되어 활발히 노는 것을 좋아하기 때문에 여러가지 신체능력을 두루 활용할 수 있도록 하는 것이 좋습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 여러 조각의 신문지를 뭉쳐 동그랗게 만든 후 테이프로 고정하여 신문지 공을 만듭니다' || char(10) ||'2. 신문지 공을 이용하여 축구 놀이하기' || char(10) ||'', '신문지', '3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('색깔 얼음으로 그림 그리기', '이시기는 소근육의 조정 능력이 정교해 지므로 이러한 놀이가 도움이 될 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 여러 가지 색깔의 포스터 컬러를 물에 섞은 뒤 얼음틀에 붓고 면봉으로 손잡이가 되도록 합니다' || char(10) ||'2. 도화지에 색깔 얼음으로 그림을 그려봅니다' || char(10) ||'', '색깔 얼음', '3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('초점책', '초점책 놀이는 아이의 인지 발달에 도움이 되는 놀이입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 초점책(흑백)을 보면서 인지능력을 향상시킬 수 있다' || char(10) ||'2. 100일 정도 지나면 컬러책으로 바꾸어 주기' || char(10) ||'', '초점책', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('헝겁책, 촉감책', '이 시기의 아기는 손과 손가락을 움직이는 능력이 발달하며 손을 닫거나 열기 시작한다. 소근육 발달 향상에 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 그림책 중에도 찢어지는 책보다는 하드북이 좋습니다' || char(10) ||'2. 만졌을 때 다양한 촉감을 느낄 수 있는 헝겊책이나 부분 촉감책' || char(10) ||'3. 소리를 들을 수 있는 사운드 북' || char(10) ||'4. 구강 욕구가 강해서 뭐든지 입으로 가져가는 아이라면 모서리에 치발기 형태로 된 치발기 책' || char(10) ||'', '헝겁책, 촉감책', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('링쌓기', '이 시기의 아기는 물체를 더 잘 파악하고 물체를 주의 깊게 바라보거나 따라다닙니다. 물체들의 기능과 용도에 대해 호기심을 보이며 새로운 물체들을 탐구합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 링을 쌓거나 빼면서 인지 능력을 향상시킬 수 있습니다' || char(10) ||'', '링 장난감', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('목욕놀이 장난감', '물체를 잡거나 쥐고 흔드는 등의 기본적인 손과 눈의 협응력을 키워줄 수 있는 놀이입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 목욕을 할 때 목욕놀이 장난감을 같이 이용해 신체 활동을 할 수 있습니다', '목욕놀이 장난감', '0~1세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('퍼즐 놀이', '퍼즐놀이를 통해서 조각마다 숨겨진 그림과 형태를 자세히 들여다보면서 자연스럽게 관찰력이 발달하고 관찰하고 얻은 힌트들을 엮어서 빈 곳에 맞는 조각을 찾는 상상력도 키울 수 있으며 모여가는 조각이 빈 공간을 좁혀 완성하고 싶은 욕구에 몰입하고 집중력을 키울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 0~2세 아이들에게는 도형 퍼즐, 심플한 도형을 같은 모양끼리 맞추는 퍼즐을 사용합니다' || char(10) ||'2. 3~5세 아이들에게는 직소 퍼즐, 퍼즐을 완성하면서 자존감도 높이는 계기를 마련할 수 있습니다' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 억지로 시키지 않기' || char(10) ||'2. 하나 맞출때마다 칭찬해 주기' || char(10) ||'3. 함께하기' || char(10) ||'', '퍼즐', '0~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('확대경', '확대경은 아이에게 세상을 새로운 시각으로 보여주는 신비로운 도구입니다 작은 물체를 확대하여 관찰하고 숨겨진 세부사항을 발견하며,아이들의 자연스러운 탐구심과 학습 능력을 키울 수 있는 효과가 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 자연 속 물체 관찰을 통해 다양한 자연 속 물체를 확대경으로 면밀히 관찰하고 그 모양, 색깔, 질감 등을 자세히 살펴본다' || char(10) ||'2. 다양한 물체를 확대경으로 촬영한 사진을 활용하여 퀴즈를 만들고 서로 맞춰보는 놀이' || char(10) ||'3. 색색의 투명 필름을 확대경에 붙여 색색 안경을 만들어 다양한 색깔로 세상을 바라노는 놀이' || char(10) ||'', '확대경', '3~4세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('밀가루 놀이', '밀가루 놀이를 통해 감각 발달, 창의력 향상, 신체 능력 향상의 효과를 볼 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 밀가루를 손바닥에서 펴서 만지고 쥐고 눌러보며 다양한 질감을 느낄 수 있다' || char(10) ||'2. 밀가루를 밀고 눌러서 다양한 형태를 만드는 과정에서 아이들의 손 근육과 눈과 손의 협응 능력을 키울 수 있다' || char(10) ||'', '밀가루', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('색칠 놀이', '색칠 놀이는 아이들의 집중력, 인내심, 좌우뇌 협응 능력, 시각 인지 능력, 색채 인식 능력을 향상시키는 데 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 자유로운 색칠을 통해 스스로 색깔을 선택하고 표현하는 방식은 상상력과 창의력을 발휘하는 데 도움이 된다' || char(10) ||'2. 특정 테마를 정하고 그에 맞는 그림을 색칠하기' || char(10) ||'3. 미리 선이 그려진 그림지를 사용하여 선 안에 색칠하는 놀이' || char(10) ||'', '색깔펜, 색깔놀이 자료, 크레파스', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('레고', '레고 블록은 단순한 장난감 이상으로 아이들의 창의력, 문제 해결 능력, 운동 능력, 인지 능력, 사회성 발달에 큰 도움을 줄 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 이들에게 레고 블록을 주고 자유롭게 만들도록 하기' || char(10) ||'2. 블록 세트에 포함된 설계도에 따라 건설하기' || char(10) ||'3. 특정 테마를 정하고 그에 맞는 것을 만들기' || char(10) ||'', '레고', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('점토 놀이', '점토 놀이를 통해 다양한 감각적 경험을 하고 상상력과 창의력을 키우며 운동 능력과 인지 능력 발달에도 도웁이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 점토를 주고 자유롭게 만지고 눌러보고 꼬집어보고 찢어보는 등 원하는 대로 놀도록 합니다' || char(10) ||'2. 동물, 식물, 인물 등 특정 테마를 정하고 그 테마와 관련된 작품을 만들도록 합니다' || char(10) ||'3. 두 명 이상의 아이들이 함께 협력하여 하나의 작품을 만들도록 합니다' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 점토 놀이를 할 때는 아이가 삼키지 않도록 주의해야 합니다' || char(10) ||'2. 놀이가 끝난 후에는 아이의 손을 깨끗하게 씻어주세요' || char(10) ||'3. 점토를 보관할 때는 밀폐 용기에 담아 햇빛이 직사하지 않는 곳에 보관하세요' || char(10) ||'', '점토', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('역할 놀이', '역할 놀이는 아이들이 다양한 상황을 탐색하고 사회성을 배우고 언어 능력을 향상시키는 데 효과적인 놀이 방법입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 가족 구성원 (엄마, 아빠, 할머니, 할아버지 등) 을 따라 하고 가족 구성원 간의 역할을 하는 놀이. 예를 들어, 아이가 엄마가 되어 아빠에게 밥을 주고, 빨래를 하는 등의 역할을 할 수 있습니다' || char(10) ||'2. 다양한 직업을 선택하고 그 직업을 하는 사람이 하는 일을 하는 놀이. 예를 들어 아이가 의사가 되어 아픈 사람을 진찰하고 선생님이 되어 학생들에게 공부를 가르치는 등의 역할을 할 수 있습니다' || char(10) ||'3. 친구들과 함께 다양한 역할을 나누어 하고 이야기를 만들어 나가는 놀이. 예를 들어 아이들이 병원 놀이를 하면서 아이 한 명은 의사가 되고 다른 아이들은 환자가 되는 등의 역할을 할 수 있습니다' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '4~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('비눗방울 놀이', '비눗방울 놀이를 통해 다양한 감각적 경험을 하고, 운동 능력과 인지 능력 발달에도 도움을 줄 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 비눗물과 빨대 또는 비눗방울 도구를 준비하여 아이가 직접 비눗방울을 불어내는 놀이' || char(10) ||'2. 식용 색소를 첨가하여 다양한 색깔의 비눗방울을 만드는 놀이' || char(10) ||'3. 손, 발, 몸 전체를 사용하여 비눗방울을 터뜨리는 놀이' || char(10) ||'', '비눗방울 장난감', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('음악 놀이', '음악을 듣고 노래 부르고 악기를 연주하면서 다양한 능력을 키울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 좋아하는 동요나 노래를 함께 부른다. 간단한 노래부터 시작하여 점차 어려운 노래까지 도전해 볼 수 있습니다' || char(10) ||'2. 음악을 듣고 몸을 움직이면서 춤을 추어 봅니다. 간단한 춤 동작부터 시작하여 점차 복잡한 동작까지 도전해 볼 수 있습니다' || char(10) ||'3. 아이가 좋아하는 악기를 사용하여 연주할 수 있습니다. 처음에는 간단한 타악기부터 시작하여 점차 다양한 악기를 연주해 볼 수 있습니다' || char(10) ||'', '악기', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('그림자 놀이', '그림자 놀이를 통해 다양한 상상력과 창의력을 발휘할 수 있습니다. 아이들이 자유롭게 표현하고 즐길 수 있는 재미있는 놀이입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 햇빛이나 조명 아래에서 아이가 자유롭게 몸을 움직여 그림자를 만들어 봅니다. 동물, 사람, 물건 등 다양한 모양의 그림자를 만들어 볼 수 있습니다' || char(10) ||'2. 아이들이 그림자를 이용하여 간단한 연극을 해봅니다. 동화나 이야기를 바탕으로 그림자 공연을 만들 수도 있습니다' || char(10) ||'', '햇빛, 조명', '3~4세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('숨바꼭질', '이 놀이는 아이들이 즐겁게 참여하면서 다양한 능력을 키울 수 있는 효과적인 방법입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 한 명의 아이가 "찾는 사람"이 되어 눈을 감고 다른 아이들이 숨는 동안 일정한 숫자까지 세고 숨은 아이들을 찾습니다' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('동화책 읽기', '동화책 속 이야기는 아이들의 상상력을 자극하고 창의적인 사고 능력을 키울 수 있습니다. 다양한 어휘와 문장을 접하게 되어 아이들의 언어 능력 발달에도 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이의 연령과 관심사에 맞는 책을 선택합니다' || char(10) ||'2. 조용하고 편안한 장소에서 책을 읽어줍니다' || char(10) ||'3. 책의 내용에 따라 목소리의 높낮이, 속도, 어조를 다양하게 표현합니다' || char(10) ||'4. 아이가 책 속 그림을 보면서 질문을 하거나 이야기를 나눕니다' || char(10) ||'', '동화책', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('종이 접기 놀이', '종이접기 놀이를 통해 순서를 이해하고 공간 인식 능력을 키우며 손과 눈의 협응력을 발달시키는 데 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 사각형, 삼각형, 원, 심장 등 기본적인 도형을 접습니다' || char(10) ||'2. 동물, 꽃, 자동차, 집 등 아이가 좋아하는 모양을 접습니다' || char(10) ||'3. 아이의 발달에 따라 종이 접기 단계를 선택합니다' || char(10) ||'', '종이', '3~5세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('보드 게임', '아이들은 게임을 진행하면서 상황을 분석하고 계획을 세우며 문제 해결 능력을 키울 수 있습니다. 서로 생각을 나누고 전략을 논의하면서 의사소통 능력과 협력 능력도 향상시킬 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이의 연령과 관심사에 맞는 보드게임을 선택합니다' || char(10) ||'2. 규칙이 간단하고 플레이 시간이 짧은 보드게임부터 시작합니다' || char(10) ||'3. 아이들이 직접 게임을 선택하도록 합니다' || char(10) ||'4. 함께 게임을 즐기는 시간을 갖습니다' || char(10) ||'', '보드판', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('과학 실험 놀이', '과학 실험 놀이는 아이들의 자연스러운 호기심을 충족시키고 다양한 과학 개념을 쉽고 재미있게 이해할 수 있도록 도와주는 좋은 방법입니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 물의 특성을 살펴보는 실험을 합니다. 물이 액체, 고체, 기체로 변하는 모습을 관찰하거나 물에 색소를 넣어 섞어보는 실험 등을 할 수 있습니다' || char(10) ||'2. 색깔을 섞어 새로운 색을 만드는 실험을 합니다. 물감을 섞어보거나 색종이를 겹쳐보는 실험 등을 할 수 있습니다' || char(10) ||'', '과학 기구', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('체스', '체스는 전략적 사고 문제 해결 능력 집중력 인내심을 키우는 데 도움이 되는 지적 놀이입니다. 다양한 상황을 분석하고 계획을 세우며 문제를 해결 하면서 전략적 사고 능력을 키울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 킹, 퀸, 룩, 비숍, 나이트, 폰의 역할과 이동 방식을 가르칩니다. 아이들이 각 말의 특징을 이해하고 기본적인 규칙을 익힐 수 있도록 단계별로 안내해줍니다' || char(10) ||'2. 체스판과 말의 배치 방법을 가르칩니다. 아이들이 체스판을 올바르게 준비하고 말을 배치하는 방법을 익힐 수 있도록 도와줍니다' || char(10) ||'3. 아이들이 체스 게임의 목표를 이해하고 기본적인 전략을 익힐 수 있도록 도와줍니다' || char(10) ||'', '체스', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('미로 찾기', '미로 찾기 놀이는 아이들이 다양한 방법을 시도하고 문제를 해결하는 놀이입니다. 이런 놀이를 통해 인내심과 공간을 인식하고 방향 감각을 키우는데 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 종이에 그려진 간단한 미로부터 시작합니다. 아이들이 미로 찾기의 기본적인 방법을 익힐 수 있도록 쉬운 미로부터 시작하는 것이 중요합니다' || char(10) ||'2. 미로 속에 숨겨진 보물을 찾는 미로를 합니다. 아이들이 탐험심을 가지고 문제 해결 능력을 키울 수 있도록 합니다' || char(10) ||'3. 제한된 시간 안에 미로를 찾는 미로를 합니다. 아이들이 집중력과 시간 관리 능력을 향상시킬 수 있도록 합니다' || char(10) ||'', '종이, 미로 세트', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('도미노 놀이', '도미노 놀이는 아이들이 다양한 방법을 시도하고 문제를 해결해야 하는 놀이입니다. 따라서 아이들을 도미노 놀이를 통해서 문제 해결능력을 키울 수 있고, 집중력 향상, 공간 인식 능력 향상의 효과를 기대할 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이의 연령과 수준에 맞는 도미노 놀이를 선택합니다. 너무 어렵거나 쉬운 놀이는 아이들의 흥미를 저하시킬 수 있습니다' || char(10) ||'2. 도미노판을 깔고, 번호 순서대로 도미노 조각을 배치하고 첫 번째 도미노 조각이 넘어지면서 연쇄적으로 넘어지는 모습을 관찰하면서 아이들이 물리적인 원리와 작동 방식을 이해하고 흥미를 느낄 수 있도록 합니다' || char(10) ||'3. 도미노 조각을 사용하여 다양한 모양이나 그림을 만들어 봅니다' || char(10) ||'', '도미노', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('탐정 놀이', '탐정 놀이는 6~7세 아동에게 상상력, 추리력, 문제 해결 능력을 키우는 데 도움이 되는 재미있는 놀이입니다. 또한 협동심, 의사소통 능력, 창의력을 발휘할 수 있는 기회를 제공합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 집안 곳곳에 숨겨진 단서를 찾도록 합니다. 단서는 종이, 그림, 사진, 물건 등 다양한 형태로 만들 수 있습니다. 단서를 찾는 과정에서 아이들이 주의력과 관찰력을 발휘하도록 합니다' || char(10) ||'2. 간단한 사건을 만들어 아이들이 사건의 진실을 파악하도록 합니다. 사건은 실종 사건, 도난 사건, 범죄 사건 등 다양한 주제로 만들 수 있습니다. 아이들이 다양한 단서를 분석하고 증거를 조사하며 용의자를 심문하는 과정을 통해 추리력과 문제 해결 능력을 키울 수 있도록 합니다' || char(10) ||'3. 아이들이 탐정, 사건의 피해자, 용의자 등 다양한 역할을 맡아 역할극을 합니다. 역할극을 통해 아이들이 상상력과 창의력을 발휘하고 다양한 사람들의 입장을 이해할 수 있도록 합니다' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('종이비행기 날리기', '비행기 놀이를 통해 창의력, 운동 능력, 문제 해결 능력, 과학적 사고 능력을 키울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 간단한 종이 비행기를 만들어 날리는 방법을 익힙니다. 다양한 종류의 종이 비행기를 만들고 날아가는 모습을 관찰하며 흥미를 느낄 수 있도록 합니다' || char(10) ||'2. 종이 비행기의 각 부분 (날개, 꼬리, 앞부분)의 역할과 영향을 살펴봅니다. 아이들이 종이 비행기의 구조와 작동 방식을 이해하도록 합니다' || char(10) ||'3. 친구들과 함께 종이 비행기 장거리 비행 경쟁을 합니다. 아이들이 경쟁심을 가지고 더 멀리 날아가는 종이 비행기를 만들기 위해 노력하도록 합니다' || char(10) ||'', '종이', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('자전거 타기', '자전거 타기 놀이는 운동 능력, 안전 의식을 키우는 데 도움이 되는 놀이입니다. 또한 사회성을 배우고 협동심을 발휘할 수 있는 기회를 제공합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 안전한 장소에서 균형 잡기와 페달 밟는 연습을 합니다. 아이들이 자전거를 안전하게 조작하고 자신감을 가지고 타는 방법을 익힐 수 있도록 합니다' || char(10) ||'2. 공원이나 자전거 도로에서 간단한 코스를 따라 자전거를 타봅니다. 아이들이 코스를 따라 안전하게 주행하고 방향 감각을 키울 수 있도록 합니다' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 보호 장비 (헬멧, 무릎 보호대, 팔꿈치 보호대)를 착용하여 안전을 최우선으로 합니다' || char(10) ||'', '자전거', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('마술 놀이', '마술 놀이는 아이들이 상상력을 자유롭게 표현하고 창의적인 사고를 하는 데 도움이 됩니다. 마술 트릭을 연습하면서 아이들이 문제를 해결하고 목표를 달성하기 위해 노력하는 능력을 키울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 카드 사라지기, 나타나기, 변하기 등 간단한 카드 트릭을 연습합니다. 아이들이 쉽게 따라 할 수 있도록 단계별로 안내하고 연습할 수 있도록 합니다' || char(10) ||'2. 동전 사라지기, 나타나기, 변하기 등 간단한 동전 트릭을 연습합니다. 아이들이 손놀림을 향상시키고 관객들의 눈을 속일 수 있는 방법을 배우도록 합니다' || char(10) ||'3. 실 사라지기, 나타나기 등 간단한 실 트릭을 연습합니다. 아이들이 손놀림을 향상시키고 섬세한 동작을 연습할 수 있도록 합니다' || char(10) ||'', '마술 도구', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('타이포그래피 놀이', '타이포그래피 놀이는 아동에게 상상력, 창의력, 미적 감각, 문제 해결 능력을 키우는 데 도움이 되는 재미있는 활동입니다.  글자를 통해 표현하는 방법을 배우고 자신만의 작품을 만들 수 있는 기회를 제공합니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 다양한 색깔의 종이에 알파벳을 크게 써서 벽에 붙입니다. 아이들이 알파벳의 형태와 특징을 관찰하고 색깔과 글자의 조합을 자유롭게 표현하도록 합니다' || char(10) ||'2. 알파벳을 사용하여 동물, 꽃, 사람 등 다양한 그림을 만듭니다. 아이들이 상상력을 발휘하고 창의적인 작품을 만들 수 있도록 합니다' || char(10) ||'3. 좋아하는 단어를 선택하여 크게 써서 장식합니다. 아이들이 단어의 의미를 생각하고 다양한 색깔과 글꼴을 사용하여 단어를 표현하도록 합니다' || char(10) ||'4. 단어를 사용하여 시, 노래, 이야기를 만듭니다. 아이들이 언어 표현력을 향상시키고 창의적인 작품을 만들 수 있도록 합니다' || char(10) ||'5. 잡지, 신문, 책 등에서 글자를 잘라내 붙여 콜라주를 만듭니다. 아이들이 글자의 형태와 배치를 자유롭게 표현하고 다양한 소재를 활용하여 작품을 만들 수 있도록 합니다' || char(10) ||'', '색종이, 알파벳, 테이프, 신문, 잡지, 가위', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('로봇 조립 놀이', '로봇 조립 놀이는 창의력, 문제 해결 능력, 논리적 사고 능력, 운동 능력, 협동심을 키우는 데 도움이 되는 재미있는 활동입니다. 또한 과학 기술에 대한 관심을 높이고 미래 사회를 준비하는 데에도 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 레고 블록을 사용하여 간단한 로봇을 조립합니다. 아이들이 로봇의 기본적인 구조와 작동 방식을 이해하고 창의력을 발휘하여 다양한 형태의 로봇을 만들 수 있도록 합니다' || char(10) ||'2. 시중에 판매되는 다양한 로봇 조립 키트를 활용하여 로봇을 조립합니다. 로봇 조립 키트는 다양한 기능과 난이도를 가지고 있으므로 아이의 연령과 수준에 맞는 키트를 선택하는 것이 중요합니다' || char(10) ||'', '레고, 로봇 조립 키트', '6~7세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('식물 키우기', '아이와 함께 식물을 키우는 것은 흥미롭고 보람 있는 경험입니다. 아이들은 식물을 돌보면서 자연에 대한 관심을 키우고 책임감을 배우며 다양한 것을 배울 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이들과 함께 다양한 씨앗을 심고 새싹이 자라는 것을 관찰하는 것은 재미있는 경험입니다. 씨앗 심기는 아이들에게 인내심과 책임감을 가르치는 좋은 방법입니다' || char(10) ||'2. 아이들과 함께 꽃을 심고 아름다운 꽃을 피우는 것을 즐길 수 있습니다. 꽃 심기는 아이들에게 아름다움을 감상하고 자연을 사랑하는 마음을 키우는 데 도움이 됩니다' || char(10) ||'3. 아이들과 함께 토마토, 오이, 양파 등 간단한 채소를 키울 수 있습니다. 채소 키우는 것은 아이들에게 건강한 음식에 대한 관심을 키우고 음식의 소중함을 알려주는 좋은 방법입니다' || char(10) ||'', '심을 수 있는 씨앗, 작물, 흙, 물', '3~4세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('거울 보며 냠냠', '거울 보며 아기와 함께 숟가락 놀이를 해보세요. 숟가락 사용이 익숙하지 않은 아기가 엄마의 표정과 행동에 호기심을 가지고 따라 하며 숟가락을 사용하는 방법을 익힐 수 있고, 다양한 맛 표현을 통해 먹는 것에 흥미를 가질 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 거울 앞에 아기와 함께 앉습니다.' || char(10) ||'2. 숟가락을 아기가 잡을 수 있도록 도와준 뒤 엄마도 함께 숟가락을 잡습니다.' || char(10) ||' 3. 거울을 보며 "냠냠" 하고 숟가락을 입에 가까이 가져갑니다.' || char(10) ||'4. 아기가 거울 속 엄마의 모습을 따라 할 수 있도록 도와줍니다.' || char(10) ||'5. 입을 크게 벌리 숟가락을 입에 넣고 먹는 흉내를 내며 놀이합니다. ', '이유식 숟가락, 거울, 그릇', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('미로 안의 엄마를 찾아요', '베개로 미로를 만들어주세요. 베개 길을 따라 엉금 엉금 기어가는 과정이 대근육 발달을 도와주고, 아빠와 함께 베개 미로를 통과하며 친밀감과 애착감을 형성할 수 있습니다. ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 베개로 미로를 만들어주세요. ' || char(10) ||'2. 원형 안에 엄마가 들어가서 앉습니다.' || char(10) ||'3. 아빠와 아기는 원형의 베개를 따라 기어갑니다. 엄마는 아기가 기는 행동을 응원해주세요. ' || char(10) ||'4. 베개 미로를 따라 기어가다 입구를 만나면 엄마가 아기를 안아주며 맞이합니다. ' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법 ' || char(10) ||'베개가 부족하다면 책이나 놀잇감으로 미로를 구성해주어도 좋습니다. ' || char(10) ||'', '베개, 방석 등 넘어가기 조금 어려운 장애물, 미로를 만들 수 있는 준비물을 활용해 주세요', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('포스트잇을 떼어요', '가구에 포스트잇을 붙여주세요. 알록달록한 색이 아기의 시각을 자극하고 포스트잇을 떼기 위한 과정을 통해 눈과 손의 협응력과 대근육 발달을 도와줍니다. ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 포스트잇을 아기가 손을 뻗으면 닿을 수 있는 정도의 높이에 다양하게 붙입니다. ' || char(10) ||'2. 엄마가 포스트잇을 떼는 모습을 보여줍니다.' || char(10) ||'3. 아기가 포스트잇을 떼기 위해 움직이는 모습을 격려해줍니다.' || char(10) ||'4. 포스트잇을 떼어냈을 때 아기의 행동을 칭찬해줍니다.  ' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'바닥에서부터 높은 위치까지 포스트잇을 단계적으로 붙여주면 아기의 관심도가 더 높아질 수 있습니다.  ' || char(10) ||'', '다양한 색과 크기의 포스트잇', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('셀로판지를 구겨요', '셀로판지를 쥐고 구기는 놀이는 아기의 시각, 청각, 촉각 등 감각의 다양한 자극을 주고 눈과 손의 협응력과 소근육 발달을 증진시켜줍니다.  ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기에게 셀로판지를 보여주며 흥미를 유발합니다.  ' || char(10) ||'2. 셀로판지를 쥐여주고 자유롭게 구기거나 잡아당기게 격려합니다. ' || char(10) ||'3. 눈앞에 셀로판지를 대주어 시야의 색이 변하는 것을 경험하게 해줍니다. ' || char(10) ||'4. 구겨진 셀로판지를 동그랗게 뭉쳐 꽉 쥐거나 던져보게 합니다.  ' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'1. 놀이 재료를 입에 넣지 않도록 주의해 주세요.' || char(10) ||'2. 이 시기 아기들은 입으로 탐색하는 ''구강기’에 해당하며, 작은 물체를 반복적으로 집으며 소근육 발달이 이루어지는 시기입니다. ' || char(10) ||'3. 놀이 시간 동안 부모님과 아기가 함께 해주시면 좋습니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'셀로판지는 아기의 힘으로는 일반 종이처럼 잘 찢어지지도 않고, 비닐처럼 흐늘거리거나 늘어지지 않아 바스락대는 촉감을 만끽할 수 있는 재료입니다. ' || char(10) ||'', '셀로판지', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('에어캡 벽을 두드려요', '에어 캡을 벽에 붙여 주세요. 아기가 벽에 있는 에어 캡을 두드리기 위해 일어서서 놀이하는 동안 다리의 근력을 기를 수 있고, 손의 힘으로 에어 캡을 터뜨리며 소근육 발달을 증진시켜 줍니다.  ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 에어 캡을 아기 눈높이 위치의 벽에 붙여 줍니다.   ' || char(10) ||'2. 엄마가 벽을 두드리며 아기의 관심을 유도합니다. ' || char(10) ||'3. 아기가 에어 캡을 두드리는 모습과 에어 캡의 소리를 언어로 표현해 줍니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'에어 캡의 위치를 낮은 위치부터 높은 위치까지 단계적으로 붙여주어 아기가 하나씩 두드리며 성취감을 느낄 수 있도록 해 주세요. ' || char(10) ||'', '에어 캡', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('물건을 넣었다 뺐다 해요', '통에 물건을 넣었다 빼고 다른 곳에 옮겨보며 소근육 조절력과 눈과 손의 협응력을 기르고 안과 밖의 개념을 감각적으로 느끼며 인지 발달을 도모할 수 있습니다. ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 물건을 담을 수 있는 그릇이나 통을 두 개 준비합니다.' || char(10) ||'2. 한 손에 쉽게 쥘 수 있는 여러 재질의 놀잇감을 줍니다.' || char(10) ||'3. 아기가 놀잇감과 통을 탐색하도록 합니다.' || char(10) ||'4. 아기는 자연스럽게 물건을 통에 떨구거나 넣고, 빼기를 반복합니다.' || char(10) ||'5. 아기의 행동을 읽으며 말과 표정으로 반응해줍니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아기가 평소에 만지고 싶어 하는 통과 사물을 사용하세요' || char(10) ||'', '통, 놀잇감', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('수건 위에서 첨벙첨벙', '욕조 안에서 수건으로 놀이해보세요. ' || char(10) ||'전신을 사용해서 물에 젖은 수건을 탐색하며 대, 소근육이 발달하고, 엄마와 함께 호흡을 맞추는 물놀이를 하며 안정적인 정서를 형성하는 데 도움이 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 욕조에 수건을 여러 장 펼쳐 깔아줍니다.' || char(10) ||'2. 수건이 반 정도 잠길 정도 물을 넣어 적셔줍니다.' || char(10) ||'3. 아기와 함께 욕조에 들어갑니다.' || char(10) ||'4. 아기의 손을 잡고 일어서서 발로 꾹꾹 밟아봅니다.' || char(10) ||'5. 이불 위에서 콩콩 뛰어보기도 하고, 앉아서 수건을 두드리기도 하며 놀이합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아기가 미끄러져도 안전하도록 욕조에 수건을 충분히 깔아주세요' || char(10) ||'', '수건', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('요거트 그림 그리기', '요거트로 그림을 그려보세요. 요거트의 향과 차가운 느낌을 손으로 탐색하며 감각이 발달하고, 손으로 문지르고 두드리며 그림 그리는 과정이 소근육과 두뇌발달을 도와줍니다. ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 바닥에 비닐을 넓게 깔아줍니다.' || char(10) ||'2. 요거트를 접시에 담아 아기에게 보여줍니다.' || char(10) ||'3. 아기가 관심을 가지면 요거트 냄새를 맡아볼 수 있도록 합니다.' || char(10) ||'4. 엄마가 요거트를 손으로 떠서 비닐 위에 그림을 그리듯 문지릅니다.' || char(10) ||'5. 아기가 따라 하는 모습을 언어로 표현해주며 놀이합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'요거트 그림을 그릴 때 과일도 함께 준비한다면 과일이 끼적이기 도구가 되어 더 재미있는 놀이가 될 수 있습니다. ' || char(10) ||'', '요거트, 비닐', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('타공볼 까꿍 놀이', '까꿍 놀이를 통해 부모와의 애착을 형성하고, 타공볼을 만지고 소리를 들으며 감각이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 엄마가 타공볼을 쓰고 아기의 이름을 불러봅니다.' || char(10) ||'2. 아기가 관심을 가지면 아기의 머리에 타공볼을 씌어줍니다.' || char(10) ||'3. 타공볼을 두드리며 누가 숨어있는지 질문합니다.' || char(10) ||'4. 아기가 쓰고 있는 타공볼을 내리며 반응합니다.' || char(10) ||'', '타공볼', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('그림 이야기 듣기', '그림을 그리며 이야기를 나누어 보세요. 엄마의 행동과 목소리에 관심을 가지고 집중하며 애착이 형성되고, 그림을 그려지는 과정을 통해 인지발달을 이루게 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기의 앞에 커다란 종이를 준비해줍니다.' || char(10) ||'2. 아기가 관심을 가지면 사과를 그립니다.' || char(10) ||'3. 사과를 그려나가는 과정을 언어로 표현해주며 완성해 나갑니다.' || char(10) ||'4. 사과를 다 그린 뒤 실제 사과를 보여주며 이야기를 나눕니다.' || char(10) ||'', '색연필, 종이, 여러 종류의 과일', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('목욕통에서 양말을 꺼내요', '다양한 양말의 질감과 색깔을 감각적으로 탐색하고 쥐었다 놓았다를 반복하며 대, 소근육 발달을 도모할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 목욕통에 아기를 앉힙니다.' || char(10) ||'2. 목욕통 안에 다양한 색깔과 질감의 양말을 넣어줍니다.' || char(10) ||'3. 아기가 탐색하는 양말의 특징이나 탐색을 하며 느낄 수 있는 느낌을 언어로 표현해줍니다.' || char(10) ||'4. 아기가 양말을 탐색하다가 목욕통 바깥으로 던지면 던진 양말을 집어 목욕통 안에 넣습니다.' || char(10) ||'- 아기가 흥미 있어 할 만한 의성어, 의태어를 들려주며 양말을 넣어주세요.' || char(10) ||'5. 아기가 엄마의 동작에 흥미를 보이고 양말을 다시 바깥으로 던지면 다시 양말을 넣어주며 반응해줍니다.' || char(10) ||'', '목욕통, 양말', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('구멍 속 물건을 잡아당겨요', '구멍에 다양한 재질의 물건을 통과시켜주세요. ' || char(10) ||'아기가 물건을 잡아 당기기 위해 손가락을 사용하며 소근육이 발달하고, 다양한 재질의 물건을 손의 감각으로 느끼고, 물건을 잡기 위한 눈과 손의 협응력 과정이 두뇌발달을 증진시켜줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 상자의 한 면에 지름 1cm의 구멍을 여러 개 뚫어줍니다.' || char(10) ||'2. 구멍에 스카프, 비닐, 끈 등 다양한 재질의 사물을 끼워줍니다.' || char(10) ||'- 아기의 눈에 보일 정도로만 구멍에 사물을 통과시켜줍니다.' || char(10) ||'3. 구멍에 있는 물건을 아기가 꺼내볼 수 있도록 유도합니다.' || char(10) ||'4. 잡아당긴 물건의 느낌을 언어로 표현하며 이야기를 나눕니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'상자가 넘어지지 않게 아기를 마주 보고 앉아 상자를 잡아주세요. ' || char(10) ||'', '스카프, 끈, 털실, 비닐, 박스', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('인형이 마사지해요', '인형으로 아기 몸 전체를 마사지해주세요.' || char(10) ||'인형과 아기의 대화를 끊임없이 만들어주며 인형에 대한 애착감을 형성하고, 인형의 포근하고 따뜻한 느낌이 아이의 감각에 안정적인 자극을 주어 발달에 도움이 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기가 편하게 누울 수 있도록 합니다.' || char(10) ||'2. 인형을 아기의 얼굴 위에서 인사를 나눌 수 있도록 합니다.' || char(10) ||'3. 인형을 아기의 머리부터 꾹꾹 누르며 마사지합니다.' || char(10) ||'4. ''아이 시원해'' 하고 마사지의 느낌과 인형의 생각을 언어로 표현해 줍니다. ' || char(10) ||'5. 머리, 어깨, 가슴, 팔, 다리 순서로 차례대로 주물러주며 마사지를 합니다.' || char(10) ||'', '손과 팔이 있는 인형', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('수건 철봉 매달리기', '수건을 가지고 철봉 놀이를 해보세요. 수건에서 떨어지지 않으려고 움켜쥐고 매달리며 팔의 힘을 기를 수 있고, 반복적인 수건의 움직임을 통해 몸의 균형과 신체조절 능력을 발달시킵니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기를 푹신하고, 편안하게 누울 수 있도록 합니다.' || char(10) ||'2. 아기가 손을 뻗어 닿을 수 있는 높이에 수건을 가로로 들어 올립니다.' || char(10) ||'3. 아기가 수건에 관심을 가지면 한 손을 잡아 수건을 잡을 수 있도록 도와줍니다.' || char(10) ||'4. 수건을 움켜쥐면 천천히 수건을 들어 올립니다.' || char(10) ||'5. 아기가 수건에서 손을 놓치지 전 천천히 다시 수건을 내립니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'수건을 놓치더라도 다치지 않도록 푹신한 이불 위에서 놀이해주세요.' || char(10) ||'', '수건', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('페트병 줄 당기기', '페트병을 가지고 재미있는 소근육 놀이를 해보세요. 페트병 입구에서 나오는 실에 호기심을 가지고 잡아당기는 과정을 통해 소근육 운동과 신체를 조절하는 능력이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 끈을 길게 풀어 페트병 안에 넣고 입구로 나올 수 있도록 연결합니다.' || char(10) ||'2. 페트병 입구로 실을 조금 잡아당겨 걸쳐 놓은 뒤 아기의 관심을 유도합니다.' || char(10) ||'3. 아기가 끈을 잡아당기는 행동과 모양을 언어로 표현합니다.' || char(10) ||'4. 끈을 다 꺼낸 후에는 다시 집어넣어보며 반복해 놀이합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'페트병이 쓰러지거나 흔들리지 않도록 잡아주어 아기가 끈을 잡아당기는 것에 방해가 되지 않도록 도와주세요. ' || char(10) ||'', '운동화 끈, 페트병', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('아빠 얼굴이 커졌다 작아졌다 ', '아빠의 얼굴이 놀잇감이 되어보세요. 아빠의 얼굴이 커졌다 작아졌다 하는 모습을 지속적으로 응시 하고 음성을 들으며 아빠와의 정서적 애착을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 편안하게 아이가 누울 수 있도록 한다.' || char(10) ||'2. 누워 있는 아이의 시선과 얼굴이 평행을 이루도록 허리를 숙인다.' || char(10) ||'3. 눈을 편안히 감고 천천히 가까이 다가가며 반복적인 소리를 낸다.' || char(10) ||'4. 아이 얼굴 앞에 가까이 도달했을 때 눈과 입을 크게 벌리며 큰 소리로 반응한다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'다정한 목소리, 작은 목소리, 큰 목소리 등 아이가 놀라지 않는 수준으로 목소리의 변화를 주며 이야기해주세요. ' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요.', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('문을 마주보고 두드려요', '아기와 문을 마주 보고 앉아보세요. 엄마를 따라 아기가 창문을 두드리며 애착이 형성되고, 손바닥으로 창문을 두드리며 감각이 고루 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 문을 두드리며 아기의 관심을 유도합니다.' || char(10) ||'2. 아기가 엄마가 있는 곳으로 다가오면 창문을 두드릴 수 있도록 유도합니다.' || char(10) ||'3. 아기가 창문 두드리기를 하면 아기와 마주 볼 수 있도록 문의 반대쪽으로 이동합니다.' || char(10) ||'4. 손바닥을 펼쳐 두드리기도 하고, 똑똑 노크를 해보기도 하며 놀이합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'입김을 불어 보기도 하고, 다양한 표정을 지어보며 놀이해보세요. ' || char(10) ||'', '서로의 모습을 볼 수 있는 투명한 문, 창문', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('의자 걸음마', '의자를 잡고 걸음마를 하며 자신감과 전신 근육의 힘을 기르고 엄마, 아빠의 격려를 통해 안정적인 애착을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 식탁 의자의 앉는 부분을 아기가 잡고 서도록 합니다.' || char(10) ||'2. 등받이 부분을 어른이 잡고 서서 아기와 마주 봅니다. ' || char(10) ||'3. 아기가 힘을 주어 의자를 움직이면 이에 맞춰 움직입니다. ' || char(10) ||'4. 아기의 걸음마를 격려하며 안전하게 움직이도록 돕습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'리듬감 있는 추임새나 노래와 함께 해보세요. ' || char(10) ||'', '식탁 의자', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('톡톡 랩을 뚫어요', '랩으로 손가락 놀이를 해보세요. 통 안에 있는 스티커에 관심을 가지고 만지려고 시도하며 눈과 손 의 협응력을 도와주고, 손가락의 움직임을 스스로 조절하며 소근육 발달을 도와줍니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'※ 아기가 손으로 랩을 눌렀을 때 랩이 벗겨지지 않도록 플라스틱 통 전체를 둘러주세요.' || char(10) ||'※ 이 시기 아기들은 입으로 탐색하는 ''구강기''에 해당하며, 물체를 탐색하며 신체 발달이 이루어지는 시기입니다. 놀이 재료를 입에 넣지 않도록 주의하며 놀이 시간 동안 부모님과 아기가 함께 해주시면 좋습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 플라스틱 통 안에 스티커를 일정한 간격을 두고 붙입니다.' || char(10) ||'2. 플라스틱 통 전체에 랩을 한 겹만 팽팽하게 씌워줍니다.' || char(10) ||'3. 스티커의 위치와 일직성 상에 랩 부분에 작은 구멍을 여러 개 뚫어줍니다.' || char(10) ||'4. 아기가 스티커에 관심을 가질 수 있도록 유도합니다.' || char(10) ||'5. 엄마가 랩의 구멍에 손가락을 넣어 스티커를 만지는 모습을 보여줍니다.' || char(10) ||'6. 아기가 엄마를 따라 스티커를 만져볼 수 있도록 합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마가 아기의 손가락을 펼쳐 구멍을 뚫을 수 있도록 도와주며 구멍이 뚫릴 때의 소리와 느낌을 언어로 재미있게 표현해주세요. ' || char(10) ||'', '플라스틱 통, 랩, 스티커', '0세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('냄비 뚜껑을 맞춰요', '여러 가지 종류의 냄비를 펼쳐놓고 알맞은 뚜껑을 찾아 맞추며 인지 능력과 함께 소근육이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1 뚜껑이 있는 냄비를 준비해 냄비와 뚜껑을 분리시켜 바닥에 놓아줍니다.' || char(10) ||'2. 뚜껑을 냄비 위에 덮었다 열었다 반복하며 아이의 흥미를 유발합니다.' || char(10) ||'3. 스스로 뚜껑 덮기를 시도하는 아이의 행동을 격려해줍니다.' || char(10) ||'4. 알맞은 냄비 뚜껑을 찾아 덮으며 놀이합니다.' || char(10) ||'', '여러 가지 종류의 냄비', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('색깔 접시 징검다리', '발을 모아 색깔 접시 징검다리를 건너며 균형감각이 발달하고, 색깔 접시의 이름을 표현하며 언어 발달을 도모합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 색깔 접시를 바닥에 펼쳐 징검다리를 만들어줍니다.' || char(10) ||'2. 엄마가 징검다리를 건너는 모습을 보여줍니다.' || char(10) ||'3. 아이가 엄마를 따라 징검다리를 건너보도록 합니다.' || char(10) ||'4. 아이가 건너는 징검다리의 색깔을 표현해줍니다.' || char(10) ||'5. 아이가 엄마를 따라 색깔을 언어로 표현하며 건너봅니다.' || char(10) ||'', '색깔 접시', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('셀로판지 색안경', '셀로판지로 만든 색안경으로 주변을 탐색하며 인지가 발달하고, 어떤 색인지 언어로 표현하며 언어 발달을 도모합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 종이를 안경 모양으로 자릅니다.' || char(10) ||'2. 안경 알 부분에 구멍을 만들어 서로 다른 색 셀로판지를 붙여줍니다.' || char(10) ||'3. 색 안경을 보여주며 아이의 흥미를 유발합니다.' || char(10) ||'4. 아이가 색 안경을 자유롭게 탐색하도록 합니다.' || char(10) ||'  - 색 안경을 통해 보이는 색을 언어로 표현해주세요.' || char(10) ||'5. 색안경을 눈 가까이에 대고 주변을 탐색하며 놀이합니다.' || char(10) ||'', '셀로판지, 종이, 칼, 테이프', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('아기 피카소', '다양한 물감을 붓을 사용해 자유롭게 끼적이며 긍정적인 정서를 형성하고, 대소근육 발달을 도모합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 물감을 짠 접시와 붓을 보여주며 아이의 흥미를 유발합니다.' || char(10) ||'2. 화장실로 이동해 붓으로 물감을 찍어 벽에 칠하는 모습을 보여줍니다.' || char(10) ||'3. 아이도 붓을 사용해 자유롭게 색칠하도록 유도합니다.' || char(10) ||'4. 색칠하는 아이의 행동을 격려하며 느낌을 언어로 표현해줍니다.' || char(10) ||'', '물감, 붓, 접시', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('물감놀이', '물감을 손으로 만지고 탐색하는 과정 속에서 인지가 발달하고, 종이에 자유롭게 손도장을 찍고 그림도 그리며 대, 소근육 조절력이 길러집니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 바닥에 전지를 넓게 펼쳐줍니다.' || char(10) ||'2. 물감을 접시에 덜어준 뒤 손바닥으로 전지에 손 도장 찍는 모습을 보여줍니다.' || char(10) ||'3. 아이도 자유롭게 손에 물감을 묻혀 찍어볼 수 있도록 합니다.' || char(10) ||'물감의 색과 모양을 언어로 표현해주세요.' || char(10) ||'4. 손도장을 찍기도 하고 문질러 그림을 그리며 놀이해봅니다.' || char(10) ||'', '물감, 전지', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('이불 썰매', '이불 썰매를 타면서 이불을 잡고 힘을 주어 균형을 잡는 경험을 해보고, 썰매를 끌고 다니며 이야기를 나누는 것을 통해 언어자극 및 애착 형성을 도모합니다.' || char(10) ||'' || char(10) ||'주의사항' || char(10) ||'이불을 천천히 당겨서 아기가 뒤로 넘어지지 않도록 주의합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기를 이불 위에 앉히고 이불의 두 모서리를 말아 줍니다.' || char(10) ||'2. 이불을 살살 잡아당기며 아기가 이불 옆을 잡도록 합니다.' || char(10) ||'3. 집안 곳곳으로 끌고 다니며 이야기를 나눕니다.' || char(10) ||'', '이불', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('신체 부분 마주 대기', '카드 속 신체 부분을 마주 대는 놀이를 함께 해보세요.' || char(10) ||'자신의 다양한 신체 부분을 인식하는 데 도움을 주며, 놀이를 통한 자연스러운 스킨십으로 아이의 정서발달에 도움을 줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 그림카드를 보며 다양한 신체 부분의 명칭과 위치, 하는 일 등에 대해 이야기를 나눠봅니다.' || char(10) ||'2. 신체 부분 마주 대기 놀이를 제안합니다.' || char(10) ||'3. 그림카드를 뒤집어 펼쳐놓습니다.' || char(10) ||'4. 원하는 카드를 한 장씩 뽑아봅니다.' || char(10) ||'5. 뽑아서 나온 신체 부분을 서로 마주 대어 봅니다.' || char(10) ||'6. 반복하여 놀이합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'놀이하기 전에 다양한 신체 부분의 그림 카드를 준비해주세요.' || char(10) ||'', '다양한 신체 부분 그림 카드', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('손 숨기기 놀이', '아이와 간단한 신체 표현 놀이를 해볼까요? 한 쪽 손을 다른 쪽 팔 소매에 넣으면 손이 보이지 않지요! ' || char(10) ||'두 손을 모두 숨긴 채로 아이와 방안을 돌아다니며 대화를 나누는 놀이를 해봅시다. ' || char(10) ||'우리 아이 손이 어디 갔지? 하며 모른 척 찾는 시늉도 해보세요. 아이는 신나하면서 손을 숨기고 키득키득 좋아할거예요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 손을 다른 쪽 팔 소매에 숨길 수 있다고 설명해주세요. 아이는 신이 나서 손을 숨길 거랍니다.' || char(10) ||'2. ''우리 아이 손이 어디 갔지? 나와라! 하면서 모른척해 주세요.' || char(10) ||'3. 엄마도 손을 모두 숨긴 채 엄마 손이 어디 갔는지 물어봅니다.' || char(10) ||'4. 손을 서로 숨긴 채로 서로 인사도 나누어보고 물건도 옮기는 시늉도 해보고 재미난 역할 놀이를 해보세요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'손을 숨길 때 왼쪽 손은 오른쪽 팔 소매에, 오른쪽 손은 왼쪽 팔 소매에 숨기는 거라고 하며 오른쪽 왼쪽을 설명해주세요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~4세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('엄마 청소를 도와요', '청소하는 엄마의 행동을 모방하여 함께 청소하면서 친 사회성과 함께 대근육이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 청소도구로 청소하는 모습을 보여주며 아이의 흥미를 유발합니다.' || char(10) ||'2. 아이가 관심을 가지면 청소도구를 건네며 도와달라고 부탁합니다.' || char(10) ||'3. 청소하는 아이의 행동을 격려해주며 함께 청소를 합니다.' || char(10) ||'', '청소도구', '2~3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('큰 것 작은 것', '크고 작은 물건을 만지고 탐색하며 크기의 개념을 이해하고, 언어로 표현하며 언어 발달을 도모합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 크기가 다른 숟가락을 여러 개 준비합니다.' || char(10) ||'- 숟가락이 아니더라도 크기가 다른 같은 종류의 물건을 준비해주세요.' || char(10) ||'2. 아이가 자유롭게 숟가락을 탐색하도록 합니다.' || char(10) ||'3. 어떤 숟가락이 크고 작은지 이야기를 나눕니다.' || char(10) ||'', '크기가 다른 숟가락 여러 개', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('실타래를 풀어요', '엄마가 잡고 있는 실타래를 잡아당기고 멀리 이동하며 대, 소근육이 발달하고, 엄마와의 놀이를 통해 애착을 형성합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 굵은 실타래를 아이를 향해 굴리며 흥미를 유발합니다.' || char(10) ||'2. 아이가 관심을 가지면 실의 끝을 잡아당기며 실이 풀어지는 모습을 보여줍니다.' || char(10) ||'3. 아이가 실의 끝을 잡고 잡아당길 수 있도록 유도합니다.' || char(10) ||'4. 실이 풀어지는 모습을 언어로 표현해주며 엄마가 실타래를 잡고 반대로 걸어갑니다.' || char(10) ||'5. 아이도 반대쪽으로 걸어가도록 유도하며 실을 풀며 놀이합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'다시 실을 감아보세요! - 풀었던 실을 천천히 감아 아이와 다시 만나며 다정하게 입맞춤을 해보세요. 실을 감으며 눈과 손의 협응력은 물론 엄마와 다시 만나며 애착을 형성합니다.  ' || char(10) ||'', '실타래', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('실내 비치볼 놀이', '비치볼을 던지고 차고, 굴리며 대근육이 발달하고 엄마와 함께 하는 놀이를 통해 애착을 형성합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 비치볼에 바람을 충분히 넣어 준비합니다.' || char(10) ||'2. 아이에게 비치볼를 던져 건네주며 아이의 흥미를 유발합니다.' || char(10) ||'3. 아이가 다시 엄마에게 비치볼을 건네줄 수 있도록 유도합니다.' || char(10) ||'4. 아이와 비치볼을 주고 받으며 놀이합니다.' || char(10) ||'', '비치볼', '2~3세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('신나는 상자 숨기 놀이', '빈 상자들을 활용하여 술래잡기 놀이를 해보세요. 신체를 활발하게 움직이며 대근육 발달을 증진시키고 규칙이 있는 게임 놀이 경험을 통해 사회성 발달을 도모할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 상자를 여기 저기 배치해 둡니다.' || char(10) ||'2. 아이와 다양한 방법으로 술래를 정합니다.' || char(10) ||'예) 가위, 바위, 보를 해서 술래를 정해도 좋아요.' || char(10) ||'3. 술래가 1부터 10까지 수를 셀 동안 술래가 아닌 사람들은 상자 속에 숨어봅니다.' || char(10) ||'4. 술래는 상자 속에 숨은 사람을 찾아다닙니다.' || char(10) ||'5. 같은 방법으로 놀이를 반복해봅니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마, 아빠가 아이를 찾을 때는 아이가 안보이는 흉내를 내도 좋아요.' || char(10) ||'상자 안에 숨은 아이를 쉽게 빠르게 찾기 보다는 천천히 다른 상자 주변을 돌아보거나 살짝 건드려보며 찾기를 한다면 아이는 놀이에 집중하고 즐거움을 느낄 수 있습니다.' || char(10) ||'', '큰 상자 여러 개', '2~4세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('돌에 그림을 그려요', '나뭇가지에 물감을 묻혀 돌에 그림을 그리는 자연물 색칠 놀이가 오감을 자극해 인지발달을 도와줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 나뭇가지와 돌멩이를 준비하고, 그릇에 물감을 적절히 덜어줍니다.' || char(10) ||'2. 나뭇가지에 물감을 묻혀 돌멩이에 바르는 모습을 보여주며 흥미를 유발합니다.' || char(10) ||'3. 아이에게 나뭇가지를 건네 따라 해볼 수 있도록 합니다.' || char(10) ||'4. 나뭇가지로 자유롭게 돌멩이에 색칠하는 아이의 행동을 격려해줍니다.' || char(10) ||'', '돌멩이, 나뭇가지, 물감, 그릇', '2~3세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('엄마랑 설거지를 해요', '설거지하는 엄마의 모습을 모방하고 엄마의 언어표현 통해 언어 발달을 도모하며, 설거지하는 과정을 통해 소근육이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 엄마가 설거지하는 모습을 보여주며 아이의 흥미를 유발합니다.' || char(10) ||' - 엄마가 설거지를 하며 자신의 모습을 언어로 표현해주세요.' || char(10) ||'2. 아이가 관심을 가지면 낮은 의자나 탁자를 놓아주어 아이도 설거지를 해볼 수 있도록 유도합니다.' || char(10) ||'3. 아이가 만지는 식기의 명칭을 언어로 표현해줍니다.' || char(10) ||'4. 수세미도 건네주어 그릇을 닦아보도록 합니다.' || char(10) ||'5. 설거지하는 아이의 행동을 격려하며 함께 놀이합니다.' || char(10) ||'', '식기, 수세미, 의자', '3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('로션 발라주세요', '아이와 엄마가 서로 로션을 발라주며 스킨십을 통해 안정적인 애착을 형성하고 신체 부위를 이야기 하며 언어 발달에 도움을 줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 로션을 발라주며 문질문질 노래를 합니다.' || char(10) ||'2. 스스로 바르도록 손에 로션을 묻혀줍니다.' || char(10) ||'3. 신체 부위를 알려주며 발라보도록 합니다.' || char(10) ||'4. 엄마에게 발라달라고 하며 손이나 얼굴 등을 갖다 댑니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'문질 문질, 보들보들, 꺼칠꺼칠 등 로션을 바르는 모양새를 의태어로 표현하여 들려주거나 리듬 있게 노래처럼 말해주세요.' || char(10) ||'', '로션', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('배운 동요 엄마랑 불러보기', '아이는 어린이집, 유치원에서 다양한 동요를 듣고 배운답니다. 어렴풋이 기억하고 있는 동요들이 많이 있을 거예요! ' || char(10) ||'아이와 대화를 통해 동요를 골라서 함께 불러보고, 가사도 같이 적어보는 놀이를 해 보세요. 아이의 기억력이 더욱 확장될 거예요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 어린이집(혹 유치원)에서 배운 노래를 불러보자고 제안합니다.' || char(10) ||'- 어린이집 알림장을 활용하거나 선생님에게 물어봐서 어떤 노래를 배웠는지 미리 파악할 수도 있습니다.' || char(10) ||'2. 해당 노래를 틀어두고 엄마랑 아이랑 함께 따라 불러보세요!' || char(10) ||'3. 아이가 특히 좋아하는 노래의 경우 엄마가 흰 종이에 큼직큼직하게 가사를 적어보고, 그 가사 종 이를 보고 따라 부르거나 엄마도 더욱 활발히 불러주면 좋습니다.' || char(10) ||'4. 아이가 정말 좋아하고, 복습을 통해 잘 아는 동요를 늘려간다면 기억력 발달과 언어 학습에 좋답니다.' || char(10) ||'', '종이, 펜', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('설거지 놀이', '손수건으로 그릇을 닦는 설거지 모방 놀이를 하며 애착을 형성하고 그릇 이름을 이야기하며 언어발달을 도모합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 깨지지 않고 가벼운 그릇을 준비해 손수건으로 닦으며 아이의 흥미를 유발합니다.' || char(10) ||'2. 아이가 관심을 가지면 엄마를 따라 손수건으로 닦아보도록 합니다.' || char(10) ||'3. 그릇을 닦는 아이의 행동을 격려해주며 그릇의 이름을 알려줍니다.' || char(10) ||'4. 그릇 닦는 소리를 표현해주며 모든 그릇을 닦으며 놀이합니다.' || char(10) ||'', '그릇, 손수건', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('꼬마 화가', '색색의 크레용으로 자유롭게 선을 그으며 인지 발달과 소근육 발달을 도모합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 크레용과 도화지를 보여주며 아이의 흥미를 유발합니다.' || char(10) ||'2. 크레용을 쥐고 끼적이는 모습을 보여줍니다.' || char(10) ||'3. 아이가 스스로 끼적일 수 있도록 격려해줍니다.' || char(10) ||'4. 아이가 끼적이는 크레용의 색과 그림을 언어로 표현해주며 놀이합니다.' || char(10) ||'', '크레용, 도화지', '1~2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('간지럽히는 손 출동', '간지럽히기 놀이는 엄마 아빠와 아이 애착 형성에 특히 좋은 쉬운 놀이입니다. 엄마 아빠 손을 간질간질 괴물로 칭하고 간지럽히는 시늉만 해도 아이가 자지러지며 좋아할 거예요.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'간지럽히는 게 너무 과하면 안 돼요! 살짝살짝씩만 해주시고 아이의 반응을 보시면서 해주세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 엄마 아빠 손을 보여주며 간질간질 간지럼 괴물이라고 이야기해줍니다.' || char(10) ||'2. 간지럼 손 괴물이 출동해서 아이를 간지럽힐 거라고 강조해주세요. 천천히 손을 움직여주며 아이 에게 다가갑니다.' || char(10) ||'3. 아이는 꺄르르 꺄르르 하면서 피하거나 엄마 아빠가 실제 간지럽히면 크게 웃을 거예요.' || char(10) ||'4. 세게 간지럽히기 보다 간질 괴물 흉내를 내면서 아이의 몸 이곳저곳을 살짝씩만 간지럽혀주세요.' || char(10) ||'5. 이번엔 어디를 간질간질할까~ 엉덩이로 가야겠다! 등 몸의 부위를 이야기하면서 간질간질해주세요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법엄마 아빠와 아이의 역할을 바꾸어서 아이의 간질간질 괴물이 출동하는 놀이도 해보세요! 엄마 아빠는 열심히 간지럽다는 시늉을 해주세요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('어어어 넘어졌네?', '아이를 품에 안고 넘어지는 놀이를 해보세요. 아빠와 재미있는 스킨십 놀이를 통해 안정적인 애착을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 아빠를 꼬옥 안아달라고 요청합니다.' || char(10) ||'- 아빠가 먼저 아이를 안아주어도 좋아요' || char(10) ||'2. 아이랑 아빠랑 꼬옥 안아줍니다.' || char(10) ||'3. 아이 무게에 못 이겨 아빠가 아주 천천히 바닥으로 벌러덩 넘어지는 연기를 해봅니다.' || char(10) ||'4. 벌러덩 누워서 넘어진 이유에 대해 이야기를 합니다.' || char(10) ||'ex) "우리 oo가 밥을 많이 먹어서 키도 많이 크고 몸무게도 무거워져 아빠가 넘어져 버렸네!"' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~4세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('등 뒤에 숨어요', '아이와 몸으로 하는 숨바꼭질 놀이를 해보세요. 아빠 등 뒤에 숨어있다 시선을 마주치며 애착을 형성하고 정서적 안정감을 느낄 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 아빠 등 뒤에 있을 때 놀이를 시작해보세요.' || char(10) ||'2. 아빠는 아이가 보이지 않는 것처럼 이야기해봅니다.' || char(10) ||'3. 아이가 아빠의 말과 행동에 흥미를 보이면 아이가 계속 보이지 않는 흉내를 내보세요.' || char(10) ||'4. 아이의 이름을 부르며 아이와 눈을 마주쳐봅니다.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~3세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('가족사진에 스티커를 붙여요', '아기와 가족사진을 보며 스티커 붙이기 놀이를 해보세요. 애착을 다지고 소근육 발달에 도움을 줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기에게 가족사진을 보여주고 이야기를 나눠봅니다.' || char(10) ||'2. 사진 속 인물들의 호칭을 들려줍니다.' || char(10) ||'3. 스티커를 떼어 아기에게 줍니다.' || char(10) ||'4. 엄마가 불러주는 인물을 함께 찾아보고 스티커를 붙여줍니다.' || char(10) ||'', '가족사진, 스티커', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('간식 뽑기 놀이', '다양한 방법으로 내가 먹을 간식을 골라봄으로써 내 것을 선택할 수 있는 기회를 가져볼 수 있고, 소유욕이 충족됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 함께 먹을 수 있는 다양한 간식을 준비합니다.' || char(10) ||'2. 안이 보이지 않는 통 안에 간식을 넣습니다.' || char(10) ||'-통이 없다면 가방을 준비해 주시는 것도 좋아요.' || char(10) ||'3. 아이가 통 안에 손을 넣어 간식을 고를 수 있도록 도와줍니다.' || char(10) ||'4. 직접 고른 간식을 확인한 후, 맛있게 먹어봅니다.' || char(10) ||'-내 것을 선택할 수 있는 기회를 통해 소유욕이 충족될 수 있도록 놀이를 여러 번 반복해 주시는 것도 좋아요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'눈 감고 간식 고르기, 쪽지 뽑기 등 다양한 방법으로 놀이해 보는 것도 좋아요.' || char(10) ||'', '간식, 안이 보이지 않는 통(가방)', '2~3세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('사랑 가득 마음 나누기', '사용하지 않는 물건을 다른 사람에게 나누어 주는 행동을 통해 나눔의 기쁨과 즐거움을 느껴볼 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 우리 집에 있는 물건 중 사용하지 않는 것을 찾아봅니다.' || char(10) ||'2. 사용하지 않는 물건을 한곳에 모은 후, 자유롭게 이야기를 나눕니다.' || char(10) ||' - 내가 사용하지 않는 물건을 필요로 하는 사람에게 나누어 줄 수 있다는 것에 대해 이야기해 주시는것도 좋아요.' || char(10) ||'3. 물건을 깨끗한 상자나 통에 넣습니다.' || char(10) ||'4. 해당 물건이 필요한 사람에게 나누어 주는 시간을 가져봅니다.' || char(10) ||'- 아이가 직접 물건을 나누어주거나 엄마, 아빠의 모습을 관찰할 수 있도록 하여 나눔의 기쁨과 즐거움을 알 수 있도록 도와주세요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'자신의 물건을 나누는 것이 가능해지면 가족 혹은 친구와 물건을 바꾸어 사용해보는 경험을 만들어 주시는 것도 좋아요.' || char(10) ||'', '사용하지 않는 물건, 상자 혹은 통', '2~3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('가족 물건 숨바꼭질', '가족들의 물건으로 숨바꼭질 놀이를 하며 나와 남의 것을 구별하고, 다른 사람의 물건을 소중하게 생각하는 마음을 가질 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 가족들의 물건을 다양하게 준비합니다.' || char(10) ||'2. 준비된 물건을 보며 자유롭게 이야기 나눕니다.' || char(10) ||'- 해당 물건이 누구의 것인지와 이름, 쓰임 등에 대해 간단하게 이야기를 나눠보는 것도 좋아요.' || char(10) ||'3. 각자 역할을 정해봅니다.' || char(10) ||'물건을 찾는 사람과 숨기는 사람으로 나누고, 아이가 각 역할을 잘 이해할 수 있도록 도와주세요. 4. 함께 ''가족 물건 숨바꼭질'' 놀이를 해봅니다.' || char(10) ||'5. 숨긴 물건을 찾으면 "OO의 물건은 소중해."라고 이야기하고, 주인에게 돌려줍니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'특정 장소(예: 아이 방)에서 2~3가지의 물건으로 놀이하다가 점차 장소의 범위와 물건의 개수를 늘려가는 것도 좋아요.' || char(10) ||'', '가족 물건', '2~3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('나만의 비밀 보관함', '다양한 재료로 보관함을 만들어보며 소근육을 발달시킬 수 있고, 나의 소유물이 존중받고 있음을 느끼게 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 놀이에 필요한 상자(아이의 물건을 담을 수 있을 정도의 크기)와 다양한 재료를 준비합니다.' || char(10) ||'- 상자가 없다면 바구니나 통 등을 준비해 주시는 것도 좋아요.' || char(10) ||'2. 준비된 재료를 이용해 상자를 꾸며봅니다.' || char(10) ||'3. 완성된 비밀 보관함 안에 아이의 물건을 넣어봅니다.' || char(10) ||'- 아이가 직접 자신의 물건을 골라 넣을 수 있도록 도와주세요.' || char(10) ||'4. 나만의 비밀 보관함을 원하는 장소에 놓고 사용해 봅니다.' || char(10) ||'-비밀 보관함 안의 물건은 아이의 허락을 받고 사용하여 자신의 소유물이 존중받고 있음을 느낄 수 있게 도와주세요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아이의 연령에 따라 스티커 붙이기, 색연필로 끼적이기, 색종이 찢어 붙이기 등 다양하게 놀이할수 있도록 도와주세요.' || char(10) ||'', '상자, 스티커, 색칠 도구 등', '2~3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('끈적끈적 지렁이 잡기 놀이', '양에 대한 수 세기를 반복하며 인지 발달을 도와주고, 털실을 떼며 소근육 조절력을 길러줍니다.' || char(10) ||'' || char(10) ||'만들기 방법 ' || char(10) ||'털실을 약 10cm 가량씩 잘라줍니다. (개수는 아이가 놀이할 만큼 잘라주시면 좋습니다.)' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 자른 털실을 바닥에 내려놓습니다.' || char(10) ||'2. 아이에게 테이프 클리너를 제시하고, 테이프 클리너를 돌려서 털실을 붙이는 모습을 보여줍니다.' || char(10) ||'3. 아이가 테이프 클리너에 자유롭게 털실을 붙일 수 있도록 합니다.' || char(10) ||'4. 아이에게 털실 ''하나''를 떼어볼 것을 제안합니다.' || char(10) ||'5. 아이가 털실 하나를 떼어내면, 아이의 행동을 구체적으로 이야기해 줍니다.' || char(10) ||' - ''하나''의 양의 개념을 인지할 수 있도록 ''하나'', ''한 개''를 반복해서 들려주면 좋습니다.' || char(10) ||'6. 같은 방법으로 놀이를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'털실이 없을 때에는 두꺼운 색깔 실이나 얇은 리본 끈을 사용하셔도 좋습니다.' || char(10) ||'', '털실, 테이프 클리너, 가위', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('크다 작다 음식점 놀이', '크기를 비교하며 인지 발달을 도와주고, 역할 놀이를 하며 사회성 발달을 도와줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 소꿉 놀이 모형 음식들을 모아봅니다.' || char(10) ||'2. 크기가 다른 그릇을 보여주고, 크기를 비교하는 말을 들려줍니다.' || char(10) ||'3. 아이에게 큰 그릇과 작은 그릇을 양 손에 들고, 그릇 하나를 정하고 음식을 담아줄 것을 제안합니다.' || char(10) ||'4. 아이가 그릇에 음식을 올려놓으면, 아이의 행동을 ''크기를 비교하는 말''과 함께 들려줍니다.' || char(10) ||'5. 같은 방법으로 놀이를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아이가 ''크다'', ''작다''의 언어 표현에 익숙해지면, 역할을 바꾸어 놀이해도 좋습니다.' || char(10) ||'', '소꿉 그릇 (큰 그릇 1개, 작은 그릇 1개), 소꿉 놀이 음식', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('과자상자 모양칩 놀이', '상자 구멍과 같은 모양의 조각을 변별하며 시각적 변별력을 길러주고, 모양 조각을 구멍에 넣으며 눈과 손의 협응력을 길러줄 수 있습니다.' || char(10) ||'' || char(10) ||'만들기 방법' || char(10) ||'1. 과자 상자의 넓은 면에 동그라미, 세모, 네모를 1개씩 그립니다.' || char(10) ||'2. 그린 모양 도형을 커터 칼로 도려냅니다.' || char(10) ||'3. 모양 과자 상자가 부서지지 않도록 모서리 부분에 테이프를 붙입니다.' || char(10) ||'4. 또 다른 과자 상자는 동그라미, 세모, 네모 모양으로 여러 개 잘라봅니다. 과자 상자의 모양 구멍보다 작게 만들어주세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 모양 조각을 보여주고, 자유롭게 탐색하게 합니다.' || char(10) ||'2. 각 모양을 손으로 짚으며, 이름을 들려줍니다.' || char(10) ||'3. 모양 한 개를 집어 과자 상자에 같은 모양의 구멍을 찾아봅니다.' || char(10) ||'4. 모양 조각을 과자 상자의 구멍에 넣습니다.' || char(10) ||'5. 같은 방법으로 놀이를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'다양한 종류의 모양 사물을 탐색하고, 반복적으로 이름을 들려주세요.' || char(10) ||'아이가 동그라미, 세모, 네모 모양을 변별하는 데에 도움을 줄 수 있습니다.' || char(10) ||'', '과자 상자 2개, 가위, 테이프, 볼펜, 카터 칼', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('색깔 빨대를 꽂아요', '같은 색깔을 분류하며 인지 발달을 도와주고, 점토 위에 색깔 빨대를 꼽으며 눈과 손의 협응력을 길러줍니다.' || char(10) ||'' || char(10) ||'만들기 방법' || char(10) ||'색깔 빨대를 약 5~7cm 길이로 자릅니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 색깔 빨대를 보여주고, 자유롭게 탐색합니다.' || char(10) ||'2. 각 빨대를 하나씩 짚으며 색깔의 이름을 들려줍니다.' || char(10) ||'3. 점토를 색깔별로 뭉쳐서 아이 앞에 내려놓습니다.' || char(10) ||'4. 점토 1개를 가리키며 어떤 색깔인지 묻고 답하기를 합니다.' || char(10) ||'5. 아이에게 점토와 같은 색깔의 빨대를 찾아볼 것을 제안합니다.' || char(10) ||'6. 아이가 같은 색깔의 빨대를 찾으면, 색깔의 이름을 이야기해 주고 점토 위에 꽂을 수 있도록 합니다.' || char(10) ||'7. 같은 방법으로 놀이를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'색깔 빨대가 없을 때에는 ''색깔 블록''이나 ''색깔 피규어''를 점토 위에 올려놓는 놀이로 대체하셔도 좋습니다. ' || char(10) ||'', '점토 (빨강, 노랑, 파랑), 색깔 빨대 (빨강, 노랑, 파랑)', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('간질간질 공이 굴러가요', '부드러운 공의 촉감을 이용하여 신체 인지를 도와주고, 스킨십을 통해 안정적인 애착을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 놀이 매트나 카펫 위에 아이가 누울 수 있도록 합니다.' || char(10) ||'2. 엄마(또는 아빠)는 공을 들고, 아기 발바닥을 부드럽게 두드려 터치합니다.' || char(10) ||'3. 엄마가 터치한 신체 부분이 어디인지 아이에게 질문을 하고, 답해볼 수 있도록 도와줍니다.' || char(10) ||'4. 같은 방법으로 무릎, 손바닥 등 부드럽게 터치할 수 있는 신체 부위에 터치를 해보고 알맞은 신체 명칭 이야기 하기를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'놀이하기에 적절한 공이 없을 때에는, 손수건이나 스카프를 뭉쳐 묶어서 공처럼 만들어주셔도 좋습니다.' || char(10) ||'', '헝겊 공 (또는 고무공이나 볼풀 공)', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('휴지심 고리 끼우기', '휴지심 고리 끼우기 놀이는 다양한 색깔의 휴지심이 시각을 자극하고 고리를 끼우는 과정에서 눈과 손의 협응력과 소근육 조절력을 길러줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기에게 휴지심 고리를 보여줍니다.' || char(10) ||'2. 휴지심 고리의 모양과 색깔에 대해 이야기해줍니다.' || char(10) ||'3. 국자에 휴지 심을 끼우는 모습을 보여줍니다.' || char(10) ||'4. 아기가 엄마의 동작에 흥미를 보이면 스스로 고리를 끼울 수 있도록 격려합니다.' || char(10) ||'5. 아기가 끼운 휴지심 고리의 색깔이나 모양에 대해 이야기해주고 아기의 행동을 칭찬해줍니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'- ''휴지심 고리'' 이렇게 만들어요' || char(10) ||'1. 휴지심을 고리 형태로 잘라줍니다.' || char(10) ||'2. 자른 휴지심을 색종이로 감싸고 테이프로 고정시켜봅니다.' || char(10) ||'3. 휴지심 고리 완성~!' || char(10) ||'', '휴지심, 색종이, 가위, 국자, 테이프', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('폼폼이 옮기기 놀이', '다양한 색깔 폼폼이 옮기기 놀이를 해보세요. 폼폼이의 색깔과 질감을 감각적으로 탐색하며 인지 발달을 도모하고 대, 소근육 발달을 증진시켜줍니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'※폼폼이는 크기는 지름 3cm을 사용해주세요!' || char(10) ||'※폼폼이가 없다면 통에 넣을 수 있는 작은 구체물을 사용하셔도 좋습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 폼폼이를 보여주고 이야기를 나눕니다.' || char(10) ||'2. 폼폼이가 들어갈 만한 통을 준비하고 폼폼이를 넣는 모습을 보여줍니다.' || char(10) ||'3. 아이가 엄마의 모습에 흥미를 보이면 엄마를 따라 폼폼이를 넣을 수 있도록 격려합니다.' || char(10) ||'4. 아이가 폼폼이를 넣었을 때 아기의 행동을 칭찬해줍니다.' || char(10) ||'', '폼폼이, 통', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('바구니에 인형을 받아요', '아기 인형으로 재미있는 신체놀이를 해보세요. 놀이를 통해 아이는 협동을 경험하고 대근육 발달을 증진시킬 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 바구니를 보여줍니다.' || char(10) ||'2. 아이와 마주보고 서서 아기 인형을 던져줍니다.' || char(10) ||'3. 아이는 엄마가 던져주는 아기 인형을 바구니로 받아봅니다.' || char(10) ||' - 아이가 인형을 받을 수 있을 만큼 가까운 거리에서 던져주세요.' || char(10) ||'', '바구니, 아기인형', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('칙칙폭폭 끈 기차놀이', '기차놀이를 하며 신체 움직임을 조절할 수 있고, 가족과 함께 하는 놀이를 통해 유대감 형성 및 즐거움을 경험할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 가족이 모두 들어갈 수 있을 정도의 긴 끈을 매듭을 지어 준비합니다.' || char(10) ||'2. 준비한 끈 안에 차례대로 들어간 후, 양손에 끈을 잡고 섭니다.' || char(10) ||'- 안전사고 예방을 위하여 맨 앞이나 가운데 자리에 아이가 설 수 있도록 도와주세요.' || char(10) ||'3. 기차의 모습을 흉내 내며 함께 몸을 움직여 봅니다.' || char(10) ||'- ''칙칙폭폭'' 소리를 내 보거나 ''기차''와 관련된 노래를 부르며 놀이하는 것도 좋아요.' || char(10) ||'4. 가족들이 함께 보폭이나 속도를 맞추며 기차놀이를 해봅니다.' || char(10) ||'-맨 앞자리에 선 사람의 보폭과 속도에 맞춰 움직이며 집안을 돌아다녀 보세요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'끈 기차 놀이를 하며 기차를 타고 내리거나 여행 가는 모습을 흉내 내며 역할 놀이를 즐겨보는 것도 좋아요.' || char(10) ||'', '길이가 긴 끈 혹은 줄 (가족이 모두 들어갈 수 있을 정도의 길이로 준비해 주세요.)', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('끼적이기 도구를 골라요', '끼적이기 놀이는 아이의 소근육 조절 능력과 눈과 손의 협응력을 증진시켜주는 쉬운 일상 놀이입니다. ' || char(10) ||'놀이를 통해 경험하는 다양한 끼적이기 도구는 아이의 감각 발달을 도와주는 재미있는 놀잇감이 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 전지를 바닥에 깔고, 모서리는 테이프로 고정시켜봅니다.' || char(10) ||'2. 아기에게 다양한 끼적이기 도구를 보여줍니다.' || char(10) ||'3. 아기가 원하는 끼적이기 도구를 골라 끼적이기를 시도할 수 있도록 합니다.' || char(10) ||'4. 아기가 표현하는 색감이나 질감을 언어로 표현해봅니다.' || char(10) ||'', '전지, 테이프, 다양한 끼적이기 도구(색연필, 크레파스, 수성 싸인펜 등)', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('실곤약 촉감 놀이', '두 가지 색의 곤약으로 촉감놀이를 해보세요. 말랑말랑한 촉감의 곤약이 아기의 감각을 자극하고, 서로 다른 색의 곤약을 관찰하고 비교하며 시각과 인지가 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 두 가지 종류의 실 곤약을 넓은 쟁반에 준비합니다.' || char(10) ||'2. 아기가 손으로 만져보며 탐색할 수 있도록 유도합니다.' || char(10) ||'3. 흰색 실 곤약은 흰색 그릇에, 파래 실 곤약은 초록색 그릇에 넣는 모습을 보여줍니다.' || char(10) ||'4. 아기가 그릇에 넣는 모습과 서로 다른 두 가지 색을 언어로 표현해주며 함께 놀이합니다.' || char(10) ||'', '실 곤약, 파래 실곤약, 쟁반, 그릇 2개(흰색, 초록색)', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('밀가루 풀 주머니', '밀가루 풀에 물감을 섞고 지퍼백에 넣으면 아이의 오감을 자극하는 재미있는 놀잇감이 됩니다. ' || char(10) ||'밀가루 풀 주머니 놀이는 아기의 감각을 자극하여 두뇌발달에 도움을 주고 대, 소근육 조절력을 증진시켜줍니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'밀가루 풀 주머니를 냉장고에 보관하시면 좀 더 오래 놀잇감을 가지고 놀 수 있어요!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 밀가루 풀 주머니를 아이에게 보여주고 이야기해봅니다.' || char(10) ||'2. 밀가루 풀 주머니를 바닥에 내려놓아봅니다.' || char(10) ||'3. 밀가루 풀 주머니에 손가락 그림을 그려보고 밟고 서봅니다.' || char(10) ||'4. 밀가루 풀 주머니를 만지거나 밟았을 때 느껴지는 촉감에 대해 이야기해봅니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶''밀가루 풀 주머니'' 이렇게 만들어요~!' || char(10) ||'1. 볼에 밀가루 풀과 물감을 넣고 섞어봅니다.' || char(10) ||' - 실리콘 주걱으로 섞어주면 편해요!' || char(10) ||'2. 밀가루 풀에 색이 적절하게 섞이면 지퍼백에 넣어봅니다.' || char(10) ||' - 밀가루 풀은 지퍼백에 꽉 차지 않게 넣어주세요.' || char(10) ||'3. 지퍼백 양쪽 모서리를 테이프로 감싸줍니다. ' || char(10) ||'', '밀가루 풀, 지퍼백, 테이프, 물감', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('친구에게 인사해요', '놀이터에서 만나 친구에게 인사를 나누며 사회 관계를 형성할 수 있습니다.' || char(10) ||'신체 활동을 통해 스트레스를 해소할 수 있고, 놀이를 통해 대 근육이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기와 준비를 하고 아기와 함께 바깥 놀이터로 나옵니다.' || char(10) ||'2. 바깥 놀이터에서 또래의 아기들이 있는 곳으로 이동합니다.' || char(10) ||'3. 엄마(아빠)가 먼저 또래의 아기와 부모에게 인사 하는 모습을 보여줍니다.' || char(10) ||'4. 아기의 손을 잡고 친구를 향해 흔들며 인사를 합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'또래 친구와 만날 기회를 점차 만들어 주시면 타인과의 놀이에 즐거움을 경험할 수 있습니다.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('숨어 있는 애착 인형을 찾아라!', '애착 인형을 숨기고 찾는 재미있는 놀이를 통해 정서적 안정감을 느끼고, 숨긴 위치와 공간을 구분 하면서 관찰 능력을 키웁니다.' || char(10) ||'' || char(10) ||'놀이 방법1. 아기에게 애착 인형과 함께 숨바꼭질 놀이를 제안합니다.' || char(10) ||'2. 엄마(아빠)가 술래가 되고 아이가 애착 인형을 숨깁니다.' || char(10) ||'3. 아기에게 인형의 위치가 있을 곳을 질문 하며 숨어있는 애착 인형을 같이 찾아봅니다.' || char(10) ||'4. 아기가 찾는 행동에 칭찬해주며 애착 인형이 사라지지 않는다는 것을 이야기해줍니다.' || char(10) ||'5. 같은 방법으로 아기와 애착 인형을 찾고 숨기는 놀이를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'애착 인형 이외에 다른 애착물을 활용하셔도 좋습니다.' || char(10) ||'상자 속에 애착 인형을 숨기고 찾아보는 놀이를 할 수 있습니다.' || char(10) ||'', '애착인형', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('애착 인형 이름이 생겼어요', '애착 인형에 이름을 붙여주고 불러주며 언어 발달이 이뤄지게 되고, 애착 인형을 통해 정서적 안정감을 도와주고, 역할 놀이를 통해 사회성을 키워줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아기의 이름을 불러주며 좋아하는 애착 인형 이름을 지어줄 것을 제안합니다.' || char(10) ||'2. 아기가 이야기한 이름 중에서 좋아하는 이름으로 선택하여 불러줍니다.' || char(10) ||'3. 지어준 이름을 부르며 애착 인형을 쓰다듬고 만져주며 긍정적인 정서를 표현합니다.' || char(10) ||'4. 아기가 애착 인형에게 이름을 불러주며 안아주는 행동을 격려합니다.' || char(10) ||'5. 아기에게 애착 인형과 함께 역할놀이를 하자고 제한합니다.' || char(10) ||'6. 애착 인형과 함께 역할을 정해보고 정한 역할에 따라 역할놀이를 해봅니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'애착 인형을 인정해 주고 소중하게 다뤄주는 모습을 아기에게 보여주세요.' || char(10) ||'스티커 혹은 라벨지 위에 이름을 적어 이름표를 만들어 볼 수 있습니다.' || char(10) ||'', '애착물(인형, 담요, 베개)', '2세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('가족 애칭 정하기', '애칭을 만들어 부르며 가족 간의 친밀감과 유대감을 형성할 수 있으며, 아이에게 자신이 소중하고 특별한 존재임을 느끼게 합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 애칭이 무엇인지에 대해 이야기 나눔니다.' || char(10) ||'(*애칭: 본래 이름 외에 친근하고 다정하게 부를 때 사용하는 이름)' || char(10) ||'2. 서로에게 불러주고 싶은 애칭에 대해 이야기합니다.' || char(10) ||'3. 가족끼리 애칭을 부르며 하고 싶은 이야기를 합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶여러 개의 애칭을 만들어서 다양하게 사용해도 좋아요.' || char(10) ||'▶아이가 듣고 싶은 애칭을 물어보고, 아이가 듣고 싶어 하는 애칭으로 아이들 불러주어도 좋아요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '3~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('1분 동안 눈 맞춤해요', '아이와 눈을 맞추고 마음이 담긴 말을 해보세요. 따뜻한 눈빛과 애정 어린 말은 아이에게 자신이 사랑받고 존중받는 존재임을 느끼게 합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 마주 보고 앉아 눈 맞춤을 합니다.' || char(10) ||'2. 눈을 맞춘 상태로 아이에게 하고 싶은 이야기를 합니다.' || char(10) ||'(진심을 가득 담아 이야기해 주세요.)' || char(10) ||'3. 아이들 꼭 안아주며 아이가 부모에게 소중한 존재임을 알려주세요.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶애정 어린 말도 중요하지만 따뜻한 눈빛도 중요합니다. 평소 일상생활 시 아이와 자주 눈맞춤을 하며 이야기하고, 따뜻한 시선으로 바라봐 주세요.' || char(10) ||'▶아이가 눈 맞춤하는 것을 부끄러워하거나 어려워할 수도 있습니다. 눈 맞춤 시간을 조절하며 익숙해지면 점차 시간을 늘려주세요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '3~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('다 함께 댄스댄스', '노래에 맞추어 함께 춤을 춰보세요. 가족과 즐거운 시간을 보낼 수 있으며, 가족 간의 친밀감 형성에 도움이 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 가족이 좋아하는 노래에 대해 이야기 나늡니다.' || char(10) ||'2. 노래를 정한 후 함께 춤을 추자고 제안합니다.' || char(10) ||'3. 춤을 추는 중간중간 아이와 함께 스킨십을 할 수 있는 동작을 합니다.' || char(10) ||'(엉덩이 부딪히기, 손 마주치기, 포옹하기, 손잡기 등)' || char(10) ||'4. 함께 하고 싶은 동작이 있는지 이야기 나눈 후 함께 정한 동작을 하며 춤을 춥니다.' || char(10) ||'5. 다양한 노래를 들으며 즐겁게 춤을 춥니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶좋아하는 것을 함께 공유하는 것만으로도 아이에게는 큰 기쁨을 주지요. 아이와 함께 춤을 추고 아이가 좋아하는 노래를 함께 불러도 좋아요.' || char(10) ||'', '음악을 들 수 있는 물건(컴퓨터, 핸드폰, 블루투스 스피커 등)', '3~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('우리는 캥거루가족', '아이와 스킨십을 하며 하루 일과를 공유하는 시간을 가져보세요. ' || char(10) ||'아이는 자신의 경험을 이야기하며 생각과 경험을 말로 표현해볼 수 있으며, 부모와의 스킨십과 의사소통을 통해 정서적 유대감을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 잠들기 전 침대에 누워 아이들 꼭 안아줍니다.' || char(10) ||'2. 아이에게 오늘 하루가 어땠는지 질문합니다.' || char(10) ||'3. 아이의 말을 경청하고 아이가 느낀 감정에 공감해 줍니다.' || char(10) ||'4. 엄마, 아빠의 하루 일과도 아이에게 이야기해 줍니다.' || char(10) ||'5. 아이들 꼭 안아주며 취침 인사를 합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶캥거루처럼 아이와 꼭 붙어서 집안 이곳저곳을 함께 다녀보세요. 아이와 더 많은 상호작용을 하며 유대감을 형성할 수 있을 거예요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '3~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('톡톡톡! 로션을 발라요', '부모의 스킨십과 애정 어린 말 한마디는 아이에게 부모의 사랑을 느낄 수 있게 하며, 스킨십과 사랑이 가득 담긴 말을 주고받으며 정서적 유대감을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 함께 목욕을 합니다.' || char(10) ||'2. 몸을 닦고 옷을 입은 후 아이와 마주 보고 앉습니다.' || char(10) ||'3. 아이의 얼굴과 몸에 로션을 발라주며 사랑이 가득 담긴 말을 건넵니다.' || char(10) ||'4. 로션을 다 발라준 후 아이들 꼭 안아주며 사랑을 표현합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶ 아침, 저녁 하루 5분이라도 규칙적으로 아이와 스킨십 하고 이야기하는 시간을 가져보세요. 우리 아이의 정서 발달을 도와줄 거예요.' || char(10) ||'▶ 가족이 함께 둘러앉아 서로에게 로션을 발라주어도 좋아요.' || char(10) ||'', '로션', '3~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('포일 그림을 그려요', '호기심을 자극하는 포일 그림 놀이를 해보세요. 포일 위에 끼적이기를 해보며 아이의 창의력과 소근육 조절력이 증진됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 포일을 도화지 크기로 잘라봅니다.' || char(10) ||'2. 도화지 위에 자른 포일을 풀로 붙여봅니다.' || char(10) ||'3. 아이에게 색깔 매직을 보여주고 좋아하는 색깔을 선택할 수 있도록 이야기합니다.' || char(10) ||'4. 포일 위에 끼적이기를 할 수 있도록 격려합니다.' || char(10) ||'5. 아이가 그림을 완성하면 완성한 그림을 보고 이야기를 나눠봅니다.' || char(10) ||'', '포일, 도화지, 매직, 풀', '3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('점프 파이팅 놀이', '아빠와 파이팅을 하며 전신 근육의 발달을 도모하고 안정적인 애착을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 손을 내밀고 파이팅 동작을 제안합니다.' || char(10) ||' - 아이가 아빠 손바닥과 마주칠 수 있도록 하고 손바닥이 마주치면 ''파이팅''을 이야기합니다.' || char(10) ||'2. 동작을 반복하며 아이가 익숙해질 수 있도록 합니다.' || char(10) ||'3. 파이팅 동작에 어느정도 익숙함을 보이면 아빠는 일어서서 파이팅을 제안합니다.' || char(10) ||'4. 손의 높이를 점점 올려 아이가 점프를 하며 손바닥을 마주칠 수 있도록 합니다.' || char(10) ||'- 파이팅에 성공할 때마다 아이에게 스킨십을 해주거나 격려를 해주세요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('눈 맞추며 이야기해요', '놀이를 하며 대화 시 지켜야 하는 예절에 대해 알 수 있으며, 눈을 맞추고 대화하며 아이와 친밀감을 형성할 수 있습니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'아이의 연령에 맞게 난이도를 조절해 주세요' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 대화 시 지켜야 하는 예절에 대해 이야기 나눕니다.' || char(10) ||'(눈을 보며 이야기하기, 경청하기, 정확한 발음으로 이야기하기 등)' || char(10) ||'2. 아이와 마주 보고 앉아 눈을 맞춥니다.' || char(10) ||'3. 서로에게 하고 싶은 이야기를 합니다.' || char(10) ||'(칭찬, 애정표현 등)' || char(10) ||'4. 서로를 꼭 안아주며 대화 시 지켜야 하는 예절에 대해 다시 한번 이야기 나눕니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶ 3~4세: "사랑해", "고마워"등 마음을 표현하는 말을 주고받아보세요.' || char(10) ||'▶ 5~7세: 칭찬하는 말을 주고받아보세요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('귓속말 퀴즈', '공공장소의 의미와 공공장소에서 지켜야 하는 다양한 예절을 알고 실천할 수 있습니다.' || char(10) ||'' || char(10) ||'주의 사항아이의 연령에 맞게 난이도를 조절해 주세요' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 여러 가지 공공장소와 공공장소에서 지켜야 하는 예절에 대해 이야기 나눕니다.' || char(10) ||'2. 공공장소에서 이야기할 때 지켜야 하는 예절에 대해 이야기 나늡니다.' || char(10) ||'(조용히 말해야 하는 공공장소에 대해 이야기 나눠주세요.)' || char(10) ||'3. 귓속말 퀴즈를 합니다.' || char(10) ||'(동물, 과일, 장난감 등 아이에게 친숙한 것으로 퀴즈를 내주세요)' || char(10) ||'4. 역할을 바꿔 아이가 문제를 내고 부모가 정답을 맞혀봅니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶ 3~4세: 아이에게 친숙한 동물, 사물에 대한 퀴즈를 내주세요.' || char(10) ||'▶ 5~7세: 다섯 고개 놀이를 하며 힌트와 정답을 귓속말로 주고받아보세요.' || char(10) ||'▶공공장소에서 아이와 함께 귓속말 퀴즈 놀이를 해도 좋아요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('오른쪽을 찾아 걸어요', '우측통행을 해야 하는 이유와 방법에 대해 알아보며 올바른 통행 습관을 기를 수 있습니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'아이의 연령에 맞게 난이도를 조절해 주세요' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 계단, 복도, 에스컬레이터를 이용해본 경험에 대해 이야기 나눕니다.' || char(10) ||'2. 우측통행을 해야 하는 이유와 방법에 대해 이야기 나눕니다.' || char(10) ||'3. 일상생활에서 계단, 복도 등에서 오른족으로 걸어보며 우측통행에 익숙해지도록 합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶ 3~5세: 아직 좌우 개념이 발달하지 않았기 때문에, 노래나 신호에 맞춰 바르게 걷고 멈춰보는 놀이를 통해 신체 조절력을 기르는 놀이를 해보세요.' || char(10) ||'▶ 6~7세: 좌우 개념에 익숙해질 수 있도록 오른쪽 손에 물건 들기 등 오른쪽 찾기 놀이를 해보세요.' || char(10) ||'', '준비물이 필요 없는 쉬운 놀이에요', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('식당에 왔어요', '식당에서 지켜야 하는 예절을 알고 지키는 습관을 기를 수 있습니다. ' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'아이의 연령에 맞게 난이도를 조절해 주세요' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 여러 가지 공공장소와 공공장소에서 지켜야 하는 예절에 대해 이야기 나눕니다.' || char(10) ||'2. 식당에서 지켜야 하는 예절에 대해 이야기 나눕니다.' || char(10) ||'3. 식당 놀이를 위한 공간을 구성합니다.' || char(10) ||'4. 역할을 나누고 역할이 할 일을 함께 정합니다.' || char(10) ||'5. 역할놀이를 하며 식당 예절을 익힙니다.' || char(10) ||'6. 놀이 후 활동을 회상하며 공공장소 예절의 중요성과 식당 및 공공장소에서 지켜야 하는 예절에 대해 다시 한번 이야기 나눕니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶ 3~4세: 식당에서 지켜야 하는 예절에 대해 이야기 나눠보세요.' || char(10) ||'▶ 5~7세: 식당에 가보았던 경험을 이야기 나누며 역할놀이를 해보세요.' || char(10) ||'▶다양한 공공장소에서 지켜야 하는 예절에 대해 이야기 나눠보고, 역할 놀이를 통해 공공장소 예절을 익혀보세요.' || char(10) ||'', '종이, 펜, 역할 놀이 소품(음식모형, 그릇, 책상, 의자 등)', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('우리 가족 식사 인사', '식사 시 사용하는 인사말을 알고 실천할 수 있으며, 다양한 인사말과 인사법을 알아보며 인사 습관을 기를 수 있습니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'아이의 연령에 맞게 난이도를 조절해 주세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 인사의 중요성에 대해 이야기 나눕니다.' || char(10) ||'2. 다양한 상황에서 사용하는 인사말에 대해 이야기 나눕니다.' || char(10) ||'(안녕, 고마워, 미안해, 잘 먹겠습니다 등)' || char(10) ||'3. 우리 가족만의 특별한 식사 인사말과 행동을 만듭니다.' || char(10) ||'4. 일상생활에서 인사말을 지속적으로 사용합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶ 3~4세: 식사 시 사용하는 인사말을 반복적으로 들려주고 따라 해볼 수 있도록 도와주세요.' || char(10) ||'▶ 5~7세: 우리 가족만의 식사 인사를 반복적으로 실천해보세요. 함께 만든 인사법을 종이에 적어 집에 전시하고 반복적으로 실천해보아도 좋아요.' || char(10) ||'▶ 아이가 인사를 하기 위해 노력하는 모습을 보일 때 칭찬을 통해 격려해 주세요.' || char(10) ||'', '종이, 펜', '2~6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('꼭지를 따요', '방울토마토의 꼭지를 따며 눈과 손의 협응력과 소근육 발달을 돕습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 방울토마토를 깨끗이 씻어 준비합니다.' || char(10) ||'2. 방울트마트 꼭지 따는 모습을 보여줍니다.' || char(10) ||'3. 아이도 방울토마토 꼭지 따기를 유도합니다.' || char(10) ||'4. 꼭지를 따는 아이의 행동을 격려해줍니다.' || char(10) ||'', '방울 토마토, 접시', '3세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('조물조물 클레이 놀이', '클레이를 쥐고 놀이하며 인지 발달을 도모하고 눈과 손의 협응력과 소근육 발달을 도와줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 클레이를 보여주고 자유롭게 탐색합니다.' || char(10) ||' - 손으로 꾹 눌러보기도 하고 양손에 쥐고 늘여보기도 하며 자유롭게 탐색하세요.' || char(10) ||'2. 클레이를 손바닥이나 주먹으로 꾹꾹 눌러 바닥에 평평하게 펼칩니다.' || char(10) ||'3. 단추를 보여주고 평평해진 클레이 위에 단추를 올려놓습니다.' || char(10) ||'4. 단추가 고정될 수 있도록 단추를 올려놓은 자리에 손가락으로 꾹꾹 눌러줍니다.' || char(10) ||'5. 케이크 칼로 단추를 올린 클레이를 썰며 놀이를 반복합니다.' || char(10) ||'' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'▶색깔을 섞어 놀이하거나 다양한 촉감 재료를 제시해줘도 좋아요!' || char(10) ||'두 가지 이상의 클레이로 놀이를 하다 보면 자연스럽게 색깔이 섞일 수 있습니다.' || char(10) ||'아이가 색깔을 섞어서 놀이하려 한다면 제지하기보다는 색깔이 변화된 과정을 이야기해주고 능동적으로 자유롭게 놀이할 수 있도록 격려해주세요.' || char(10) ||'', '클레이, 케이크 칼, 단추', '2~3세', now(), now(), FALSE, 1, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('빨대 비행기 만들기', '빨대와 종이만 있으면 아주아주 쉽게 비행기를 만들 수 있어요. 어린 아이도 쉽게 만들 수 있답니다! 살짝만 던져도 잘 날아서 어린 아이들도 가지고 놀 수 있어요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 한 종이는 얇고 길게, 한 종이는 두껍고 조금 짧게 준비하세요. (한 장은 3*12cm ' || char(47) ||' 한 장은 4*9cm로 준비하면 좋아요!)' || char(10) ||'2. 종이를 말아 테이프를 붙여서 원기둥모양을 두 개 만들어주세요.' || char(10) ||'3. 각 원기둥 종이들을 빨대 끝에 테이프로 고정시켜주세요.' || char(10) ||'4. 완성! 두꺼운 쪽이 앞부분이에요. 신나게 날려볼까요?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1) 여러 개를 만들어서 누구 비행기가 더 멀리 날아가는지 시합해보세요!' || char(10) ||'2) 아주 어린 아이들도 조금만 도와주면 쉽게 만들 수 있답니다. 아이들이 직접 만들 수 있도록 해 보세요.' || char(10) ||'3) 종이를 더 두껍게도 해 보고, 더 큰 원기둥으로도 만들어 보고, 얇은 빨대로도 만들어보세요. 비행기를 여러 개 만들고 서로 비교도 해 봐요!' || char(10) ||'', '두꺼운 빨대, 종이 두장, 테이프', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('공룡 만들기', '재활용 상자 조각으로 공룡 만들기를 해보세요. 놀이를 통해 창의력과 상상력을 키우고 눈과 손의 협응력과 소근육 발달을 증진해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 상자 조각 위에 아이가 그리고 싶은 공룡을 그립니다.' || char(10) ||'- 그림을 그릴 때는 머리와 꼬리, 몸통, 다리를 각각 따로 그려주세요.' || char(10) ||'- 박물관이나 그림책에서 봤었던 공룡을 그려도 좋아요.' || char(10) ||'2. 그린 공룡을 가위로 자릅니다.' || char(10) ||'3. 공룡의 각 부위를 송곳으로 구멍을 뚫고 할핀으로 고정합니다.' || char(10) ||'4. 공룡 주변의 꽃이나 나무를 꾸며줍니다.' || char(10) ||'5. 완성된 공룡을 움직이며 놀이합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 우리가 박물관에 가서 무엇을 봤었지?' || char(10) ||'아이: 공룡이랑 꽃을 봤어요.' || char(10) ||'엄마: 맞아. 우리 oo이는 어떤 공룡이 기억에 남니?' || char(10) ||'아이: 티라노사우루스요!' || char(10) ||'엄마: 좋아. 우리 oo이가 엄마랑 티라노사우루스를 꾸며볼까?' || char(10) ||'아이: 네!' || char(10) ||'', '상자 조각, 가위, 풀, 크레용, 할핀, 송곳', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('무지개 친구 얼굴 만들기', '좋아하는 친구들을 떠올리며 무지개 얼굴 만들기 놀이를 해보세요. 놀이를 통해 상상력과 창의력을 기르고 친구를 떠올리며 사회성 발달을 증진시켜줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 무지개를 만들 색종이를 가위로 길게 자릅니다.' || char(10) ||'2. 자른 무지개의 끝과 끝을 테이프로 붙입니다.' || char(10) ||'3. 무지개를 꾸밀 구름과 태양을 만들고 무지개 주변에 붙입니다.' || char(10) ||'4. 다양한 재료를 활용하여 친구 얼굴도 꾸밉니다.' || char(10) ||'5. 무지개 아래로 친구들을 붙여주면 완성~!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: (색종이를 보여주며) 색종이를 보니 무엇이 떠오르니?' || char(10) ||'아이: 무지개가 생각나요' || char(10) ||'엄마: 이 색종이로 무지개를 꾸며볼까?' || char(10) ||'아이: 네! 친구 얼굴도 꾸며줄래요!' || char(10) ||'엄마: 좋은 생각이야. 여기 재료들로 oo이가 좋아하는 친구를 생각하며 만들어보자.' || char(10) ||'', '도화지, 색종이, 가위, 풀, 테이프, 사인펜, 색연필', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('민들레 물감 놀이', '다양한 색채 도구를 활용하여 민들레 꽃밭 꾸미기를 해보세요. 놀이를 통해 아이의 창의력과 상상력을 키우고, 소근육 조절력을 키워줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 만들기 재료를 보여주고 아이와 이야기를 나눕니다.' || char(10) ||'2. 다양한 색깔의 물감으로 민들레를 표현합니다.' || char(10) ||'3. 도화지 위에 색연필로 그린 그림들을 민들레 그림 옆에 붙입니다.' || char(10) ||'4. 작품을 완성하면 아이 스스로를 자신의 작품을 엄마에게 소개해봅니다.' || char(10) ||'5. 완성된 작품은 아이가 놀이하는 공간에 전시해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 우리 공원에서 후~하고 불었던 게 뭐였니?' || char(10) ||'아이: 민들레 씨앗이요!!' || char(10) ||'엄마: 우리 물감으로 민들레를 그려볼까?' || char(10) ||'아이: 우와!! 좋아요!!' || char(10) ||'엄마: 하얀색 민들레 씨앗을 손가락으로 찍어서 표현해볼거야~' || char(10) ||'아이: 제가 찍어볼게요!!(손가락에 물감을 찍어 민들레를 표현합니다.)' || char(10) ||'엄마: 포크로 민들레 잎과 줄기를 표현해볼까?' || char(10) ||'아이: 네~' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'''민들레 물감 놀이'' 이렇게 해보세요!' || char(10) ||'1. 포크 위에 물감을 찍어 민들레의 잎과 줄기를 만듭니다.' || char(10) ||'2. 흰색 물감에 지문을 찍고 검정 도화지에 묻혀 민들레 씨를 표현합니다.' || char(10) ||'3. 도화지 위에 그림을 그려 민들레 밭에서 놀이하는 가족이나 친구의 모습을 그립니다.' || char(10) ||'4. 도화지 위에 그린 사람을 가위로 자르고 민들레를 표현한 그림 위에 붙입니다.' || char(10) ||'5. 민들레 물감 놀이 완성~!' || char(10) ||'', '검정 도화지, 물감, 포크, 도화지, 색연필, 가위, 풀', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('로켓 선물함 만들기', '플라스틱 컵을 다양한 꾸미기 재료로 꾸미고 선물함을 만드는 놀이는 아이의 창의력과 상상력을 증진하고, 타인에게 고마운 마음을 편지와 선물로 표현하며 사회성 발달에 도움을 줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 선물함을 만들어 전달하고 싶은 사람에 대해 이야기를 나눕니다.' || char(10) ||'2. 만들기 재료를 보여주고 어떤 모양으로 선물함을 꾸밀지 이야기합니다.' || char(10) ||'3. 꾸미기 재료를 활용하여 선물함을 만들어봅니다.' || char(10) ||'4. 완성된 선물함을 전달하고, 아이의 행동을 칭찬해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'''로켓 선물함'' 이렇게 만들어요~!' || char(10) ||'1. 도화지 위에 로켓에 탑슬할 사람의 얼굴을 그립니다.' || char(10) ||'2. 셀로판지를 잘라 로켓의 불꽃을 만들고, 컵 바닥에 붙입니다.' || char(10) ||'3. 컵의 겉면은 색종이로 둘러싸고, 다양한 색깔 색종이로 꾸밉니다.' || char(10) ||'4. 도화지 위에 그렸던 얼굴을 꾸민 컵 위에 붙입니다.' || char(10) ||'5. 색종이를 세모 모양으로 자르고 로켓의 날개를 만들어봅니다.' || char(10) ||'6. 선물을 전달하고 싶은 사람에게 전달할 편지 문구를 쓰고, 잘라내 빨대에 붙입니다.' || char(10) ||'7. 완성된 컵 안에 선물을 넣어봅니다.' || char(10) ||'8. 컵 뚜껑을 닫고 편지를 붙인 빨대를 끼우면 완성~!' || char(10) ||'', '일회용 커피 컵, 도화지, 색채 도구, 셀로판지, 색종이, 가위, 풀, 테이프', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('색종이 트리 카드 만들기', '색종이로 트리 만들기 놀이를 해보세요. 아이의 소근육 발달을 도와주고 색종이를 트리로 완성시키는 과정에서 상상력과 창의력을 키워줄 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 색종이를 삼각형 모양이 되도록 반으로 접어봅니다.' || char(10) ||'2. 삼각형의 한 면은 일정한 간격으로 가위로 잘라봅니다.' || char(10) ||'3. 가위질을 한 색종이를 펼쳐봅니다.' || char(10) ||'4. 색종이를 마름모꼴로 놓고 가운데에 양면테이프를 붙여봅니다.' || char(10) ||'5. 양면테이프를 떼어내고 색종이 끝과 끝을 이어 붙여봅니다.' || char(10) ||'6. 트리 모양이 완성되면 다양한 꾸미기 재료로 트리를 꾸며봅니다.' || char(10) ||'7. 완성된 트리 카드에 전하고 싶은 말을 적어보고 카드를 전달해봅니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마아빠: (완성된 트리 카드를 보며) oo이가 멋진 트리 카드를 완성하였네.' || char(10) ||'아이: 네!' || char(10) ||'엄마아빠: 이 카드를 누구에게 보내주고 싶니?' || char(10) ||'아이: oo이는 할머니한테 카드를 보내고 싶어요.' || char(10) ||'엄마아빠: 좋은 생각이야. 그럼 우리 oo이가 트리 카드에 편지글을 써보고 할머니께 보내 드리자.' || char(10) ||'아이: 네~!' || char(10) ||'', '색종이, 가위, 풀, 양면테이프, 꾸미기 재료', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('비닐봉지 제기 만들기', '비닐봉지로 간단한 제기 만들기 놀이를 해보세요. 아이의 창의력과 상상력을 키우고 제기 놀이를 통해 대근육 발달을 도모합니다.' || char(10) ||'주의사항' || char(10) ||'아이가 제기차기를 어려워한다면 고무줄로 천장에 매달아 발로 차는 놀이를 해보세요!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 비닐봉지 제기를 순서에 따라 만들어봅니다.' || char(10) ||'2. 아빠가 먼저 완성된 제기를 차는 모습을 보여줍니다.' || char(10) ||'3. 아이가 제기차기 요령을 터득할 수 있도록 천천히 설명해주세요.' || char(10) ||'4. 아이가 제기차기를 성공하면 격려와 칭찬을 해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'''비닐봉지 제기'' 이렇게 만들어요!' || char(10) ||'1. 비닐봉지 위에 색깔 매직으로 끼적이기를 해봅니다.' || char(10) ||'2. 비닐봉지 가운데에 동전 하나를 올려두고 감싸봅니다.' || char(10) ||'- 신문지 뭉치나 솜 뭉치를 넣으면 더욱 안전하게 놀이할 수 있어요.' || char(10) ||'3. 비닐봉지를 제기 형태로 모양을 잡고 고무줄로 고정합니다.' || char(10) ||'4. 제기 아랫부분이 되는 곳은 가위로 얇게 잘라봅니다.' || char(10) ||'5. 비닐봉지 제기 완성!' || char(10) ||'', '비닐봉지, 가위, 색깔 매직, 동전, 고무줄', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('고무 동력 보트 만들기', '아빠표 고무 동력 보트를 만들어보세요. 놀이를 통해 아이와 애착을 형성하고, 배를 움직여보며 사회성과 대근육 발달을 증진해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 순서에 따라 고무 동력 보트를 만들어봅니다.' || char(10) ||'2. 욕조나 대야에 물을 받아놓고 고무 동력 보트를 움직여 봅니다.' || char(10) ||'3. 아이가 고무 동력 보트의 움직임에 흥미를 보이면 아이가 직접 배를 움직여 볼 수 있도록 도와줍니다.' || char(10) ||'(고무줄을 돌려서 물 위에 올려놓을 수 있도록 이야기해주세요.)' || char(10) ||'4. 아이가 배를 움직이면 격려를 하며 놀이를 반복해봅니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아빠: (고무 동력 보트를 만든 후) oo아!! 우리 보트를 물에 띄워볼까?' || char(10) ||'아빠: 보트가 더 멀리, 빨리 갈 수 있도록 하려면 어떻게 해야 할까?' || char(10) ||'아빠: oo이가 날개를 많이 돌려줄 수 있겠니?' || char(10) ||'아빠: 와~!! 보트가 끝까지 움직였구나!! 다시 해볼까?' || char(10) ||'', '스티로폼, 자, 펜, 아이스 스틱, 고무줄, 사포, 글루건', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('휴지심 연필꽂이', '휴지심으로 연필꽂이 만들기 놀이를 해보세요. 간단한 방법으로 아이의 상상력과 창의력을 키워주는 시간이 되고, 놀이를 통해 소근육 조절력을 증진시켜줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 만들기 재료를 보여주고 이야기를 나눠봅니다.' || char(10) ||'2. 마분지 위에 휴지심을 올려놓고 바닥 뚜껑을 만들 크기를 스케치해봅니다.' || char(10) ||'3. 마분지를 선을 따라 가위로 잘라봅니다.' || char(10) ||'4. 마분지 테두리를 따라 목공 본드를 묻히고 휴지심을 올려놓아 고정시켜봅니다.' || char(10) ||'5. 휴지심을 두를 펠트지를 가위로 잘라보고 매직으로 그림을 그려봅니다.' || char(10) ||'6. 휴지심 위에 펠트지를 붙이고 다양한 꾸미기 재료도 붙여봅니다.' || char(10) ||'7. 완성된 작품을 아이만의 공간에 배치해주세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: (만들기 재료를 보여주며) oo아, 여기 여러 가지 만들기 재료들이 있네. 어떤 재료들이 있는지 우리 oo이가 볼까?' || char(10) ||'엄마: 오늘은 이 휴지심으로 연필꽂이를 만들어볼 거란다. 이 휴지심이 연필을 넣는 통이 되는 거지.' || char(10) ||'아이: 우와! 저는 연필꽂이에 엄마, 아빠 얼굴을 그리고 싶어요!' || char(10) ||'엄마: 좋은 생각이야. 우선 바닥을 덮을 뚜껑부터 만들어보자.' || char(10) ||'아이: 네~!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'휴지심은 굵은 심을 활용하는 것이 더욱 좋아요!' || char(10) ||'', '휴지심, 마분지, 연필, 가위, 목공 본드, 매직, 펠트지, 꾸미기 재료', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('휴지심 눈사람', '휴지심으로 쉬운 눈사람 만들기 놀이를 해보세요. 휴지심이 눈사람으로 바뀌는 모습을 보며 아이의 상상력과 창의력을 키우고 소근육 조절력을 발달시켜줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 만들기 재료를 보여주고 이야기를 나눠봅니다.' || char(10) ||'2. 휴지심 위에 흰색 종이를 풀로 붙여 덮어 씌워봅니다.' || char(10) ||'3. 매직으로 눈사람의 눈과 입을 그려봅니다.' || char(10) ||'4. 눈사람 팔을 만들 위치에 송곳으로 구멍을 뚫고, 면봉을 꽂아봅니다.' || char(10) ||'5. 다양한 꾸미기 재료를 활용하여 눈사람의 코와 목도리, 단추 등을 꾸며줍니다.' || char(10) ||'6. 완성된 작품을 끈에 매달아 트리에 장식하거나 장식장 위에 올려놓아 봅니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: (만들기 재료들을 보여주며) oo아, 여기 재미있는 만들기 재료들이 많이 있네.' || char(10) ||'엄마: 이 재료들로 무엇을 만들 수 있을까? 오늘처럼 펑펑펑 눈이 내리는 날 생각나는 것이 뭐가 있지?' || char(10) ||'아이: 눈사람!' || char(10) ||'엄마: 맞아. 오늘은 이 휴지심을 이용하여 귀여운 꼬마 눈사람을 만들어보자.' || char(10) ||'아이: 네~! 저는 눈사람을 크리스마스트리에 걸어줄 거예요!' || char(10) ||'', '휴지심, 흰색 종이(한지, 도화지 등), 면봉 2개, 송곳, 가위, 풀, 목공 본드, 매직, 꾸미기 도구(단추, 도토리 천 조각 등)', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('고무줄 총 만들기', '고무줄과 나무젓가락으로 아빠표 고무줄 총을 만들어주세요. 놀이를 통해 아이가 아빠와 특별한 공감대를 형성하고 자기 조절력을 기르는 데 도움이 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 고무줄 총을 아이에게 보여주고 호기심을 유발해봅니다.' || char(10) ||'2. 고무줄 총 방아쇠를 당겨 아이에게 보여주세요.' || char(10) ||'3. 아이가 고무줄 총을 스스로 조작할 수 있도록 격려해줍니다.' || char(10) ||'4. 집 안에 있는 인형이나 풍선을 이용하여 맞추기 놀이를 해봐도 좋습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아빠: (고무줄 총을 보여주며) oo아 이게 뭘까? 아빠가 나무젓가락으로 신기한 총을 만들었지!' || char(10) ||'아이: 우와! 아빠 이거 어떻게 하는 거예요?' || char(10) ||'아빠: (고무줄 총 방아쇠를 당기며) 짠~! 아빠가 방아쇠를 당기니 고무줄이 멀리 날아가 버렸네. 우리 oo이도 한 번 해볼래?' || char(10) ||'아이: 네! 좋아요! 저는 아빠보다 더 멀리 날아가게 할 수 있어요!' || char(10) ||'아빠: 하하하. 그래, 우리 oo이가 힘차게 방아쇠를 당겨볼까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'''고무줄 총'' 이렇게 만들어요!' || char(10) ||'1. 나무젓가락 3개를 고무줄 묶어주세요.' || char(10) ||'2. 몸통의 반대편도 단단히 묶어주세요.' || char(10) ||'3. 나무젓가락 하나를 새끼손가락만큼 칼집을 내고 꺾어 방아쇠를 만들어주세요.' || char(10) ||'4. 방아쇠 위치를 잡고 고무줄을 꼬면서 몸통과 엮어주세요.' || char(10) ||'5. 방아쇠가 잘 버티도록 한 번 더 묶어주세요.' || char(10) ||'6. 손잡이를 몸통과 연결하고 고무줄로 단단히 묶어주세요.' || char(10) ||'7. 손잡이도 잘 버틸 수 있도록 한 번 더 묶어주세요.' || char(10) ||'8. 완성! 이제 고무줄을 걸고 쏴보세요~!' || char(10) ||'', '나무젓가락, 고무줄, 커터 칼', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('레고 간식 만들기', '아이들이 좋아하는 레고를 간식으로 만들어 보아요! 아이와 직접 간식을 만들면서 편식하는 습관을 바꿀 수 있고 부모님과의 애착 형성에 큰 도움을 줄 수 있습니다. 손을 사용하기에 소근육 발달에도 큰 도움이 된답니다. 귀여운 레고 간식 만들기 시작해 볼까요?' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'*과자를 사용하는 경우 아이가 너무 많이 먹을 소지가 있으니 개수를 제한해 놀이해주세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 함께 레고 모양의 간식을 만들 재료를 준비합니다.' || char(10) ||'2. 네모 모양의 과자에 원형의 초콜릿을 올려 레고의 끼우는 부분을 만듭니다.' || char(10) ||'3. 그 위에 꿀을 부어 과자와 초콜릿을 고정합니다. (꿀에 색을 넣어 각 가지 색으로 만들면 더더욱 좋답니다.)' || char(10) ||'4. 아이와 함께 만든 과자로 모양을 만들어 보며 놀이한 후 간식을 먹습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'부모: oo아! 오늘 엄마(아빠)하고 간식을 만들어 볼까? 그냥 모양이 아니라 레고 모양이야!' || char(10) ||'아이: 레고 모양이요? 진짜요? 빨리 만들어요!' || char(10) ||'부모: 그래! 우리 열심히 만들어 보자! 어떤 재료가 필요할까? 우리 oo이가 좋아하는 과자로 만들어 볼까?' || char(10) ||'아이: 네! 좋아요!' || char(10) ||'부모: 그럼 긴 모양의 과자를 그대로 사용하거나 이 과자를 잘라 작게 만들 수도 있겠다.' || char(10) ||'아이: 엄마(아빠)! 저는 크게 만들래요.' || char(10) ||'부모: 엄마(아빠)는 이렇게 네모 모양의 과자 위에 동그란 초콜릿을 올려서 꿀을 뿌려서 이 모양을 만들어 볼래. 짜잔!' || char(10) ||'아이: 우와! 진짜 레고다! 멋있다! 엄마(아빠)! 저도 똑같이 만들어 볼래요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'*만드는 재료는 여러 가지로 응용할 수 있습니다. 우리 아이가 편식한다면, 편식하는 재료를 잘게 잘라 밥에 넣은 후 모양을 만들어도 좋은 효과를 볼 수 있습니다. 빵과 과일로도 만들 수 있어요!' || char(10) ||'', '네모 모양의 두께감이 있는 과자 (예: 웨하스), 원형 모양의 초콜릿, 젤리 등(지름 0.5cm정도 되는 원형), 꿀이나 시럽', '2-7세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('모루로 숫자놀이를 해요', '모루를 사용해 숫자를 직접 만들어 보고 그에 대응하는 적절한 수의 고리를 걸어보며 수연산의 기초를 형성합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 함께 모루로 1부터 10까지의 숫자를 만듭니다.' || char(10) ||'2. 아이가 만든 숫자에 끼울 수 있는 크기의 고리 여러 개를 만듭니다. ' || char(10) ||'3. 아이는 만들어 놓은 숫자를 숫자의 순서에 맞게 배열합니다.' || char(10) ||'4. 숫자를 하나씩 골라 그 숫자에 해당하는 양만큼 고리를 끼우게 합니다.' || char(10) ||'5. 놀이를 여러 번 반복 후 마무리합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'부모: oo아, 오늘 엄마(아빠)랑 이것으로 만들기를 해보자.' || char(10) ||'아이: 이게 뭐예요?' || char(10) ||'부모: 응, 이것은 모루라고 하는 것인데 이렇게 쉽게 구부릴 수 있어서 우리 oo이가 무엇이든 쉽게 만들 수 있단다.' || char(10) ||'아이: 와! 신기하다. 이것으로 무엇을 만들지?' || char(10) ||'부모: 글쎄, oo이가 고민해서 만들고 싶은 것을 만들어 봐! 엄마(아빠)도 생각해서 만들어 볼게!' || char(10) ||'아이: 네! 자동차 만들어야지!' || char(10) ||'엄마: 우리 oo이는 자동차를 만드는구나. 엄마(아빠)는 엄마(아빠)가 좋아하는 숫자 3을 만들었는데 어때?' || char(10) ||'아이: 엄마! 진짜 잘 만들었어요. 저는 6을 만들어 볼게요!' || char(10) ||'부모: 그래! 그럼 우리 이것으로 이렇게 숫자를 만들어서 놀이해볼까?' || char(10) ||'아이: 좋아요! 그런데 어떻게 놀이를 하지?' || char(10) ||'부모: 숫자를 모두 만든 후에, 이렇게 작은 고리도 만드는 거야. 그리고 그 숫자만큼 고리를 끼우는 거야! 이렇게!' || char(10) ||'아이: 좋아요! 엄마! 그럼 그 고리를 동그라미도 만들고 별도 만들래요! 어때요?' || char(10) ||'부모: 정말 좋은 생각이구나!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'# 숫자는 아이가 현재 인지하고 있는 정도, 그리고 이 나이에는 꼭 알아두어야 할 정도에서만 놀이를 해주세요.' || char(10) ||'예: 3세-1, 2, 3의 숫자와 그 수에 대한 양' || char(10) ||'4세 초반-1, 2, 3, 4, 5의 숫자와 그 수에 대한 양' || char(10) ||'4세 후반- 1-10의 숫자와 그 수에 대한 양 등' || char(10) ||'', '모루, 가위', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('돌멩이 콜라주 액자', '자연물로 멋진 꼴라주 그림을 완성해보세요~!' || char(10) ||'놀이터에서 구하기 쉬운 돌멩이나 나뭇가지 하나로도 아이는 멋진 상상화를 완성할 수 있습니다. 아이와 함께 돌멩이로 멋진 돌멩이 꼴라주 액자를 만들어보세요. 아이는 꼴라주 액자를 만들어보며 마음껏 상상하고 창의력을 키울 수 있을거에요. ' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 돌멩이로 만들 수 있는 것들에 대해 상상하고 이야기 나누기를 해봅니다.' || char(10) ||'2. 어떤 것을 만들지 정해 보고 필요한 준비물을 구성해봅니다.' || char(10) ||'3. 아이와 함께 돌멩이 콜라주 액자를 만들어봅니다.' || char(10) ||'4. 완성한 돌멩이 콜라주 액자를 아이의 시선에 알맞은 위치에 걸어놓아보고 격려해봅니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아 엄마랑 돌멩이로 멋진 그림을 만들어볼까?' || char(10) ||'아이: 우와 어떻게요?' || char(10) ||'엄마: 여기 도화지에 돌멩이를 붙여보고 우리 oo이가 상상하는 것들을 그려보자~' || char(10) ||'아이: (돌멩이 콜라주 액자를 만들어봅니다)' || char(10) ||'엄마: 우와 oo아 정말 멋진 액자가 만들어졌네~ 우리 oo이 방에 걸어 놓아볼까?' || char(10) ||'아이: 네~ 좋아요' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'글루건 사용은 화상의 위험이 있으니 엄마가 도와주세요' || char(10) ||'' || char(10) ||'[돌멩이 콜라주 액자 만들기]' || char(10) ||'1. 도화지 위에 과일이나 커피 포장지 뚜껑을 올려놓고 테두리를 그려봅니다.' || char(10) ||'2. 아이가 채집해온 돌멩이를 글루건을 이용해 도화지 위에 고정시켜봅니다.' || char(10) ||'(글루건을 사용할 때에는 화상에 유의하도록 엄마가 도와주세요)' || char(10) ||'3. 매직으로 아이가 그리고 싶은 그림을 그려볼 수 있도록 합니다.' || char(10) ||'4. 색종이나 잡지를 이용하여 돌멩이 주변에 완성하고 싶은 그림을 완성해봅니다.' || char(10) ||'5. 1번에서 그렸던 두리 위에 양면테이프를 둘러봅니다.' || char(10) ||'6. 이제 일회용 포장지 뚜껑을 올리고 고정시키면 액자 완성~!!', '돌멩이, 매직, 글루건, 양면테이프, 색종이, 색도화지, 일회용 포장지 뚜껑', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('종이컵 시계 만들기', '음료수를 먹고 남은 종이컵 이제 버리지 마세요~! 가위로 모양만 내면 멋진 손목시계로 변신할 수 있어요.' || char(10) ||'시간 개념을 익히는 아이에게 종이컵 시계 만들기 놀이는 즐거운 만들기 놀이가 될 거예요. 시계에 수를 채워가며 자연스레 시간 순서를 익히고 시계의 중요성도 인지하게 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 종이컵으로 만들 수 있는 것들에 대해 상상하고 이야기 나누기를 해봅니다.' || char(10) ||'2. 어떤 것을 만들지 정하고 필요한 준비물을 구성해봅니다.' || char(10) ||'3. 아이와 함께 종이컵 시계를 만들어봅니다.' || char(10) ||'4. 완성한 종이컵 시계를 착용해보고 아이에게 격려해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아 우리가 음료수를 마신 종이컵으로 멋진 시계를 만들어보지 않을래?' || char(10) ||'엄마: 종이컵 동그란 밑부분이 시계가 되고 여기 컵 기둥 부분을 길게 자르면 팔찌 부분이 되어 멋진 손목시계를 만들 수 있단다.' || char(10) ||'엄마: 그래 좋은 생각이야~ 우선 가위로 시계 모양으로 잘라볼까?' || char(10) ||'엄마: 시계에는 무엇이 필요할까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[종이컵 시계 만들기]' || char(10) ||'1. 먹고 남은 종이컵을 깨끗하게 씻어 말려봅니다.' || char(10) ||'2. 종이컵 양옆을 마주보게 하고 알맞은 굵기로 잘라봅니다.' || char(10) ||'3. 종이컵이 손목시계 모양으로 변신~! 이제 잘라버리고 남은 종이컵으로 시계추를 두 개 만들어봅니다.' || char(10) ||'4. 아이가 좋아하는 색깔의 매직을 골라서 숫자를 써보며 시간을 채워 넣어 봅니다.' || char(10) ||'5. 시계추를 겹쳐 펀치로 구멍을 뚫고, 종이컵 시계에 할핀으로 고정해 봅니다.' || char(10) ||'6. 시계 뒷면에 할핀을 마무리하고 테이프로 붙여봅니다.' || char(10) ||'7. 아이의 손목 크기에 알맞게 벨크로를 붙이면 시계 완성~!!' || char(10) ||'', '종이컵, 가위, 매직, 테이프, 할핀, 펀치, 벨크로', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('카네이션 카드 만들어요', '아이와 함께 감사의 마음을 전하는 카네이션 카드를 만들어보세요. 카드를 만들면서 아이는 소근육 조절능력을 발달시키고 감사하는 마음을 알게되는 아이로 성장할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 함께 고마운 사람들에 대해 이야기를 나눠봅니다.' || char(10) ||'(고마운 할머니, 아빠, 엄마, 담임 선생님 등 이야기를 나눕니다)' || char(10) ||'2. 고마운 마음을 전하는 방법으로 카네이션 카드 만들기에 대해 이야기해봅니다.' || char(10) ||'3. 카네이션 카드를 아이와 함께 만들어봅니다.' || char(10) ||'4. 카드를 완성후에 아이가 직접 전달해 볼 수 있도록 격려해줍니다' || char(47) ||'' || char(10) ||'[카네이션 카드 만들기]' || char(10) ||'1. 빨간색 한지를 적절한 크기로 일정하게 잘라서 부채접기를 해봅니다.' || char(10) ||'2. 한지의 끝을 동그랗게 가위로 다듬어주세요.' || char(10) ||'3. 1번에서 자른 한지의 크기보다 작게 잘라서 똑같이 부채접기를 한 후, 가위로 다듬어 봅니다..' || char(10) ||'4. 큰 한지 위에 작은 한지를 포개고 부채접기를 합니다.' || char(10) ||'5. 고무줄로 가운데를 고정시켜봅니다.' || char(10) ||'6. 리본 모양으로 고정된 한지를 한장 씩 위로 펼쳐봅니다.' || char(10) ||'7. 색지를 만들고 싶은 카드의 모양으로 재단해봅니다.' || char(10) ||'8. 색지 위에 카네이션을 붙이고 리본으로 장식해봅니다.' || char(10) ||'9. 카네이션 카드 만들기 완성~!!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아 스승의 날은 무슨날인지 우리 oo이가 알고 있니?' || char(10) ||'아이: 스승의 날이 뭐예요?' || char(10) ||'엄마: 응~ 선생님한테 고마운 마음을 전달하는 날이란다. 우리 oo이는 선생님의 어떤 점이 좋니?' || char(10) ||'아이: 음.. 저를 맨날 안아주시구요, 재미있는 동화책도 많이 읽어주세요' || char(10) ||'엄마: 그래~ 우리 oo이가 선생님한테 고마운 마음이 많겠구나. 그럼 우리 oo이가 ''선생님 고맙습니다''하고 편지를 써보는 것도 너무 좋겠구나' || char(10) ||'아이: 네~ 좋아요' || char(10) ||'엄마: 엄마랑 카네이션 카드를 만들어볼까?' || char(10) ||'아이: 네~~!!!' || char(10) ||'', '빨간색 한지, 가위, 자, 고무줄, 색지, 양면테이프', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('종이 고리 만들기', '종이로 고리를 만들어 연결해보는 놀이를 해보세요. 색지로 고리를 만들어 연결하고 붙이는 과정을 통해 소근육이 발달되고 일정한 규칙으로 연결하며 패턴과 수 개념을 습득할 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 색지를 길게 자릅니다.' || char(10) ||'2. 색지의 양 끝을 붙여 하나의 고리를 만듭니다.' || char(10) ||'3. 하나의 고리에 색지 고리를 하나씩 연결해서 붙여 나갑니다.' || char(10) ||'4. 아이와 고리를 일정한 패턴으로 연결하며 놀이합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아, 엄마랑 색지로 멋진 고리를 만들어볼까?' || char(10) ||'아이: 어떻게요?' || char(10) ||'엄마: 이렇게 색지를 구부려서 풀로 붙이는거야~ 해볼 수 있겠니?' || char(10) ||'아이: 네!' || char(10) ||'엄마: (oo이가 붙이고 난 뒤) 우와~ oo이가 고리를 길게 연결했구나.' || char(10) ||'엄마: 엄마는 빨간색, 초록색, 빨간색, 초록색 이렇게 번갈아 가며 색 고리를 만들었단다~ oo이도 한 번 해볼까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'3-5세: 아이들이 스스로 풀칠해서 동그랗게 붙이는 활동을 위주로 진행해주세요.' || char(10) ||'6-7세 - 패턴을 스스로 만들어보도록 해 보세요!' || char(10) ||'', '양면 색지, 가위, 풀', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('아이방 별자리 관측소', '아이의 방을 별자리 관측소로 만들어주세요. 종이컵으로 별을 관찰하며 상상려고가 사고력이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 종이컵 바닥에 별 모양으로 구멍을 뚫습니다.' || char(10) ||'2. 종이컵 투입구 부분을 손전등과 붙여사 관측 도구를 만듭니다.' || char(10) ||'3. 까만 천에 아이와 별 모양 스티커와 야광별 스티커를 많이 붙입니다.' || char(10) ||'- 스티커로 모양을 만들어 붙여도 좋습니다.' || char(10) ||'4. 작은방의 벽 한쪽에 완성한 까만 천을 붙여줍니다.' || char(10) ||'5. 날이 어두워지면 방에 불을 꺼놓고 아이와 별자리를 관측합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: (까만천을 붙인 뒤) oo아, 이제 불을 꺼볼까? 어떤 모양이 나타나는지 관찰해보자~' || char(10) ||'아이: 네!' || char(10) ||'엄마: (불을 끄며) 하나, 둘, 셋!' || char(10) ||'아이: 우와~ 반짝 반짝거려요!' || char(10) ||'엄마: 야광별을 붙였더니 정말 반짝거리네, 이번에는 손전등을 켜서 관찰해볼까?' || char(10) ||'아이: (손전등을 켠 뒤) 우와~ 색깔별이다!' || char(10) ||'엄마: (손가락으로 별자리를 가리키며) 우리 oo이가 붙인 기다린 별자리도 보이는구나~' || char(10) ||'', '별모양 스티커, 야광별 스티커, 종이컵, 손전등, 까만천이나 전지 여러장', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('과일 야채 동물 만들기', '다양한 식재료를 이용해 다양한 동물도 만들고, 동물농장도 만들어봅시다. 아이의 사고력도 키우고 식재료를 경험하며 식습관도 개선할 수 있는 일석 이조의 놀이체험이 될 거예요.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'칼을 쓸 때에는 조심해야 해요.' || char(10) ||'꼬지가 끝이 날카로우니 힘을 주다 찔리지 않도록 유의해서 사용해요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 야채와 과일들을 미리 씻어 손질해둡니다.' || char(10) ||'2. 아이가 한 손으로 잡기에 적절한 크기로 미리 잘라놓는 것이 좋아요.' || char(10) ||'3. 꼬지와 이쑤시개들을 함께 주어 다양하게 꽂아보도록 합시다.' || char(10) ||'4. 당근 몸통에 길쭉한 사과를 꽂아 토끼를 만들기도 하고, 감자에 이쑤시개만 많이 꽂아 고슴도치도 만들어봅시다.' || char(10) ||'5. 몸통을 다 만든 후에 통후추로 눈을 표현하면 완성! 아이가 어떤 모양이든 자유롭게 표현하도록 유도해보세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이의 연령이 어릴수록 자르는 건 부모님이 해 주세요.' || char(10) ||'2. 식재료를 직접 관찰하고 오랜시간 탐색하도록 해 주세요.' || char(10) ||'3. 직접 먹어봐도 좋겠죠?' || char(10) ||'4. 이건 무슨 모양일까? 이건 무슨 맛일까? 하며 사이사이에 질문도 해 보고 이야기도 많이 나누어보세요.' || char(10) ||'', '오이, 당근, 사과 등 딱딱한 과일과 야채들, 이쑤시개, 산적꼬지, 통후추, 칼', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('달걀꼬꼬닭 만들기', '식재료로 만들기를 하는 것은 아이의 감각을 자극합니다. 식습관 개선에도 도움이 될 거예요!' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'칼을 쓸 때는 위험하니, 날이 무딘 빵칼을 준비하면 좋아요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'방법 1)' || char(10) ||'a. 달걀을 삶아서 흰자만 나오게 자릅니다.' || char(10) ||'b. 깨 두개를 붙여 눈을 만듭니다.' || char(10) ||'c. 당근을 작은 세모 모양으로 조각내고 부리와 벼슬을 만들어줍니다.' || char(10) ||'d. 노른자가 나오도록 단면을 자르고 깨와 당근으로 눈과 입을 만들어주면 병아리도 만들 수 있어요.' || char(10) ||'방법 2)' || char(10) ||'a. 달걀을 삶아서 아랫부분을 조금만 잘라 세우기 좋도록 만듭니다.' || char(10) ||'b. 깨 두개를 붙여 눈을 만듭니다.' || char(10) ||'c. 당근을 작은 세모 모양으로 3개를 자르고, 윗 부분에 꽂아 벼슬을 만듭니다.' || char(10) ||'d. 당근을 잘라 꽂아서 부리도 만들어줍니다.' || char(10) ||'e. 당근을 동그랗게 잘라 양 옆에 꽂아 날개도 만들어줍니다.' || char(10) ||'f. 당근을 세모 모양으로 잘라 끝에 꽂아 꼬리도 만들어줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이의 연령이 어릴수록 자르는 건 부모님이 해 주세요.' || char(10) ||'2. 식재료를 직접 관찰하고 오랜시간 탐색하도록 해 주세요.' || char(10) ||'3. 직접 먹어봐도 좋겠죠?' || char(10) ||'4. 이건 무슨 모양일까? 이건 무슨 맛일까? 하며 사이사이에 질문도 해 보고 이야기도 많이 나누어보세요.' || char(10) ||'', '삶은 달걀, 깨 혹은 통후추, 당근, 칼, 가위', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('효자 효녀 쿠폰 만들기', '아이와 함께 효자 효녀 쿠폰을 만들어보세요. 쿠폰을 만들며 가족 유대감이 형성되고, 쿠폰을 실천해보며 자연스럽게 아이의 인성발달을 향상해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 효자 효녀 쿠폰을 보며 어떤 실천 목록들이 있는지 이야기를 나눠봅니다.' || char(10) ||'2. 아이가 언제마다 쿠폰을 사용할 것인지 아이가 잘 보이는 위치의 달력에 표시해둡니다.' || char(10) ||'3. 쿠폰을 사용하는 날, 아이가 사용하고 싶은 가족에게 쿠폰을 사용할 수 있도록 합니다.' || char(10) ||'4. 아이가 쿠폰을 사용하여 실천하면 쿠폰 뒤에 아이에게 격려의 말을 적어주고 스킨십을 해줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'효자 효녀 쿠폰 만들기' || char(10) ||'1. 색 도화지를 일정한 크기로 잘라봅니다.' || char(10) ||'2. 쿠폰 위에 아이가 실천할 수 있는 약속들을 함께 이야기하고 적어봅니다.' || char(10) ||'3. 약속 밑에는 아이가 약속을 실천하고 난 후에 격려의 말을 적어줄 수 있는 공간도 그려봅니다.' || char(10) ||'4. 쿠폰을 뒤집어서 종이테이프로 연결해주세요' || char(10) ||'5. 길게 연결된 쿠폰의 끝장을 휴지심에 고정하고 돌돌 말아주세요.' || char(10) ||'6. 이제 효자 효녀 쿠폰 완성~!' || char(10) ||'7. 한 장씩 떼어서 아이와 함께 실천해보세요.' || char(10) ||'', '색 도화지, 그리기 도구, 종이테이프, 가위, 휴지심', '5-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('과자집을 만들어요', '헨젤과 그레텔 같이 동화 속에서만 존재하던 과자집을 직접 만들어보세요.' || char(10) ||'엄마 아빠와 함께 작품을 만들며 상상력이 자라고, 성취감과 애착 형성에 도움을 줍니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'아이가 과자를 먹는 것에 집중해서 활동에 참여하기 어려울 수 있어요. 시작하기 전 미리 ''다 만들고 나서 먹는 거야!'' 하고 이야기해 주셔야 해요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[과자집 만들기]' || char(10) ||'1. 쟁반에 물엿을 뿌려줘요.' || char(10) ||'2. 쇼콜라토르테 2개씩 2겹을 쌓아주세요. 집의 기본 골조가 될 거예요. 사이에 물엿을 뿌려 단단히 붙여주세요.' || char(10) ||'3. 쇼콜라토르테 위에 물엿을 뿌리고 갸또를 한 층 쌓아요.' || char(10) ||'4. 나무꼬지를 세로로 꽂아 단단하게 고정해요.' || char(10) ||'5. 벽에 빠다코코넛을 붙여줘요.' || char(10) ||'6. 갸또 위에 물엿을 뿌리고 abc 초콜렛을 피라미드 모양으로 쌓아요.' || char(10) ||'7. 초콜릿 사이에 나무 꼬지를 꽂아요' || char(10) ||'8. 나무꼬지를 지지대삼아 빠다코코넛 지붕을 올려요' || char(10) ||'9. 물엿으로 튼튼하게 여기저기 고정해요' || char(10) ||'10. 바닥에 빼빼로로 길도 만들어보고, 석기시대로 자갈도 만들어봐요.' || char(10) ||'11. 완성!' || char(10) ||'집의 모양은 자유롭게 만들어도 좋답니다.' || char(10) ||'상상속의 집도 만들어보세요!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: (다양한 과자를 살펴보며) oo이는 어떤 과자집을 만들고 싶어?' || char(10) ||'아이: 음... 헨젤과 그레텔에 나오는 과자집처럼 만들래요!!' || char(10) ||'엄마: 그럼 우리 그림책을 보면서 같이 만들어볼까?' || char(10) ||'아이: 네!! 좋아요!! (그림책 속 과자집을 보며 만들어봅니다)' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'3세: 위치를 정해주고 아이가 과자를 쌓거나 놓을 수 있도록 해 주세요.' || char(10) ||'4세: 물엿을 뿌리는 역할이나, 과자를 쌓는 역할 등 일정한 역할을 하나 맡겨주세요. 다 만든 이후에 크게 칭찬해주세요.' || char(10) ||'5세: 동화책 속에 나오는 멋진 집을 그대로 만들어보자고 이야기해 보세요.' || char(10) ||'6세~: 상상 속의 집을 만들어도 재미있을 거예요!! 아이가 지시하고 엄마 아빠가 아이의 생각대로 집을 함께 만들어봐요.', '이쑤시개, 나무꼬지, 물엿, 쟁반, 과자', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('칭찬 스티커 판 만들기', '집안일을 돕거나 엄마 아빠와 약속한 행동을 했을 때 칭찬 스티커를 받습니다. 실제 용돈과 교환하며 아이는 돈의 개념과 가치에 대해 이해할 수 있게 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[칭찬 스티커 판을 만들어요]' || char(10) ||'1. 갈색 부직포에 세모를 그려 아이스크림콘 모양을 만듭니다.' || char(10) ||'2. 분홍색, 노란색, 빨간색 등 색색의 부직포를 동그랗게 오려 아이스크림 덩어리 모양을 만듭니다.' || char(10) ||'3. 덩어리 모양 뒤에 밸크로를 붙여주세요.' || char(10) ||'4. 하드보드지 판에 아이스크림콘 모양을 붙여주세요.' || char(10) ||'5. 아이스크림 덩어리가 붙을 위치에 맞춰 하드보드지 판위에 밸크로를 붙여주세요.' || char(10) ||'6. 종이를 네모나게 잘라 손 코팅지를 붙여주세요.' || char(10) ||'7. 네모 종이를 콘 모양 위에 붙여주세요.' || char(10) ||'8. 하드보드지 판 뒷면에 털실이나 끈을 붙여 매달 수 있는 고리를 만들어 주세요.' || char(10) ||'9. 완성! 하드보드지를 예쁘게 꾸며주어도 좋아요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아빠: oo이는 뭘 제일 갖고 싶어?' || char(10) ||'아이: 음... 캐릭터 카드 갖고 싶어요!' || char(10) ||'아빠: 그럼 캐릭터 카드가 1000원이니까, 스티커 하나에 100원으로 정하고, 10개를 모으면 되겠다!' || char(10) ||'아빠: 어떤 행동을 하면 스티커를 갖기로 하면 좋을까?' || char(10) ||'아이: 어떤 걸 해야 해요?' || char(10) ||'아빠: 음... 아침에 아빠 신문이랑 가방 가져다주기, 엄마를 도와 상 차리기 이런 것들이 좋겠지? 어때?' || char(10) ||'아이: 할 수 있어요!' || char(10) ||'아빠: 그럼 그것도 여기다 쓰자! (하드보드지 판 위에 써 줍니다.)' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[사용방법]' || char(10) ||'1. 아이가 목표하는 물건이나 금액이 있을 경우 네모 위에 보드마카로 적어줍니다.' || char(10) ||'2. 아이가 스티커를 받을 수 있는 행동을 하드보드지 판 위에 적어줍니다.' || char(10) ||'3. 아이가 이제 행동을 잘 완수할 때마다 아이스크림 덩어리 스티커를 하나씩 줍니다.' || char(10) ||'4. 목표한 개수만큼 다 모았을 경우 약속한 액수로 바꾸어 줍니다.' || char(10) ||'5. 바꾼 금액으로 아이가 목표한 물건을 사 봅시다.', '부직포, 밸크로, 가위, 글루건, 하드보드지, 털실 혹은 끈, 손 코팅지, 보드마카, 종이', '5-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('분 시계 만들기', '시계를 처음 보는 아이들은 분침개념을 이해하기 쉽지 않습니다.' || char(10) ||'하지만 놀이를 통해 아이는 시계의 분침 원리를 경험하고 익숙해진다면 시계를 읽는 방법에 익숙해질 수 있게 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'시계는 숫자가 1부터 12까지밖에 없어요. 60분을 알기 위해서는 아이가 분침을 읽는 방법을 따로 배워야 하지요. 숫자 옆에 따로 분을 붙여보세요. 1옆에 5, 2옆에 10, 3옆에 15, 4옆에 20 등... 분의 숫자를 따로 붙여놓고 그것을 읽는 시범을 많이 보여주세요.' || char(10) ||'[분 시계 만드는 법 1]' || char(10) ||'1. 동그라미 모양으로 종이를 12개 오려주세요.' || char(10) ||'2. 종이에 5, 10, 15, 20, 25 ... 60을 써 주세요.' || char(10) ||'3. 시계의 1, 2, 3, 4, 5 ... 12 옆에 해당하는 분을 찾아 붙여주세요.' || char(10) ||'4. 1 옆에는 5, 2 옆에는 10, 3 옆에는 15... 다 붙였나요?' || char(10) ||'5. 분 시계 완성!' || char(10) ||'[분 시계 만드는 법 2]' || char(10) ||'준비물: 까만색 폼보드, 노란 색지1, 연노란 색지1, 손코팅지 2, 양면테이프, 가위, 색테이프' || char(10) ||'1. 노란색지를 원 모양으로 자릅니다.' || char(10) ||'2. 연노란 색지를 작은 원 모양으로 자릅니다.' || char(10) ||'3. 두 원에 손코팅지를 붙여주세요.' || char(10) ||'4. 손코팅지를 원 모양에 맞게 가위로 잘라 매끄럽게 다듬어 주세요.' || char(10) ||'5. 까만 폼보드 - 큰 원 - 작은 원 순으로 붙여주세요.' || char(10) ||'6. 테이프로 3, 6, 9, 12 자리를 표시해주면 완성!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아 지금 몇 시 일까? 시계 좀 볼까? 이 바늘 중 짧은 건 어디에 있어?' || char(10) ||'아이: 여기! 5!' || char(10) ||'엄마: 그렇구나~ 긴 바늘은 어디에 있니?' || char(10) ||'아이: 음... 2에 있어요~' || char(10) ||'엄마: 그러면 짧은 바늘이 ''시''니까 5시이고... 긴 바늘이 분이니까 (손으로 10을 가리키며) 10분이네! 5시 10분이야~' || char(10) ||'', '시침과분침이 있는 시계, 종이, 펜, 가위, 테이프', '4-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('할 일 주사위 놀이', '내가 할 수 있는 일을 성공했을 때 아이들은 큰 성취감을 얻습니다. 더불어 자율성과 독립심도 향상되지요. 아이가 성공경험을 많이 겪을 수 있도록 자주 이 놀이를 해 보세요.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'큰 주사위에 할 일을 그림으로 표시해주면 어린 아이들도 할 수 있어요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'할 수 있는 일을 적어 주사위를 만들고, 굴리며 놀이해 보세요. 데구르르 굴러가는 주사위가 알려주는 할 일을 찾아 해 봅시다. 성취감도 얻고 자신감도 쑥쑥 자랄거예요.' || char(10) ||'1. 주사위 면 사이즈에 맞게 종이를 자릅니다.' || char(10) ||'2. 종이를 각 주사위 면에 붙여주세요.' || char(10) ||'3. 아이가 할 수 있는 일, 잘하는 일을 그림으로 그려보세요.' || char(10) ||'4. 완성! 주사위를 굴려봅시다. 주사위에 나타난 놀이를 아이가 해 보는 거예요.' || char(10) ||'5. 성공하면 크게 칭찬해주고, 실패했을 경우에 아이가 다시 도전할 수 있도록 응원을 열심히 해 주세요.' || char(10) ||'[직접 만들어 쓰세요!: 감정 주사위 만들기]' || char(10) ||'준비물: 우유곽, 테이프, 색지, 색칠도구' || char(10) ||'1. 우유를 다 먹고 깨끗이 씻어 말려주세요.' || char(10) ||'2. 테이프로 우유곽의 윗부분을 접어서 주사위 모양이 되도록 붙여주세요.' || char(10) ||'3. 겉면을 색지로 쌉니다.' || char(10) ||'4. 겉면에 아이가 할 수 있는 일들을 그려주세요.' || char(10) ||'5. 완성! 이제 같이 굴리며 놀이해봅시다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 여기 엄마가 주사위를 가져왔어. 우리 이 주사위로 놀이해볼까?' || char(10) ||'아이: 네!' || char(10) ||'엄마: 어? 그런데 이 주사위는 다른 주사위랑 좀 다른데?' || char(10) ||'아이: 어, 옷 그림이 그려져있네?' || char(10) ||'엄마: 그치? 점이 찍힌게 아니고 그림이 그려져있지! 우리 주사위를 굴려보고, 여기 할 일을 해 보자. 어떤 일들이 있나 볼까?' || char(10) ||'아이: 음... 이거는... 옷이구, 이거는 밥먹는거구...' || char(10) ||'엄마: 응. 옷을 혼자 벗는거랑, 밥을 혼자 먹는 것도 있네! 우리 oo이가 다 잘하는 것들이네 이제 같이 놀이해볼까?' || char(10) ||'', '주사위, 종이, 색칠도구', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('꽃팔찌 만들기', '꽃을 이용하여 예쁜 팔찌를 만들어봅시다. 자연에 대해 더 친숙하게 느낄 수 있는 기회가 되지요.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'어린 아이들에게는 끼우는 게 어려울 수도 있어요!!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'꽃으로 예쁜 팔찌를 만들어봅시다. 길가에 흔하게 볼 수 있던 작은 꽃들이 세상에 하나뿐인 팔찌가 될 거예요.' || char(10) ||'1. 꽃송이 바로 밑 꽃대 가운데에 손톱으로 구멍을 내요.' || char(10) ||'2. 갈라진 틈 사이에 다른 꽃대 하나를 끼워주세요.' || char(10) ||'3. 손목에 2를 두르고 묶습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: (준비한 꽃을 아이에게 보여주며) oo아!! 여기에 어떤 꽃들이 있니?' || char(10) ||'엄마: 우리 민들레 꽃으로 팔찌를 만들어볼까?' || char(10) ||'엄마: (완성한 팔찌를 팔에 두르며) 우와!! 민들레 꽃팔찌가 정말 예쁘네!!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'6, 7세 - 여러 개를 연결하면 화관도 만들 수 있어요. 따라할 수 있는 아이들은 더 어려운 만들기도 도전해보세요!', '꽃 두송이', '4-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('돌멩이 그림 그리기', '종이가 아닌 돌멩이에 그림을 그려보세요. 울퉁불퉁한 돌멩이에 그림을 그리며 다양한 질감을 느끼며 감각이 발달합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이와 함께 돌멩이를 찾아옵니다.' || char(10) ||'2. 돌멩이를 씻어서 말립니다.' || char(10) ||'3. 돌의 표면에 여러 가지 도구들로 그림을 그려봅니다.' || char(10) ||'4. 그림을 그릴 때 어떤 느낌인지 이야기를 나눕니다.' || char(10) ||'5. 다 그린 그림을 말린 후 전시합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아. 우리 오늘 돌멩이에 그림을 그려 볼까?' || char(10) ||'엄마: 돌멩이 위에 어떤 그림을 그려보고 싶어?' || char(10) ||'엄마: 어떤 색깔 물감으로 칠해 주고 싶니?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'# 오래 유지하고 싶다면 투명한 매니큐어를 발라주세요.' || char(10) ||'# 여러 돌멩이를 모아놓고 그 위에 하나의 그림을 그려보세요. 이후에 퍼즐처럼 맞추기 놀이를 할 수 있습니다.', '돌멩이, 그리기 도구', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('마시멜로 탑 쌓기 놀이', '마시멜로와 스파게티 면으로 간단하지만 재미있는 탑 쌓기 놀이를 해 보세요. 식재료를 활용하면 놀이 중 직접 먹어볼 수도 있고, 기존 용도와 다른 활용법을 탐색해보는 등 다각도로 활용할 수 있지요. 탑을 쌓아 올리면서 아이의 공간지각력도 함께 발달할 거예요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 마시멜로에 스파게티 면을 꽂아요.' || char(10) ||'2. 반대편에도 마시멜로를 꽂아요.' || char(10) ||'3. 차례대로 꽂아서 네모를 만들어요.' || char(10) ||'4. 이제 각 마시멜로에 세로로 스파게티 면을 꽂아요.' || char(10) ||'5. 마시멜로에 스파게티 면을 계속 꽂다 보면 주사위 모양도 만들 수 있을 거예요.' || char(10) ||'6. 점점 더 높이 꽂아서 쌓아보세요! 최대한 높이 쌓아 올리면 재미있답니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아 여기 달콤한 냄새가 나는구나! 이게 뭘까?' || char(10) ||'엄마: 이 마시멜로와 스파게티 면으로 어떻게 탑을 만들어 볼 수 있을까?' || char(10) ||'엄마: 자~ 기다란 스파게티 면을 마시멜로에 꽂고~~ 이렇게 하면 짠~~ 막대기 모양이 되었지?' || char(10) ||'엄마: 이제 계속 스파게티 면을 꽂고 연결해보면 된단다.' || char(10) ||'엄마: 어떤 모양의 탑이 되었니?' || char(10) ||'엄마: 이번에는 어떤 탑을 만들어 보고 싶니? oo이 생각대로 하려면 어떻게 해야 할까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'# 4, 5세: 아이가 알고 있는 모양을 이야기해주고 그 모양을 만들어보아도 재미있어요.' || char(10) ||'# 6세 이상: 마시멜로 개수는 제한해주고, 스파게티 면은 제한 없이 제공해주세요. 최대한 높이 쌓기 경쟁을 해도 재미있어요.', '마시멜로, 스파게티면', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('투호 놀이', '신문지를 활용하여 투호를 만들어보세요. 온 가족이 함께하는 투호 놀이는 아이들의 신체조절 능력과 친 사회성 발달에 도움이 됩니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 가족끼리 팀을 나누어 봅니다.' || char(10) ||'2. 투호를 던지는 선을 정해봅니다.' || char(10) ||'3. 적절한 위치에 빈 휴지통을 배치해봅니다' || char(10) ||'4. 가족들이 순서대로 투호를 던져봅니다.' || char(10) ||'5. 가장 많은 수의 투호를 던진 가족 구성원이 승리하는 놀이입니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 자. 우리가 만든 투호로 놀이해 볼까?' || char(10) ||'엄마: 편은 어떻게 나누어 볼까?' || char(10) ||'엄마: 던지는 선은 어떻게 표시할까?' || char(10) ||'엄마: 순서는 어떻게 정해볼까?' || char(10) ||'엄마: 자~ 그러면 순서대로 투호놀이 시작!' || char(10) ||'엄마: 엄마 팀은 합쳐서 몇 개를 성공했는지 세어볼까?' || char(10) ||'엄마: 아빠 팀은 몇 개를 던졌니?' || char(10) ||'엄마: 어느 편의 투호가 더 많을까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'''투호'' 이렇게 만들어요~!' || char(10) ||'1. 신문지를 펼치고 한쪽 면의 끝을 가위로 5cm 정도 잘라주세요.' || char(10) ||'2. 자른 신문지를 돌돌 말아주세요.' || char(10) ||'3. 돌돌 말린 신문지를 테이프로 고정해주세요.' || char(10) ||'4. 투호 끝부분을 제기 모양처럼 쭉쭉 펴주세요.' || char(10) ||'5. 말아놓은 신문지 위에 색깔 테이프를 붙이면 더욱 예쁜 모양이 나옵니다.', '신문지, 가위, 투명 테이프, 색 테이프, 빈 휴지통', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('알록달록 상자 집 만들기', '폐상자를 이용한 상자 집을 만들어보세요. 가족들과 함께 역할을 나누어 집을 만들며 협동력과 창의력을 기를 수 있습니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 지붕이 되는 부분(박스 윗부분)의 마주 보는 두 개의 면을 커트 칼로 제거합니다.' || char(10) ||'2. 문과 창문이 될 부분은 펜으로 그려서 자리를 잡은 후 커트 칼로 도려내주세요.' || char(10) ||'3. (1)번에서 잘라냈던 2개의 면을 지붕이 되는 면에 이어붙여 주세요.' || char(10) ||'4. 해체되어있던 상자 집의 모양을 잡아주고 테이프로 바닥과 지붕을 고정시켜주세요.' || char(10) ||'5. 아이와 역할을 나누어 한지와 색종이를 자유롭게 붙입니다.' || char(10) ||'6. 완성된 집에 우리 가족의 이름을 써보고 잘 보이는 곳에 전시합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 이 상자로 어떤 것들을 만들 수 있을까?' || char(10) ||'아이: 집을 만들고 싶어요!' || char(10) ||'엄마: 좋은 생각이야! 여기 색종이와 한지를 붙여서 집을 꾸며보자' || char(10) ||'엄마: 엄마가 칼로 문이랑 창문을 뚫어 줄게. 자~ 집 모양이 되었네. 어떤 것들로 꾸며줄까?' || char(10) ||'아빠: (집을 완성하면) oo아 상자집이 모두 완성되었네. 우리 가족 이름을 써볼까?' || char(10) ||'아이: 네!', '폐품 박스, 투명 테이프, 그리기 도구(매직, 크레파스), 한지, 밀가루 풀, 이로히용 접시', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('알록달록 팽이 놀이', '색깔 팽이 놀이를 해보세요. 팽이를 움직이며 아이의 대, 소근육 발달을 증진시켜주고 변화하는 색깔을 관찰하며 관찰력과 탐구력을 키워줍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이에게 팽이 만들기 재료를 보여주고 탐색해봅니다.' || char(10) ||'2. 팽이 만들기 순서에 따라 팽이를 만들어봅니다.' || char(10) ||'3. 팽이가 완성되면 완성된 팽이를 돌려보며 놀이합니다.' || char(10) ||'- 팽이가 돌아가며 어떤 색깔과 모양으로 보이는지 이야기를 나눠도 좋아요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 오늘 엄마랑 상자로 팽이를 만들어볼까?' || char(10) ||'엄마: oo이는 어떤 색깔들로 팽이를 만들고 싶어?' || char(10) ||'엄마: 팽이를 다 만들었으면 돌려볼까?' || char(10) ||'엄마: 와~ 빨강색이랑 파랑색으로 꾸민 팽이를 돌리니 어떤 색이 보이니?' || char(10) ||'엄마: 또 어떤 색깔들로 팽이를 만들어볼까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'''색깔 팽이'' 이렇게 만들어요!' || char(10) ||'1. 상자 조각 위에 동그라미를 그려봅니다.' || char(10) ||'2. 상자 조각을 잘라내고 같은 크기로 도화지 위에 동그라미를 그려봅니다.' || char(10) ||'3. 도화지를 자르고 상자 조각에 붙여봅니다.' || char(10) ||'4. 색채 도구로 도화지 위를 꾸며봅니다.' || char(10) ||'5. 팽이 가운데 부분은 송곳으로 구멍을 뚫어봅니다.' || char(10) ||'6. 이쑤시개를 구멍을 뚫은 부분에 넣어봅니다.' || char(10) ||'7. 색깔 팽이 완성~!', '상자 조각(코르크판), 도화지, 가위, 펜, 양면테이프, 그리기 도구, 이쑤시개, 송곳', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('사탕 나비 만들기', '아이가 좋아하는 사탕으로 나비를 만들어보세요. 아이가 나비 사탕을 만드는 과정을 통해 소근육이 발달하며, 눈과 손의 협응력을 기를 수 있습니다' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 색지를 반으로 접었다 펴 주세요.' || char(10) ||'2. 접은 선을 기준으로 나비 날개 모양을 그려주세요.' || char(10) ||'3. 날개를 가위로 오려주세요.' || char(10) ||'4. 날개 가운데의 접은 선에 막대사탕을 꽂을 홈을 파 주세요.' || char(10) ||'5. 날개에 스티커를 붙여 꾸며 주세요.' || char(10) ||'6. 홈에 사탕을 끼운 뒤 테이프로 고정시켜 주세요.' || char(10) ||'7. 완성! 좋아하는 사람에게 선물해봐요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'2세: 아이가 직접 스티커를 붙이도록 해주세요. 아이가 스티커 떼기를 어려워 한다면 도움을 주어 붙일 수 있도록 해주세요.' || char(10) ||'3세: 아이가 알고 있는 색 이름을 말해주고, 아이가 스티커에서 찾을 수 있도록 해주세요.' || char(10) ||'4세: 아이와 사탕나비를 선물할 사람을 정하고 대화를 나누어 보세요. 누구에게 선물할 지, 무슨 말을 할 지 연습도 해 보세요.' || char(10) ||'5세: 선물할 사람에게 편지도 써 보세요. 큰 사탕을 사용하여 날개를 크게 만들면 날개가 편지지가 될 수 있어요.' || char(10) ||'6세: 나비 뿐 아니라 새, 꽃 등 사탕을 이용한 다양한 작품을 만들어보세요.', '막대사탕, 색지, 스티커, 가위, 연필, 칼, 테이프', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('가나다 글자 쓰기 놀이', '자음과 모음이 만나 어떻게 글자가 되는지, 받침 없는 글자의 형태를 이해할 수 있어요. 한글과 이제 막 친숙해지는 아이에게 좋답니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 검은색 폼 보드와 종이들을 치수에 맞게 잘라주세요.' || char(10) ||'폼 보드: 21*14.5' || char(10) ||'빨간색 색치: 6*6 1개 ' || char(47) ||' 5*5 14개' || char(10) ||'주황색 색치: 6*6 1개 ' || char(47) ||' 5*5 10개' || char(10) ||'흰색 색지: 4.5*4.5 24개' || char(10) ||'노란색 색지: 12.5*12.5' || char(10) ||'연노란색 색지: 11.5*11.5' || char(10) ||'2. 오린 흰 종이를 5*5 크기의 빨간색, 주황색 색지에 붙여주세요.' || char(10) ||'3. 빨간 색지에 자음을, 주황 색지에 모음을 써 주세요.' || char(10) ||'4. 노란 색지에 연노란색 색지를 붙여주세요.' || char(10) ||'5. 노란 색지 윗부분에 손 코팅지를 붙여주세요' || char(10) ||'tip) 테이프로 옆부분을 붙여주면 더욱 튼튼해요' || char(10) ||'6. 판에 배치하고 붙여주세요' || char(10) ||'7. 완성! 자 이제 글씨를 써 볼까요?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'2, 3세: 글자 대신 모양을 그려서 만들어주세요.(아직 한글 공부는 조금 이르니깐요!)' || char(10) ||'4세: 아이가 알고 있는 색이나 모양을 자음 모음 대신 써 보세요.' || char(10) ||'5, 6세 이상: 아이의 쓰기 능력에 따라 칸을 더 키워서 만들어도 좋아요. 받침단어를 이해하는 아이라면 받침까지 만들어 보세요!' || char(10) ||'아이가 스스로 쓰고 놀 수 있도록 한글 쓰기 장난감을 만들어 주세요.', '도화지(검정, 빨강, 주황, 노랑, 연노랑, 하얀색), 검은색 매직, 자, 칼, 가위, 양면테이프, 보드마카, 손 코팅지, 검은색 폼 보드', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('숫자 고무줄 놀이', '수를 이제 막 시작하는 아이들이 재미있게 수르 배울 수 있도록 도와줍니다. 수의 순서를 알기에 좋은 놀이예요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[숫자 고무줄 놀이판 만들기]' || char(10) ||'1. 펠트지에 숫자를 그려주세요.' || char(10) ||'2. 그린 숫자를 오려주세요.' || char(10) ||'3. 코르크판에 숫자를 붙여주세요.' || char(10) ||'4. 숫자 옆에 압정을 꽂고, 접착제에 더욱 튼튼하게 붙여주세요.' || char(10) ||'5. 완성! 이제 고무줄을 끼우며 놀이해볼까요?' || char(10) ||'엄마 아빠가 이야기하는 수를 아이가 찾아보고, 수끼리 고무줄로 이어보세요. 엄마 아빠가 이야기하는 두가지 수를 서로 고무줄로 연결해도 재미있고, 1부터 10까지 수를 순서대로 연결해보는 것도 재미있어요. 수를 이제 막 시작하는 아이들과 함께 할 수 있는 놀이예요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아. 여기에 무엇이 있니?' || char(10) ||'엄마: 숫자로 뭐라고 쓰여 있니?' || char(10) ||'엄마: 1에는 고무줄을 몇 개를 걸어야 할까?' || char(10) ||'엄마: 2에는 몇 개를 걸어야 할까?' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'2, 3, 4세: 아직 너무 어려워요! 자유롭게 만지고 놀게 해주세요~' || char(10) ||'5, 6세 이상: 5세 아이에게는 조금 어려울 수 있어요. 도전 과제로 좋지요.' || char(10) ||'6~7세 아이에게 딱 적당한 수준이랍니다. 아이가 알고 있는 수만 활용해서 진행하세요. 엄마 아빠가 두 가지 혹은 세 가지 수를 고르고, 그 수를 고무줄로 서로 이어보세요. 순서대로 고무줄을 연결도 해보세요. 소근육 발달에 좋은 재미난 수 놀이랍니다.', '고무줄, 압정, 코르크판, 부착식 펠트지, 가위, 연필, 접착제', '4-6세', now(), now(), FALSE, 3, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('크리스마스 산타편지 만들기', '아이들과 함께 만들어 손가락에 끼우고 역할 놀이를 할 수 있어요. 편지에 감사 인사를 적어도 좋고, 크리스마스 전에 놀이한다면 갖고싶은 선물을 적어도 좋아요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[크리스마스 산타카드 만들기]' || char(10) ||'1. 빨간색 종이로 몸통이 될 원뿔을 만들고 테이프로 고정한다.' || char(10) ||'2. 살색 종이로 얼굴이 될 원을 오려 몸통에 붙인다.' || char(10) ||'3. 흰색 종이로 수염을 만들어 풀로 붙인다.' || char(10) ||'4. 모자를 만들어 얼굴 윗 부분에 붙여 준다.' || char(10) ||'5. 빨간 색지로 동그라미를 오려서 코를 만들어 붙이고, 펜으로 눈과 입을 그려준다.' || char(10) ||'6. 빨간 종이로 선물꾸러미를 만들고 꾸러미 위에 편지를 쓴다.' || char(10) ||'7. 선물 꾸러미를 몸통에 붙여주면 산타 편지지 완성!' || char(10) ||'메모지에 소원이나 갖고 싶은 선물을 써서 붙여보세요. 서로에게 편지를 써 주어도 좋아요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'4세: 갖고 싶은 선물, 소원 등을 메모지에 쓰도록 해 주세요.' || char(10) ||'5세 이상: 가족, 친구들에게 편지를 써 보도록 해 주세요.', '빨간색 종이, 살색 종이, 흰색 종이, 검정 펜, 양면 테이프, 풀, 가위', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('옷걸이 트리카드', '크리스마스는 특별한 시간이지요. 연말이 다가온 만큼, 한해를 되돌아보며 우리아이게에 마음을 담은 편지를 써보는게 어떨까요? 그냥 편지도 좋지만 아이와 만들기를 하고, 거기에 엄마 편지를 넣어주세요! 아이와 즐거운 만들기도 하고, 마음도 전하고, 집도 예쁘게 꾸미고. 일석삼조랍니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[옷걸이 트리 만들어요]' || char(10) ||'1. 옷걸이를 트리 모양으로 휘어준다.' || char(10) ||'2. 옷걸이를 마스킹테이프로 감싸준다.' || char(10) ||'3. 트리 편지지와 실을 연결한다.' || char(10) ||'4. 편지지의 실을 옷걸이 윗부분에 묶어 붙여준다' || char(10) ||'5. 옷걸이 윗부분과 아랫부분에 리본을 맨다. 완성!' || char(10) ||'[트리 편지지 만들기]' || char(10) ||'1. 초록색 종이를 나무 모양으로 두 장 잘라준다.' || char(10) ||'2. 한장은 위에서부터, 한 장은 아래서부터 절반까지 잘라준다.' || char(10) ||'3. 자른 부분을 서로 끼워 트리를 만든다.' || char(10) ||'4. 이음새를 테이프로 붙여 고정해준다.' || char(10) ||'5. 트리에 편지를 쓴다.' || char(10) ||'6. 완성!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1) 좋아하는 사람에게 편지를 써 봅시다. 엄마가 우리 아이에게 마음을 담은 편지를 써주어도 좋지요! 이제 많이 큰 우리아이에게 마음을 전할 수 있는 특별한 편지가 될 거예요.' || char(10) ||'2) 편지 대신 받고 싶은 선물을 써서 양말 대신 걸어 놓아도 좋아요' || char(10) ||'2~3세: 아이가 엄마가 만드는 과정을 지켜볼 수 있도록 해 주세요! 신기하게 바라볼 거예요. 3세의 경우, 정말 조금 아이가 만들기에 참여해볼 수 있도록 해주세요. 맛보기로만요 :-)' || char(10) ||'만들고 나서, 아이 방에 예쁘게 걸어두세요!' || char(10) ||'4~6세: 쉽고 평이한 단어로 쓰인 엄마 아빠 크리스마스카드를 써주세요! 아이가 읽고 싶어 할거라, 한글에 대한 관심이 자라나지요' || char(10) ||'7~10세: 엄마랑 아이가 함께 만들어 보세요! 그리고 편지를 서로 쓰고 크리스마스 당일에 읽어 보면 정말 잊지 못할 추억이 될 거예요.', '트리: 옷걸이, 마스킹테이프, 실, 리본 ' || char(47) ||' 편지지: 초록생 종이, 가위, 테이프, 펜', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('걱정은 걱정인형이!', '감정에 대해 자세히 인식할 수 있게 됩니다. 걱정하는 마음, 슬픈 마음, 속상함, 화남 등 좋지 않은 기분들에 대해 자세히 알 수 있는 기회로 사용해보세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 아이가 기분 좋지 않은 일이 있나요? 그럼 먼저 대화를 해 보세요.' || char(10) ||'2. 아이와 대화한 후, 그 걱정을 모두 사라지게 해 줄 친구를 소개해주세요. 짜잔! 걱정인형이예요!' || char(10) ||'3. 쪽지에 아이의 안좋은 일을 써 보도록 해 주세요. 그림으로 그려도 되고 글로 적어도 좋아요. 아이만 알아볼 수 있는 표시를 해도 좋아요.' || char(10) ||'4. 쪽지를 접어서 걱정인형 속으로 쏙! 넣어보세요. 걱정인형이 모든 걱정거리를 와구와구 먹어버릴거예요!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 우리 oo 무슨 일 있니?' || char(10) ||'아이: 꿈에서 공룡이 쫓아왔어요.' || char(10) ||'엄마: 이런 우리 oo이 많이 무서웠겠다. 그럼 우리 걱정인형에게 이 꿈을 와구와구 먹어달라고 부탁해볼까?' || char(10) ||'아이: 응? 어떻게요?' || char(10) ||'엄마: 이 종이에 꿈을 그려서 인형한테 주면 된단다. 그럼 oo이가 이 종이에 그려줄래?' || char(10) ||'아이: 네!' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'[걱정인형 만들기]' || char(10) ||'1) 티슈케이스를 색지로 싸 주세요. 윗 부분에 투입구를 제외하고 싸야 한답니다' || char(10) ||'2) 투입구를 입이라고 생각하고, 이빨을 붙여주세요.' || char(10) ||'3) 눈, 코, 귀, 팔을 색지에 그려서 오려주세요.' || char(10) ||'4) 눈, 코, 귀, 팔을 티슈케이스에 붙여주세요.' || char(10) ||'5) 완성! 걱정을 와구와구 먹는 걱정인형이예요!' || char(10) ||'** 아이와 대화할 때 감정을 정확한 단어로 알려주는 것이 좋아요. 화가 났구나, 슬펐구나, 걱정이 되었구나, 무서웠구나 등 다양한 감정들이 있으니 아이의 감정을 정확한 단어로 지칭하여 이야기 해주세요.', '티슈케이스(혹은 상자), 색지, 양면테이프, 풀, 가위, 펜. 그 외에 자가 필요해요.', '3-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('풍선 배드민턴 해요', '집안에 있는 물건들을 가지고 아이와 신나는 신체놀이를 해보세요. 높고, 낮은 위치에 있는 풍선을 두드리기 위해 집중하며 눈과 손의 협응력을 발달하며, 신체의 다양한 움직임이 전신 근육운동을 도와주어 에너지를 발산할 수 있도록 합니다.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'스타킹을 씌우고 남은 옷걸이의 손잡이 부분을 아이가 다치지 않도록 테이프로 둘러 싸주세요.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'1. 옷걸이를 동그란 모양으로 만들고 스타킹을 씌워 라켓을 만듭니다.' || char(10) ||'2. 라켓으로 풍선을 치는 모습을 보여줍니다.' || char(10) ||'3. 아이가 관심을 가지면 라켓으로 풍선을 쳐볼 수 있도록 합니다.' || char(10) ||'4. 엄마와 함께 풍선을 주고 받으며 놀이합니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: oo아, 이 옷걸이와 스타킹, 풍선으로 어떤 놀이를 할 수 있을까?' || char(10) ||'엄마: (옷걸이에 스타킹을 씌워 라켓을 만들고) 짜잔! 배드민턴은 완성!' || char(10) ||'아이: (라켓을 손으로 만지며) 우와~ 멋지다.' || char(10) ||'엄마: (라켓으로 풍선을 치며) 이렇게 엄마가 oo이에게 풍선을 던질 테니 oo이도 한 번 해볼 수 있겠니?' || char(10) ||'아이: 응!' || char(10) ||'엄마: oo아~ 풍선이 간다 받아라!' || char(10) ||'엄마: (oo이가 풍선을 치면) 우와~ oo이가 배드민턴을 참 잘하는구나~' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'옷걸이는 조금만 힘을 줘도 원하는 모양으로 바꿀 수 있으니 다양한 도형이나 모양으로 옷걸이의 변화를 주어 놀이해보세요.', '풍선, 스타킹, 옷걸이, 테이프', '2-6세', now(), now(), FALSE, 2, 1);
INSERT INTO PLAY_INFO (PLAY_INFO_TITLE, PLAY_INFO_TEXT, PLAY_INFO_TOOLS, PLAY_INFO_RECOMMEND_AGE, CREATED_AT, UPDATED_AT, DELETED, AGE_TAG_ID, USERS_ID) VALUES ('감정 카드 만들기', '이 시기의 아이들은 아직 감정 조절에 서툽니다. 하지만 여러 감정들을 표현해보고, 감정에 대해 알고 있어야 자신의 기분이 어떤지, 어떤 감정일 때 이런 표현이 나오는지를 미리 인식하고 조절할 수 있습니다. 감정에 대해 알아야만 대인 관계에서 알게 될 타인의 감정들에 대해서도 알고 공감할수 있게 되지요. 다양한 감정에 대한 놀이를 통하여 아이가 감정을 파악하고, 감정을 스스로 알 수 있도록 해주세요.' || char(10) ||'' || char(10) ||'주의 사항' || char(10) ||'처음에는 아이가 잘 표현할 수 있는 감정들 위주로 해 주세요. 화나요, 기뻐요, 좋아요 등 쉬운 감정들부터 시작하고 그 뒤에는 놀라워요, 무서워요, 짜증나요 등 복잡하고 어려운 감정 순으로 이어지면 됩니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'아이와 함께 감정카드를 만들어 보세요. 엄마가 알려주는 감정에 맞는 표정을 신문, 잡지에서 찾아 오려 붙여봅니다. 완성된 감정카드를 보며 아이와 함꼐 감정표현언어에 대해 이야기를 할 수 있어요.' || char(10) ||'[감정 카드 만들기]' || char(10) ||'1. 틈틈히 잡지나, 신문지 등을 활용해서 여러가지 표정들을 모아둡니다. (웃는 표정, 우는 표정, 화난 표정, 찡그린 표정, 담담한 표정, 행복한 표정 등)' || char(10) ||'2. 아이와 함께 다양한 표정에 대해 이야기 나누면서 빳빳한 종이에 붙여봅니다.' || char(10) ||'3. 감정 카드 완성! 아이가 어떤 상황에서 해당 감정, 표정을 하게 되었는지 이야기 나눠보세요. 그리고 평소에 아이가 유사한 감정을 느끼는 것처럼 보일 때 카드를 보여주면서 "우리 oo이가 지금 기분이 정말 신나구나"라고 설명해주면 훨씬 더 감정에 대해 잘 이해하게 된답니다.' || char(10) ||'' || char(10) ||'놀이 방법' || char(10) ||'엄마: 엄마가 여러 표정들을 준비했어. 누가 신나는 사람일까?' || char(10) ||'아이: 음... 이 아저씨!' || char(10) ||'엄마: 그렇구나. 이 사람이 신나는 사람이구나! oo이가 신나는 아저씨 얼굴을 여기 종이에 좀 붙여줄래요?' || char(10) ||'아이: 네~ (종이에 붙여요)' || char(10) ||'엄마: 잘했네! 우리 앞으로 신난다! 하는 일이 있을 때 이 카드를 써보는거야. oo이가 신나는 카드를 만들었구나' || char(10) ||'평소 아이가 처한 다양한 상황을 감정 카드를 활용해서 이야기 나눠보세요. 아이가 자신의 마음 속에서 올라오는 감정에 대해 훨씬 더 잘 이해하게 된답니다.', '신문, 잡지에 나오는 다양한 표정의 얼굴들 자료, 종이', '3-6세', now(), now(), FALSE, 2, 1);
