INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('가정행복 도시락 · 밀키트 · 먹거리 할인', '※ 가정행복 도시락 · 밀키트 · 먹거리 할인지원 사업은 서울시 예산 지원 없이 협력사가 사회 공헌 차원에서 쿠폰 비용을 전액 부담하고 있는 사업입니다.'|| char(10) ||'※ 신청 후 ''승인대기'' 상태로 보이는 것이 정상이며, 대상자에 해당하시는 경우 시스템상 승인 없이 다음달 1일(휴일인 경우 다음날) 쿠폰을 발송해드립니다.'|| char(10) ||''|| char(10) ||'지원 내용'|| char(10) ||'① 편의점 ''CU'' : 30일 할인구독권 지급'|| char(10) ||'- 간편식사&음료 구독권(30일간 20% 할인 15회)'|| char(10) ||'- 아메리카노 구독권(30일간 25% 할인 60회)'|| char(10) ||''|| char(10) ||'② 신선 식재료 ''오아시스''(http://www.oasis.co.kr/)'|| char(10) ||': ''3/6/9만원 구매시 5천/1만/1만 5천 원 할인쿠폰'' 총 4장'|| char(10) ||'* 타 기획전 할인쿠폰 중복 적용 가능(문자 발급 쿠폰 중복 적용 불가능)'|| char(10) ||'* 오아시스마켓 배송상품 모두 사용 가능'|| char(10) ||''|| char(10) ||'③ 이유식재료 ''초록마을 초록베베''(https://www.choroc.com/)'|| char(10) ||': ''우리아이 첫 이유식 재료 쿠폰(초기 이유식 가루 9종 15% 할인)'', ''우리아이 취향 맞춤 상품 쿠폰(음료 · 주스 · 차 등 8종 15% 할인)'' 각 1장'|| char(10) ||'* 타 행사 중복적용 가능, 각 1장 지급'|| char(10) ||''|| char(10) ||'④ 신선식재료, 간편식, 냉동/냉장식품 ''#(샵)풀무원''(https://shop.pulmuone.co.kr/)'|| char(10) ||': ''3만/4만/8만 원 구매 시 6천/8천/2만원 할인쿠폰'' 각 1장, 총 3장'|| char(10) ||'* 타 쿠폰 및 이벤트와 중복사용 불가'|| char(10) ||'\⑤ 건강한 도시락, 밀키트, 식재료 ''그리팅''(https://ww.greating.co.kr/)'|| char(10) ||': ''3만/5만 원 구매 시 7천/1만2천원 할인쿠폰'' 각 1장, 총 2장'|| char(10) ||''|| char(10) ||'⑥ 밀키트 전문 ''마이셰프'' (https://mychef.kr/)'|| char(10) ||': ''2만/3만/5만 원 구매 시 3천/4.5천/7.5천원 할인쿠폰'' 각 1장, 총 3장'|| char(10) ||''|| char(10) ||'⑦ 밀키트 전문 ''프레시지''(https://heodakmarket.com/)'|| char(10) ||': ''프레시지 상품 3만 5천원/5만원 구매 시 5천/1만원 할인쿠폰'' 각 1장'|| char(10) ||' ''소상공인 상품 3만원 구매 시 5천원 할인쿠폰'' 1장, 총 3장'|| char(10) ||''|| char(10) ||'⑧ 닭가슴살 등 건강간편식 ''허닭''(http://www.heodak.com/)'|| char(10) ||': ''허닭 상품 3만 5천원/5만원 구매 시 5천/1만원 할인쿠폰'' 각 1장'|| char(10) ||' ''소상공인 상품 3만원 구매 시 5천원 할인쿠폰'' 1장, 총 3장'|| char(10) ||''|| char(10) ||'※ GS편의점은 2023년 12월 말로 협약이 종료되었습니다.'|| char(10) ||'※ 칙바이칙, 랭킹닭컴은 2024년 6월 말로 협약이 종료되었습니다.', '서울시 거주 18세 이하 자녀 1명 이상 있는 가구(조손가구 포함)'|| char(10) ||'* 자녀가 2005.6.1. 이후 출생한 경우 신청 가능'|| char(10) ||'* 부모(또는 조부모) 1명당 각각 자녀별 신청 가능', '① 편의점(CU) : 문자로 받은 쿠폰 번호를 ''포켓 CU'' 어플에 등록하여 온오프라인 주문 시 사용'|| char(10) ||'② 오아시스 : 문자로 받은 쿠폰 번호를 ''오아시스'' 어플 또는 사이트에서 등록하여 사용'|| char(10) ||'③ 초록마을 : 초록마을 회원 계정으로 자동 발급된 쿠폰 온라인에서 사용(쿠폰지급 전 회원가입 필수)'|| char(10) ||'④ #(샵)풀무원 : 문자로 받은 쿠폰 번호를 ''#풀무원'' 어플 또는 사이트에서 등록하여 온라인 주문 시 사용'|| char(10) ||'⑤ 그리팅 : 문자로 받은 쿠폰 번호를 ''그리팅''어플 또는 사이트에서 등록하여 온라인 주문 시 사용'|| char(10) ||'⑥ 마이셰프 : 문자로 받은 쿠폰 번호를 ''마이셰프'' 사이트에서 등록하여 온라인 주문 시 사용'|| char(10) ||'⑦ 프레시지 : 문자로 받은 쿠폰 번호를 ''HD마켓'' 어플 또는 사이트에서 등록하여 온라인 주문 시 사용'|| char(10) ||'⑧ 허닭 : 문자로 받은 쿠폰 번호를 ''허닭몰'' 어플 또는 사이트에서 등록하여 온라인 주문 시 사용', 'https://umppa.seoul.go.kr/hmpg/hehe/suea/difa/bzin/bzmgPageDetail.do?biz_mng_no=ADE900F46F7F47A6A7D041419540A251', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서울형 키즈카페', '어린이에게 계절변화와 상관없고, 경제적 부담없는 놀이공간을 제공하고 재미 · 안전 · 돌봄까지 책임지는 서울형 키즈카페 조성', '0~9세 아동 및 보호자', '(개인이용) 이용자가 희망하는 시간대에 온라인 예약(우리동네 키움포털, https://icare.seoul.go.kr/) 후 해당일에 시설방문이용'|| char(10) ||'(단체이용) 기관 종사자에 의해 온라인 예약 후 해당일에 시설방문이용'|| char(10) ||'※ 개인의 경우 예약인원이 정원을 초과하지 아니하였을 때는 현장접수도 가능', 'https://umppa.seoul.go.kr/hmpg/cogo/crpa/seki/bzmgPageDetail.do?biz_mng_no=6DD24707FB4941C09D10B50AF4917997', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서울키즈오케이존', '아이와 양육자가 환영받고 편하게 외식할 수 있도록 음식점 및 카페 등을 대상으로 ''서울키즈 오케이존'' 지정(대상업소들의 자율적 동참)'|| char(10) ||'지정업체는 아이를 환영하는 가게 라는 것을 알 수 있도록 식별마크 부착 및 아이의자, 아이식기 등 식사 도움용품 구비', '영유아 및 아이 동반 양육자', '서울키즈 오케이존 찾기 : 스마트서울맵을 통해 검색 후 방문', 'https://umppa.seoul.go.kr/hmpg/cogo/crou/kiok/bzmgPageDetail.do?biz_mng_no=99341E4FE02244FFA897EF1BF7678DD1', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서울엄마아빠택시', '택시이용권(포인트) 10만원 지원'|| char(10) ||'(1.23. ~ 11.30. 까지 신청, 단 예산 소진시 종료)', '서울시 25개 자치구에 주소를 둔 24개월이하 영아 양육가정(22년 1월생부터)', '○ 신청방법'|| char(10) ||'아이엠 택시(앱) 설치 및 실행 > 메뉴버튼 클릭 > 서울엄마아빠택시 이용안내 클릭 후 신청(신청자, 신청영아 정보 입력, 증빙자료 등록 등)'|| char(10) ||''|| char(10) ||'○ 이용방법'|| char(10) ||'아이엠 택시(앱) 실행 및 로그인 > 출발지와 도착지 입력 > 차량유형 및 이용타입 선택 > 결제수단 \"포인트\" 체크'|| char(10) ||'※ 아이를 동반하지 않고 탑승할 경우 포인트 결제 불가, 미동반 탑승 적발시 포인트 환수', 'https://umppa.seoul.go.kr/hmpg/cogo/como/pata/bzmgPageDetail.do?biz_mng_no=3EF7489ACF614F939FEF8514308797D2', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서울엄마아빠VIP존', '아이동반 외출 시, 양육자와 아이의 휴식이 가능하면서 수유 · 돌봄 · 놀이 등 육아 편의를 제공하는 양육자를 위한 전용(VIP) 공간 조성 (적정 곤간을 갖추고, 시설별 특성에 맞는 서비스를 제공)'|| char(10) ||'① 기본형 : 아기쉼터, 기저귀교환대 등 육아편의 공간 제공'|| char(10) ||'② 휴식형 : 아이와 머무르며 쉬고 놀 수 있는 개방형 휴식공간 제공'|| char(10) ||'③ 완성형 : 양육자가 문화 · 여가생활을 할 수 있도록 돌봄 · 놀이공간 제공'|| char(10) ||'※ 시설 여건 및 이용자 수요에 따라 조성', '영유아 및 아이 동반 양육자', '아트책보고, 세종문화회관 등 방문시 이용', 'https://umppa.seoul.go.kr/hmpg/cogo/crou/sevi/bzmgPageDetail.do?biz_mng_no=C4162D7D51244DF3BEFEF8CDCECC93F2', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('가족화장실', '남녀 구분 없이 영유아 동반 엄마아빠의 이용이 편리하도록 설비와 물품 등을 갖춘 화장실 조성', '아이 동반 가족', '공공화장실, 공공시설, 공원, 한강공원, 수변공간 등 방문시 이용가능', 'https://umppa.seoul.go.kr/hmpg/cogo/crou/faba/bzmgPageDetail.do?biz_mng_no=9C2AF79E185F44678691F88ACB111DBC', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('가족배려주차장', '서울시 공공 · 민간주차장(30면 이상) 10% 이상을 가족배려주차장으로 조성'|| char(10) ||'약자 동반 가족을 배려하는 新 주차문화 조성', '① 임산부 또는 임산부를 동반한 사람'|| char(10) ||'② 6세 미만 영유아 동반 차량'|| char(10) ||'③ 고령 등으로 일상생활에서 이동이 불편한 사람 또는 이를 동반한 사람', '가족배려주차장 이용대상 우선 주차', 'https://umppa.seoul.go.kr/hmpg/cogo/crou/fapa/bzmgPageDetail.do?biz_mng_no=3FB5CAF65EB24F71B7C274970C425B7E', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서울장난감도서관', '- 장난감, 도서, DVD 대여'|| char(10) ||'- 장애 영유아 장난감 대여- 육아용품 대여', '0~6세 자녀를 양육하는 서울시민', '서울 장난감도서관(https://seoultoy.or.kr/) 회원가입 후 이용', 'https://umppa.seoul.go.kr/hmpg/cogo/crpa/seto/bzmgPageDetail.do?biz_mng_no=5860EBA4DC8B4DA4B7391EDAC4A197EB', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('다둥이 행복카드', '서울시에 주민등록이 되어있는 2자녀 이상을 둔 가정(막내가 18세 이하)', '다자녀가족', '다둥이행복카드 협력업체 이용시 카드 제시 또는 결제', 'https://umppa.seoul.go.kr/hmpg/cogo/crou/exmu/muca/bzmgPageDetail.do?biz_mng_no=C692C02DCC084E7BA5A232101911372D', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서울형 가사서비스', '임산부, 맞벌이, 다자녀 가정에 1가구당 총 10회의 가사서비스 제공(1회당 4시간, 1시간당 10분 휴게시간 포함)', '서울거주 중위소득 150%이하 임산부, 맞벌이, 다자녀 가정', '서울형 가사서비스 지원관리시스템 온라인 신청 (서울 가사서비스 (seoulgasa.or.kr))', 'https://umppa.seoul.go.kr/hmpg/liba/rebu/sest/bzmgPageDetail.do?biz_mng_no=004E674AA0674309AF881CBD860D24AB', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('외국인 가사관리사 시범사업', '서울지역 맞벌이 가구 등을 대상으로 외국인 가사관리사가 양육가정의 가사와 육아를 제공하는 서비스', '육아와 가사 부담을 겪는 20~40대 맞벌이 부부, 한부모, 임산부 등 우선 선정', '서비스 제공기관 홈페이지(혼스토리생활, 휴브리스)에서 신청(''24.8월 예정)', 'https://umppa.seoul.go.kr/hmpg/liba/rebu/pipr/bzmgPageDetail.do?biz_mng_no=0628118D5CA41566E063A60221627BA4', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('아동수당', '아동 1인당 월 10만원 지급(아동이 90일 이상 해외 체류하는 경우 지급 중단)', '대한민국 국적을 보유(국적법에 따른 복수국적자 및 난민법에 따른 난민인정자 포함)하고 주민등록법에 따른 주민등록번호가 정상적으로 부여(사회복지 전산관리번호 부여 대상자 및 주민등록법에 따른 거주불명자 중 실제 거주지가 확인되는 자 포함)된 8세 미만 아동(0~95개월)', '거주지 관할 읍 · 면 · 동주민센터 또는 온라인 신청 (bokjiro.go.kr)', 'https://umppa.seoul.go.kr/hmpg/reca/dive/chal/bzmgPageDetail.do?biz_mng_no=ED3EC6C62E764B4DA1120C7F63940B04', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
