INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('미숙아 및 선청성이상아 의료비 지원', '○ 미숙아 : 체중별 최고 1,000만원까지 수술 및 치료비 지원'|| char(10) ||'○ 선천성이상아 : 최고 500만원까지 수술 및 치료비 지원', '○ 기준 중위소득 180% 이하 가구의 미숙아 및 선천성 이상아 출산 가정'|| char(10) ||'○ 둘째아 이상 출생아가 미숙아 및 선천성 이상아인 경우(첫째로 출생한 쌍둥이는 다자녀로 인정하며, 소득수준에 관계없이 지원)', '○ 대상 영아의 부모가 (최종)퇴원일로부터 6개월 이내에 제출 서류를 구비하여 신청일 기준 대상 영아의 주민등록 주소지 관할 보건소로 신청'|| char(10) ||'- 신청기간을 경과한 신청 건은 보건소장이 그 사유가 타당하다고 인정할 경우 지원 가능'|| char(10) ||'- 퇴원전 의료비 신청(중간정산)은 청구금액이 지원한도를 초과한 경우에만 가능', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('선천성대사이상 검사 및 환아관리', '신생아 선천성대사이상 외래 선별검사비의 (일부)본인부담금 지원, 선천성대사이상 선별검사 결과 유소견 판정 후, 선천성대사이상 질환 관련 확진검사를 받은 경우 확진검사비의 (일부)본인부담금지원, 선천성대사이상질환 환아 등록관리', '선천성 대사이상의 유무를 초기에 발견하여 치료하고 장애발생을 사전에 예빵하여 영유아 건강 증진', '○ 대상 영아의 부모가 출생일로부터 1년 이내에 제출서류를 구비하여 신청일 기준 대상 영아의 주민등록 주소지 관할 보건소로 선정', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('선천성대사이상 검사 및 환아관리(난청, 보청기)', '○ 신생아청각선별검사비 지원'|| char(10) ||'○ 난청 선별거사 결과 재검으로 판정된 경우, 난청확진검사비 지원'|| char(10) ||'○ 보청기 지원 : 양측 보청기 지원(131만원 한도)', '○ 난청 검사비 : 기준 중위소득 180% 이하 가구의 영아'|| char(10) ||'○ 보청기 지원 : 기준 중위소득 180% 이하 가구의 만 3세 미만 영유아 중 양측성 난청이면서 장애 등급을 받지 못하는 난청 환아'|| char(10) ||'※ 다자녀(2명 이상) 가구의 영아는 소득수준에 관계없이 지원', '출생일 기준 1년 이내 주소지 관할 보건소 방문 신청', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('임산부 및 영유아 영양플러스 사업', '대상자의 영양문제 개선을 위하여 맞춤형 영양교육과 보충식품 지원', '아래 대상자 중 영양위험군(빈혈, 성장부진, 영양섭취불량 중 1가지 이상 보유자)'|| char(10) ||'- 영유아 : 6세(생후 72개월)까지'|| char(10) ||'- 임산부'|| char(10) ||'- 출산 · 수유부'|| char(10) ||'- 사업 참여 중에 유산 혹은 사산한 여성도 출산부의 범주에 포함', '관할 보건소 문의 또는 온라인(보조금 24) 신청', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
