INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('저소득층 조제분유 지원', '조제분유 및 이유식 구매비용 정액 지원', '0~24개월 미만 영아를 둔 가구 중'|| char(10) ||'1) 기초생활보장 수급자, 차상위계층, 한부모가족 자격보유 가구'|| char(10) ||'2) 기준중위소득 80% 이하 장애인, 기준중위소득 80% 이하 다자녀(2인 이상) 가구'|| char(10) ||'3) 산모의 질병 · 사망으로 모유수유가 불가능한 경우'|| char(10) ||'4) 아동복지시설 · 공동생활가정 · 가정위탁 아동, 한부모(부자, 조손)가정인 경우'|| char(10) ||'5) 산모의 의식불명, 장기간(4주 이상) 입원, 유선손상 등 의사가 모유수유가 불가능하다고 판단하는 경우', '온라인 신청(복지로), 방문 신청(영아 주민등록 관할 보건소, 동주민센터)', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('한부모가족 자녀 양육비 지원', 'ㅇ아동양육비: 저소득 한부모 가족의 18세 미만 자녀 1인당 월 21만원'|| char(10) ||'   ※생계급여를 지원받는 한부모 가족의 18세 미만 자녀도 동일하게 지원'|| char(10) ||'ㅇ추가 아동양육비: '|| char(10) ||'1)조손가족 및 35세 이상 미혼 한부모 가족의 5세 이하 아동 1인당 월 5만원'|| char(10) ||'2)25세 이상 34세 이하 청년 한부모 가족: '|| char(10) ||'- 5세 이하 아동 1인당 월 10만원'|| char(10) ||'- 6세 이상 18세 미만 아동 1인당 월 5만원'|| char(10) ||'ㅇ학용품비: 한부모가족(조손가족 포함)의 중고등학생 자녀 1인당 연 9.3만원'|| char(10) ||'ㅇ생활보조금: 한부모가족 복지시설에 입소한 저소득 한부모가족(조손가족 포함) 가구당 월 5만원', '서비스별 지원대상'|| char(10) ||'ㅇ아동양육비: 지원대상자로 결정된 저소득 한부모가구의 18세 미만의 아동'|| char(10) ||'ㅇ추가아동양육비: 1)조손가족 및 35세 이상 미혼 한부모가족의 5세 이하 자녀 2)25~34세 이하 청년 한부모가족의 18세 미만 자녀'|| char(10) ||'ㅇ학용품비: 한부모가족(조손가족 포함)의 중학생 및 고등학생 자녀'|| char(10) ||'ㅇ생활보조금: 한부모가족 복지시설에 입소한 저소득 한부모가족(조손가족 포함)', '온라인 신청(복지로), 방문 신청(영아 주민등록 관할 보건소, 동주민센터)', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('임신출산 진료비 지원', 'ㅇ1,2종 구분 없이 단태아 100만원, 다태아는 태아당 100만원 지원'|| char(10) ||'ㅇ임신·출산 진료비는 입원·외래를 불문하고 의료급여기관에서 진료 받은 본인부담금(비급여 포함)에 대하여 사용 가능'|| char(10) ||'ㅇ수급권자의 약제·치료재료 구입에 드는 비용'|| char(10) ||'ㅇ임산부는 임신·출산 진료비를 보장기관이 지원 결정한 날부터 출산예정일(출산일)로부터 2년까지 사용'|| char(10) ||'ㅇ임신·출산 진료비 신청일 이전에 부담한 본임부담금에 대해서는 소급하여 적용하지 않으며, 지원기간 내 미사용한 금액은 소멸', '의료급여 수급자 중 임신 중이거나 출산(유산 및 사산 포함)한 수급권자 및 출생일로부터 2세미만 영·유아'|| char(10) ||' ※2019.7.1.부터 자궁 외 임신도 포함, 자궁 외 임신의 판단은 의사의 소견서로 갈음', '수급자는 의료급여 임신·출산 진료비 지원(변경)신청서 등의 서류를 주소지 관할 구청장(동장)에게 제출'|| char(10) ||'*의사소견서는 발행한 지 1주일 이내만 인정', 'https://umppa.seoul.go.kr/hmpg/chpo/chre/cntg/cntgListPage.do', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('도봉구 출생축하용품 지원', '사업명 : 도봉구 \"오!사방복지\" 출생축하용품 지원사업'|| char(10) ||''|| char(10) ||'지급내용 : 아기양말, 기저귀, 방수패드, 물티슈 등'|| char(10) ||''|| char(10) ||'지급방법 : 신청인이 희망하는 장소로 택배 배송', '2024. 1. 1. 이후 출생한 도봉구 거주 아동', '동 주민센터 방문신청 또는 정부24 맘편한 임신 온라인 신청', 'https://www.dobong.go.kr/Contents.asp?code=10010135', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('임산부 교통비 지원사업', '정책내용 : '|| char(10) ||'* 임산부 1인당 교통비 70만원'|| char(10) ||'* 임산부 본인 명의 신용(체크)카드에 70만원 교통 포인트 지급'|| char(10) ||''|| char(10) ||'신청 기한 : 임신 3개월(12주차) ~ 출산 후 3개월'|| char(10) ||''|| char(10) ||'사용 기한 : '|| char(10) ||'* 임신기간 중 신청 : 바우처 지원일 ~ 분만예정일로부터 6개월이 되는 달의 말일'|| char(10) ||'* 출산 후 신청 : 바우처 지원일 ~ 자녀출생일(자녀 주민등록일)로부터 6개월이 되는 달의 말일', '신청일 기준 서울시 거주 임산부'|| char(10) ||'신청일 기준 서울시 거주 다문화 가족 외국인 임산부(부부 모두 외국인인 경우 제외)', '* 정부24 신청'|| char(10) ||'* 동 주민센터 방문 신청', 'https://www.seoulmomcare.com/notice/businessGuide.do', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('강남 공공형 실내놀이터', '미세먼지와 눈, 비 등의 기후영향과 안전한 외부 놀이 환경의 부재로부터 우리 아이들의 놀 권리를 지켜줄 수 있는 공공형 실내놀이터입니다. 또한, 보호자와 아이의 긍정적 교류를 도모하여 건강한 가족문화 형성에 기여하고자 합니다.'|| char(10) ||''|| char(10) ||'운영요일 및 시간 : 화요일 ~ 일요일, 10:00 ~ 18:00 (1회당 2시간 이용)'|| char(10) ||''|| char(10) ||'이용료 : 1,000원 / 1인, 1회', '6세 이하의 추학전 아동 (보호자 동반 필수)', '강남구청 홈페이지 소통메뉴「실내놀이터 사전예약 신청」', 'https://www.gangnam.go.kr/main.do#', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('다문화가족 방문교육 서비스', '※ 다문화가정에 방문교육 지도사가 방문하여 한국어교육, 부모교육, 자녀생활교육을 제공합니다.'|| char(10) ||'- 한국어교육 서비스 : 방문 지도사와 한국어 학습'|| char(10) ||'- 부모교육 서비스 : 생애주기별(임신 · 신생아기, 유아기, 아동기) 각 1회 지원'|| char(10) ||'- 자녀생활 서비스 : 자녀에게 학교생활 및 사회성 발달지원 지도'|| char(10) ||''|| char(10) ||'※ 한국어교육, 부모교육, 자녀생활 서비스를 동시에 지원받을 수 없습니다.'|| char(10) ||''|| char(10) ||'※ 지역 내 타 기관의 유사서비스 중복지원이 불가능합니다.', '※ 방문 한국어교육 서비스는 최초 입국 5년 이하*의 결혼이민자와 중도입국 자녀를 지원합니다.'|| char(10) ||' * 단, 입국 5년 이상이 경과한 경우라도 임신, 출산, 취업 등 타당한 이유가 있는 경우, 지자체장과 협의 하에 지원 가능'|| char(10) ||'※ 방문 부모교육 서비스는 임신·신생아기, 유아기, 아동기 각 생애주기별 각 1회 지원합니다.'|| char(10) ||'※ 방문 자녀생활 서비스는 만 3세~만 12세 이하의 다문화가족 자녀, 중도입국 자녀를 지원합니다.', '온라인 신청(복지로), 방문 신청(동 주민센터)', 'https://www.bokjiro.go.kr/ssis-tbu/twataa/wlfareInfo/moveTWAT52011M.do?wlfareInfoId=WLF00003192', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('신생아 건강보험료 지원', '1인당 월 2만원 내외 건강보험료 지원(5년납입, 5년보장)', '동작구에 주민등록을 두고 거주하는 부부가 출산 및 입양한 셋째이상 신생아'|| char(10) ||'(대상자녀가 동일세대원이어야 하며, 2009. 1. 1 이후 출생아부터 해당)', '출생 후 1년이내 관할 동주민센터 신청 > 영유아보육과 대상자 확정 > 명단보험사 통보 > 보험사와 신청인과 청약서 작성', 'https://www.dongjak.go.kr/portal/main/contents.do?menuNo=200292', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('\"다자녀가정 실내 바닥매트\" 지원', '서초구에 주민등록을 두고 거주중인 세자녀이상 가정에 실내 바닥매트 1개 지원', '중학생이하 세자녀이상 모든 가정', '구홈페이지 온라인신청 또는 동주민센터, 구 여성보육과 방문'|| char(10) ||'※ 신청후 2주 내 배송 예정'|| char(10) ||'※ 기지원 가정은 중복신청 불가', 'https://www.seocho.go.kr/site/seocho/ex/mat/MatSupportFView.do', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서초아이돌보미 · 손주돌보미 지원', '(서초 아이돌보미) 월 50시간 아이돌보미 파견(이용가정 부담액 : 3,000원/1일, 할증요금은 추가될 수 있음.)'|| char(10) ||'(서초 손주돌보미) 손주돌봄 활동수당 지원(월 최대 30만원, 월 40시간 활동지원금 지원)', '(서초 아이돌보미) 서초구 1년이상 거주중인 한자녀(맞벌이) 이상 양육가정 (단, 돌봄자녀가 24개월 이하)'|| char(10) ||'(서초 손주돌보미) 서초구 1년이상 거주중인 한자녀 이상 양육가정이며 조부모가 손주돌보미 교육과정 23시간 수료한 자(단, 돌봄자녀가 24개월 이하)'|| char(10) ||'※ 조부모는 손주돌보미 교육 신청 서류접수 전까지 주민등록 주소가 서초구로 되어있으면 됨. (거주기간은 상관없음)', '서초구가족센터(https://seochofamily.com/) 신청', 'https://www.seocho.go.kr/site/seocho/04/10402010302002015070605.jsp', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('서초119 아이돌보미 지원', '긴급아이돌보미 파견(일 2~4시간/월 최대 6회 이용가능)', '서초구 거주중인 생후3개월~12세 이하 자녀양육 가정으로 맞벌이, 출장, 질병, 입원 등 긴급한 사유가 있는 경우', '서초구가족센터(https://seochofamily.com/) 신청', 'https://seochofamily.com/', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
INSERT INTO KIDS_POLICY (KIDS_POLICY_TITLE, KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES ('양천형 밤샘 긴급돌봄', '급작스런 출장, 밤샘근무, 사고 · 입원 등 긴급한 사유 발생시 이용 가능'|| char(10) ||''|| char(10) ||'운영시간 : 연중 상시(1.1일, 12.25일, 설 · 추석연휴 제외)'|| char(10) ||''|| char(10) ||'이용시간 : 19시 30분 ~ 익일 07시 30분, 아동당 최대 월 80시간'|| char(10) ||'* 보육중인 아동과 교직원 안전을 위해 22:00 ~ 익일 07:30중에는 중도퇴소 불가'|| char(10) ||''|| char(10) ||'봉규료 : 가정부담 시간당 1,000원', '양천구 거주 12개월 ~ 6세 미만 영유아', '온라인 신청 또는 전화, 방문 등록'|| char(10) ||'* 이용신청 : '|| char(10) ||'(평일) 당일 19시 전까지 신청 가능(정원 미초과시)'|| char(10) ||'(주말) 금요일 19시 전까지 사전 예약'|| char(10) ||''|| char(10) ||'* 반정원 : '|| char(10) ||'최대 5명(보육실 면적 기준 고려)'|| char(10) ||'- 이용 아동연령 및 교사 대 아동비율 준수하여 운영'|| char(10) ||'- 신청아동 중 만0세 포함 시 1:3 으로 운영될 수 있음', 'https://www.yangcheon.go.kr/site/yangcheon/05/10503021201002023042509.jsp', 'SERVICES_SUPPORT',  now(), now(), FALSE, 1);
